(75, 'Apartment In Compound Mid Town Condo', '30.0444196', '31.23571160000006', 130, 1981000, 0, 2, 3, NULL, 3, 'مساحة الشقة : 130 متر\r\n--------------------------\r\nمساحة الجاردن : 115  متر\r\n--------------------------\r\nمكونة من : 2 غرف نوم + 2  حمام \r\n--------------------------------\r\nخطة الدفع : مقدم 10 % والباقي علي 7 سنوات بدون فوائد\r\n---------------------------------------------------------\r\nقامت شركة بيتر هوم للإستثمار العقارى بإطلاق مشروع ميدتاون كوندو العاصمة الإدارية الجديدة بعد نجاحها\r\n\r\nفى إنجاز مشروعيها فى العاصمة الإدرية الجديدة ميدتاون و ميدتاون صولو فيلات فقط\r\n\r\nنجد أن شركة بيتر هوم العملاقة قامت بإنجاز العديد من المشاريع .\r\n\r\nسابقة الاعمال : -\r\n\r\nميدتاون أمام الجامعة الأمريكية بالتجمع الخامس\r\n\r\nكايرو بيزنس بلازا بالتجمع الخامس - كايرو بيزنس باى بالتجمع الخامس\r\n\r\nكايرو بيزنس جيت بالتجمع الخامس - هايلاند بارك بالتجمع الخامس\r\n\r\nهايلاند بارك فى 6 أكتوبر - كايرو ميديكال سنتر فى 6 أكتوبر\r\n\r\nسيتى سكيب مول فى 6 أكتوبر - سيتى سكيب مول فى المنيا\r\n\r\nميجا مول فى 6 أكتوبر\r\n\r\nيقع مشروع ميدتاون كوندو العاصمة الإدارية الجديدة فى الحى السكنى R7 وهو من \r\n\r\nالاحياء المتميزة\r\n\r\nيقع المول علي شارع رئيسي يخدم 2100 شقة وحدة سكنية كما يقع بين فندق الماسة وقاعة \r\n\r\nالمؤتمرات والحي الدبلوماسي علي شارع 120 متر رئيسي\r\n\r\nلعرفة باقي التفاصيل : -\r\n\r\nالمستشار العقاري / محمود سالم \r\n\r\nالاتصال أو واتس اب علي رقم :  01159204455 \r\n\r\nالقاهرة الجديدة - التجمع الخامس - الساحل الشمالي - العاصمة الادارية - \r\nشارع التسعين - شارع بن زايد - مجمع البنوك - وحدات ادارية - وحدات سكنية - وحدات للايجار - فيلا مستقلة - توين هاوس - تون هاوس - شاليهات .', NULL, 92, '2018-11-11 17:29:10', '2019-03-26 16:35:16', 1, 1, 1, 16, 1, 1, '2020-07-18', 70, 'true', 'true', 'true', 5, '[\"[\\\"17,13,11,6,5,4,3,1\\\"]\"]', '2018-11-11 14:48:31', NULL, 0, NULL, 23, 0, 1, 0),
