(174, 'شقة القومية 235م  سوبر لوكس باصة ع 3شوارع', '30.7326622', '31.719545899999957', 235, 2225000, 0, 4, 2, NULL, 2016, 'شقة الترا سوبر لوكس \r\nواجهة بحرى \r\nع 3شوارع \r\nالامن الغذائى الرئيسى \r\nوشاع القومية \r\nوامتداد شارع القومية \r\nكاملة المرافق والخدمات \r\nمعمول فيها شغل عالى اوى \r\nلعشاق الرفاهية والفخامة \r\nمستوى للريسبشن \r\n4غرف نوم /4ريسبشن /ليفنج /2حمام /مطبخ\r\nمياة /كهربا /غاز', NULL, 139, '2018-11-25 17:37:38', '2019-03-26 12:56:13', 1, 3, 1, 34, 1, 1, '2020-07-18', 0, 'true', '', 'true', 1, '[]', NULL, NULL, 0, NULL, 263, 0, 1, 0),
(175, 'شقه للبيع 141م بالقرب من نادي وادي دجله ع طريق السويس', '30.057198076948737', '31.329438711816465', 141, 230000, 1, 3, 2, NULL, 2019, 'يقع الكمبوند أمام GW ماريوت، موقع مميز جدا بعد دقيقتين من إمتداد شارع الثورة بالتقاطع مع الدائري بالظبط\r\n10 د من مصر الجديدة \r\n10 د من التسعين \r\n5 د من مدينة نصر\r\n7 د من القاهرة الجديدة\r\n15 د من هليوبليس الجديدة \r\n\r\n#شقه #للبيع 141م (2 غرفه نوم _2 حمام _ مطبخ _ ريسيبشن _ تراس)\r\nتم تسليم مرحله اولي بالكمبوند قبل موعدها ب 6 شهور \r\n\r\nالكمبوند متكامل الخدمات ( مول عالمي (m sqare dubai) -خدمه المنازل الذكيه - مطاعم وكافيهات - ملاعب رياضيه - 2 مدارس انترناشونال - نادي الجزيره - نادي رياضي - مساحات خضراء -ملاعب متنوعه-- حراسات امنيه 24 ساعه-- جراجات خاصه للملاك - هايبر ماركت لتوفير كافه الاحتياجات - مركز طبي متكامل )\r\n\r\nبمقدم 230 الف والباقي تقسيط ع 120 شهر', NULL, 132, '2018-11-25 17:40:06', '2019-03-26 13:04:17', 1, 3, 1, 16, 1, 1, '2020-07-18', 14, 'true', '', 'true', 5, '[]', NULL, NULL, 0, NULL, 68, 0, 1, 0),
