(192, 'باقل مقدم وبدن فوائد شاليه 140م بالتقسيط', '29.6325617', '32.330017099999964', 140, 302000, 1, 3, 2, NULL, 2019, 'شاليهك ف السخنة بعد فندق موف نبيك وقبل بورتو السخنه بربع ساعه فى موقع مميز جدااااا عالجبل \r\n\r\nامتلك شاليه بفيو رااائع للبحر والكريستال الجون \r\nلان القريه مبنيه على مصاطب طبيعيه ده هيخليك تشوف البحر من اي مكان فالقريه \r\n\r\nمتشطب سوبر لوكس \r\nالشاليه 140م (( 3 غرف و2 حمام ومطبخ وريسبشن وتراس)) \r\n\r\nالقريه خدماتها مش هتلاقيها ف اي مكان تاني \r\nاول crystal lagoon ف البحر الاحمر\r\n,ولأن القريه عالجبل هتلاقي كل الرياضات المتعلقه بالجبال (تسلق جبال وتلفريك للتنقل عن طريق الجبل وتسلق جبال بالعجل وغيرها كتير انشطه مميزه جدا )\r\nده غير فندق ومنطقه مطاعم وكافييهات وخدمات كتير \r\nالقريه ليها شاطئ خاص وكوبري من القريه بيوصل للبحر \r\n\r\nبمقدم (302 الف ) وقسط الباقي ع 8 سنين بدون فوائد', NULL, 132, '2018-11-25 21:29:01', '2019-03-26 13:18:42', 10, 3, 1, 37, 1, 1, '2020-07-18', 0, 'true', '', 'true', 2, '[]', NULL, NULL, 0, NULL, 253, 0, 1, 0),
