(280, 'mivida', '30.0102788', '31.537906700000008', 550, 11500000, 0, 4, 4, NULL, 2016, 'فيلا مستقلة 550 م للبيع بــ كمبوند\" ميفيدا إعمار \r\n\r\n  \" Mivida Emaar بالتجمع الخامس\r\n\r\nموقع متميز للكمبوند علي شارع التسعين الجنوبي مباشرة \r\n\r\nفيو رائع علي لاند سكيب\r\n\r\nمساحة الارض 550 متر ومساحة المباني 270 متر\r\n\r\nجاردن 300 متر - Heated Pool \r\n\r\n4 غرف نوم \r\n\r\n3 حمام \r\n\r\n ريسيبشن 4 قطع \r\n\r\n 2 Living Room \r\n\r\nغرفة للناني \r\n\r\n- spanish kitchen \r\n\r\nتشطيب الترا سوبر لوكس \r\n\r\nإستلام فوري - Fabulous Finishes\r\n\r\nالبيع بالفرش\r\n\r\n                                                    \r\nلا يبعد \"ميفيدا\" سوى دقائق قليلة فقط عن حرم الجامعة الأمريكية في القاهرة الجديدة، وهو من تطوير شركة \"إعمار مصر\"، ويمزج بين نمط حياة المدن والمناظر الطبيعية المحيطة .\r\nويمتد \"ميفيدا\" على مساحة تتجاوز 3,8 مليون متر مربع، ويبعد مسافة لا تتعدى 20 دقيقة عن مطار القاهرة الدولي، ويشتمل على حوالي خمسة آلاف وحدة سكنية من تصميم مهندسين عالميين.\r\nويمثل المشروع مفهوماً جديداً في قطاع التطوير العقاري بمصر، وهو يضم وحدات سكنية أصغر حجماً، وتمتاز بتصاميم ذكية، وأسعار تنافسية، وتشطيبات متكاملة وجاهزة للتأثيث.\r\nيشتمل \"ميفيدا\" على مساحات تجارية ومرافق عصرية متكاملة.', NULL, 148, '2018-12-02 18:31:46', '2019-03-25 15:43:22', 14, 1, 1, 16, 1, 1, '2020-07-18', 19, 'true', 'true', 'true', 1, NULL, NULL, NULL, 0, NULL, 31, 0, 1, 0),
