(415, 'Opportunity Villa in Pk2 installments', '30.0444196', '31.23571160000006', 458, 7955000, 0, 4, 4, NULL, 2018, 'Villa resale in Palm Hills Katameya Extension, New Cairo\r\n\r\nPrime Location overlooking on landscape \r\n\r\nLand Area : 458 m2 \r\n\r\nBUA : 312 m2 ( Ground + First + Penthouse ) & Roof terrace 102 sq.m \r\n\r\nDelivery Date : 12/ 2018 \r\n\r\nSemi finished\r\n\r\nTotal Price : 7.955.000 L.E ( including All Fees  ) \r\n\r\nPayment method : 3.669.000 L.E cash & The rest till 11/2020\r\n\r\n\r\nA prestigious, residential community set on a sprawling 434k sqm in New Cairo. Cleverly master planned and designed, the homes in Palm Hills Katameya Extension offer beautifully designed twin and townhouses, villas and stand-alones. The project has been landscaped to encompass beautiful gardens and lots of open, green spaces. Residents of this community will also have access to all the amenities and facilities of sister developments, Palm Hills Katameya and Village Gardens Katameya.', NULL, 156, '2018-12-19 21:21:21', '2019-03-24 17:17:33', 14, 1, 1, 16, 1, 1, '2020-07-18', 0, 'true', 'true', 'true', 5, '[\"13\",\"12\",\"10\",\"6\",\"5\",\"4\",\"3\",\"2\",\"1\"]', NULL, NULL, 0, NULL, 29, 0, 1, 0),
(416, 'Townhouse in Palm Valley installments till 2022', '29.9285429', '30.918782700000065', 383, 5630000, 0, 4, 4, NULL, 2019, '- Town house resale installments in Palm Valley Compound 6th of October \r\n\r\n- prime location overlooking on Big space greenery \r\n\r\n- Land area : 383 sq.m \r\n\r\n- Built Up Area : 270 sq.m ( Ground Floor - First Floor - Penthouse ) + Roof Area 68m\r\n\r\n- Semi Finished \r\n\r\n- Total Price : 5.630.000 L.E ( including All Fees ) \r\n\r\n- Payment Method : Upfront ( 2.994.000 L.E) & The rest installments till 6/2022\r\n\r\n\r\nBuilt over a scenic 56.8 feddan approximately 238k sqm on a conveniently strategic, central location overlooking the 26th of July Corridor, Palm Valley houses 237 homes and neighbors the monumental Palm Hills October with all its available amenities and facilities, including Palm Hills club and signature golf course. Palm Valley brings a taste of the city to the great outdoors. 5% of the project is allocated for a commercial component to make it a truly accommodating mixed-use lifestyle for all to enjoy. Young or old, boy or girl, solo or family in tow, you\'ll find it all at home, at Palm Valley. Blending form, function, fashion and freedom .', NULL, 156, '2018-12-19 21:26:42', '2020-03-11 09:43:06', 13, 1, 1, 21, 1, 1, '2020-07-18', 10, 'true', 'true', 'true', 5, '[\"[\\\"12,10,6,5,4,3,2,1\\\"]\"]', '2018-12-23 09:11:46', NULL, 0, NULL, 74, 8, 1, 0),
