(586, 'محل تجارى للبيع 200م سموحة -بجوار مركز الاسكندرية للعيون', '31.2000924', '29.91873869999995', 200, 7000000, 0, 1, 2, NULL, 2006, 'محل تجارى للبيع 200م سموحة (بجوار مركز الاسكندرية للعيون) - 7,000,000 جنيه كاش، الوكيل/ مصطفى شكر 01011555576\r\n• المساحة: 200م (واجهة أمامية 5م).\r\n• 2 حمام.\r\n• الدور: أرضي مرتفع.\r\n• سنة البناء: 2006. \r\n• الرخصة: مرخص تجاري مع الرسم الهندسي المعتمد من الحي.\r\n• العدادات: (عدادات كهرباء 3 فاز 380 + عداد مياه).\r\n• التشطيب: سوبرلوكس (لم يفتتح من قبل).\r\n• مميزات إضافية: باب المحل أوتوماتيك بريموت كنترول - توصيلات تليفون أرضي و إنترنت و شبكة كاميرات مراقبة - نظام صوتي بالسماعات موزع داخل المحل - 5 أجهزة تكييف جديدة.\r\n• السعر: 7,000,000 جنيه كاش.\r\n• كود: 001401', NULL, 209, '2019-01-21 17:09:21', '2019-03-21 17:21:30', 18, 3, 1, 11, 1, 3, '2020-07-18', 4, 'true', 'true', 'true', 2, '[\"14\",\"6\"]', NULL, NULL, 0, NULL, 156, 0, 1, 0),
(587, 'العاصمة', '30.8480986', '30.34355060000007', 150, 765000, 0, 3, 2, NULL, 2019, 'فكرة اﻟﻣﺷروع \r\n إنشاء ﻣﺟمع  ﺳﻛـني إداري تجاري ﻣﺗﻛامل الخدمات  ﺑمدينة دمنهور .\r\nالموقع العام للمشروع  \r\nﯾﻘﻊ اﻟﻣﺷروع  ﻋﻠﻰ الطريق الزراعي رأسا بمدخل مدينة دمنهور الجنوبي الغربي  في محافظة البحيرة .\r\nوصف المشروع \r\n4850م تقريباً \r\nحيث يتكون من بدروم (جراجات ) + دور أرضي محلات + 3 أدوار مول تجاري متكامل + 8 أدورا سكني .\r\nالبدروم عبارة عن جراجات بكامل المسطح لتغطية إحتياجات المول التجاري - الوحدات الإدارية - الوحدات السكنية .\r\nالمجمع السكني : يتكون من 5 أبراج سكنية ذات مساحات مختلفة من 140م 300م .\r\nالتسليم  : نصف تشطيب للوحدات السكنية  مع تشطيب كامل للمداخل والواجهات والخدمات العامة بالإضافة إلي تشطيب كامل فاخر للمول التجاري \r\nمميزات المشروع \r\n*أكبر مول تجاري في دمنهور .\r\n* شركات متخصصة للأمن والحراسة .\r\n* منطقة سكنية جديدة هادئة قريبة من جميع الخدمات .\r\n* التصميم المعماري والإنشائي لأكبر بيوت الخبرة في مصر.\r\n* يعتبر المشروع أول كومباوند سكني متكامل الخدمات بمدينة دمنهور.\r\n* خدمات ذكية للمشروع علي أحدث نظام تكنولوجي \r\nخدمات المشروع \r\n* نظام الأمان (بوابات أمان - كاميرات مراقبة - أفراد أمن 24 ساعة - نظام إطفاء حرائق ).\r\n*شركة إدارة وصيانة المشروع     * وحدات معالجة للمياه   * مولدت كهرباء \r\n  * سنترال داخلي يربط الوحدات   * دش مركزي \r\n* عربية إسعاف       * عيادة طوارئ          \r\n* سيارة متخصصة لأعمال النظافة وإزالة القمامة تدار من خلال الشركة المسئولة عن إدارة المشروع .\r\n* واجهات  فاخرة مطعمة من السيكوريت والكلادينج      \r\n*طرقاات تهوية     * واجهات زجاجية فالطرقات .\r\n* المداخل فندقية حيث ( أبواب متحركة أتوماتيك من السيكوريت - الأسقف من جيبسوم بورد بتصميم فريد ).\r\n* أسانسيرات متسوبيشي ياباني - سلالم جرانيت ورخام من أجود الأنواع .\r\n* مصاعد خاصة بالمول التجاري .\r\n*وجود مجموعة من أشهر المطاعم والكافيهات العالمية .\r\n* وجود محلات من أشهر البرندات العالمية.\r\nللتواصل- 01000091296', NULL, 235, '2019-01-21 17:12:31', '2020-03-11 09:43:06', 3, 3, 1, 14, 1, 1, '2020-07-18', 36, 'true', 'true', 'true', 5, '[\"[\\\"\\\"]\"]', '2019-02-05 14:09:03', NULL, 0, NULL, 231, 8, 1, 0),
