(590, 'apartment super lux at Giza', '30.0130557', '31.2088526', 200, 1750000, 0, 3, 2, NULL, 2011, 'شقه مميزه في شارع مراد الجيزه\r\n\r\n مساحة الشقه 200 متر + حصه من مساحة ارض العماره  \r\nالشقه وجه بحري\r\nفي مكان حيوي في شارع مراد الجيزه \r\n\r\nالشقه في عماره علي الشارع الرئيسي امام نزلت الكوبري اللي قادم من شوارع الهرم و فيصل  وايضآ كل المحلات والمطاعم تحت العماره\r\n  العماره يوجد بيها 2 اسنسير\r\n  3 غرف كبيره + صالون + سوفره + 2 حمام + مطبخ كبير\r\nالعماره حيه و بها عياده مما يجعلها تصلخ ان تكون  لشركه او عياده', NULL, 116, '2019-01-21 19:43:14', '2019-03-21 17:25:32', 1, 3, 1, 21, 1, 1, '2020-07-18', 6, 'true', '', 'true', 2, '[\"17\"]', NULL, NULL, 0, NULL, 105, 0, 1, 0),
