(592, 'حدائق اكتوبر', '29.90287159999999', '31.072247800000014', 85, 350000, 0, 2, 2, NULL, 2020, 'مساحات تبداء من 90م حتى 180م \r\nمن ارقي كومبوندات فى حدائق اكتوبر يقع في  اول ارض جمعيات المستثمرين\r\nحول منطقه الخدمات قريبه جدا من حي الايطالى وبجوار مول مصر و دريم لاند و حي الاشجار و ارض المخابرات و نادى الزمالك و كومبوند كينز \r\nيتميز بـ افضل تصميم هندسي و اقوي سعر وانظمه سداد متعدده واطول فتره سداد لراحه العميل \r\n\r\nيوفر الكمبوند نمط حياة فريد من نوعه، وتتميز الوحدات بأجمل الوجهات والخدمات، حيث \r\nيحتوي على :\r\n• مساحات خضراء شاسعة.\r\n• بحيرات صناعية.\r\n• مولات تجارية.\r\n• نوادي رياضية.\r\n• مستشفي + مدرسه \r\n• دار عباده \r\n• نظافه مجانيه \r\n• انتر كم مركزي \r\n• امن وحراسه \r\n• لاند اسكيب \r\n• نافورات راقصه', NULL, 239, '2019-01-21 19:52:59', '2019-03-21 16:58:03', 1, 3, 1, 21, 1, 1, '2020-07-18', 6, 'true', '', '', 5, NULL, NULL, NULL, 0, NULL, 74, 0, 1, 0),
