(596, 'شاليهات العين السخنه كومبوند بلو بلو ...', '29.23541639999999', '32.622158300000024', 120, 1840000, 0, 3, 2, NULL, 2020, 'تراست الثقه والامان ...... شقتك بأسعار زمان \r\nمعانا هتمتلك شاليهك بالتقسيط وكمان فى افضل الاماكن بالعين السخنه كومبوند بلو بلو السخنه \r\nتقدر تقسط من 6 سنين لحد 9 سنين برحتك \r\nالمساحات مختلفه ومتنوعه ... مساحه 120 متر متقسمه (3 غرف  + ريسيبشن + لوبي + تراس + مطبخ + 2 حمام )\r\nالتشطيب سوبر سوبر لوكس الترا مودرن ,,,\r\nخدمات الكومبوند \r\n1- حمامات سباحه ..\r\n2- شلالات ..\r\n3- اكوا بارك \r\n4- جيم + نادى صحي\r\n5- سبا + جاكوزي\r\n6- مطعم عائم \r\n7- فندق 5 نجوم \r\n8- انشطه على الشاطئ \r\n9- مول تجارى \r\n10- جيت سكي..\r\n11- منطقه صياد \r\n12- شاشات على البحر \r\n13- حمام سباحه داخلى \r\n14- حمامات سباحه بأمواج \r\n15- طريق مشاه + طريق دراجات \r\nولسه خدمات كتيييييييييييير \r\nمستني ايه علشان تحجز شاليه وتصيف برحتك وكمان بالتقسيط على اطول فترات سداد', NULL, 239, '2019-01-22 14:25:55', '2019-03-21 17:03:04', 3, 3, 1, 37, 1, 1, '2020-07-18', 13, 'true', 'true', '', 1, NULL, NULL, NULL, 0, NULL, 253, 0, 1, 0),
