(599, 'شقق استلام فورى وبالتقسيط كارفور المعادى', '29.9626961', '31.276942299999973', 100, 640000, 0, 3, 1, NULL, 2019, 'كمبوند سرايات القطاميه \r\nالمكان\r\nبعد كارفور المعادى ب5 دقايق اول نزلة القطاميه السخنه \r\n5 دقايق للتجمع \r\n10 دقايق لمدينة نصر \r\n20 دقيقه مصر الجديده\r\n50 دقيقه العين السخنه\r\n20 دقيقه العاصمه الاداريه الجديده..\r\nاحجز وحدتك واستلم فورى فى كومبوند سرايات القطاميه\r\nكومبوند متكامل الخدمات على مساحه 30 فدان بمساحات خضراء\r\n\r\nالخدمات الموجوده :\r\nمسجد كبير على مساحه 2000م\r\nمول تجارى كبير فيه (مطاعم وكافيهات وهايبر ماركت وصيدليه  وكمان مجمع سينمات)\r\nصالة العاب رياضيه ولياقه بدنيه تحتوى ايضا على الساونا والجاكوزى \r\nحضانه انترناشونال خاصه باطفال الكمبوند فقط بها مناطق ترفيهيه والعاب للاطفال \r\nمركز طبى يوجد به جميع التخصصات يعمل 24 ساعه \r\n وحمامات سباحه للكبار والاطفال ( نظام تسخين )حمام سباحه مغلق للسيدات\r\n  وامن وحراسه 24 ساعه وبوابات الكترونيه وكاميرات مراقبه والجراجات من تحت العمارات .\r\nالتسليم نص تشطيب ( محاره حلوق باب شقه الوجهات الوميتال الوصلات الرئيسيه للكهرباء والمياه والصرف وصلة الدش المركزى والانتركم مرئى ايطالى  حوامل تكييفات والصرف الخاص بها  ) سقف الشقه بيكون فلات سلاب لتوفير اكبر مساحه ممكنه', NULL, 239, '2019-01-22 16:01:35', '2019-03-21 17:10:29', 1, 3, 1, 16, 1, 1, '2020-07-18', 20, 'true', 'true', '', 5, NULL, NULL, NULL, 0, NULL, 38, 0, 1, 0),
