(609, 'شقه 155 متر بامتداد النرجس التجمع الخامس', '30.0444196', '31.23571160000006', 155, 1162500, 0, 3, 2, NULL, 2022, 'يمكنك الان ان تحصل علي شقتك في اكتر الاماكن العمرانه في التجمع الخامس \r\n\r\nليه تشتري في اماكن بعيده و مفيهاش عمار بضعف التمن لما ممكن تشتري في مكان قريب من جميع الخدمات من مستشفيات لي مساجد و مطاعم \r\n\r\nوفر فلوسك و اشتري في امتداد النرجس \r\n\r\nالمكان امام عمارات النرجس مباشره , بعد جامع فاطمه الشربتلي \r\n\r\nشقق 155 متر \r\n\r\nمقدمها 15 % و قسط علي 3 سنين \r\n30 % علي 4 سنين \r\n\r\nتسليم خلال 4 سنين \r\nسعر المتر 7,500', NULL, 236, '2019-02-05 18:21:57', '2019-03-21 16:53:32', 1, 3, 1, 16, 1, 1, '2020-07-18', 9, 'true', '', 'true', 5, '[\"17\",\"6\"]', NULL, NULL, 0, NULL, 31, 0, 1, 0),
(610, 'العاصمة', '31.02535289999999', '30.471487600000046', 175, 997500, 0, 3, 2, NULL, 2019, 'كومباوند العاصمة بدمنهور\r\nأرقي كومباوند متكامل الخدمات \r\nوحدات سكنية - وحدات إدارية - مول تجاري متكامل\r\nمميزات المشروع \r\n* أكبر مول تجاري في دمنهور \r\n* شركات متخصصة للأمن والحراسة والصيانة \r\n* منطقة سكنية جديدة هادئة قريبة من جميع الخدمات - قريبة من كارفور دمنهور \r\nخدمات المشروع \r\n* واجهة كلادينج (حداثة وتمدين - سهولة النظافة - قطع ألمونتال معالج بتقنية معينة يمتص الحرارة .\r\n* طرقات تهوية - توزيع رخام فاخر -واجهات زجاجية فالطرقات \r\n*أسانسيرات ماتسوبيشي ياباني - سلالم ورخام من أجود الأنواع \r\n* المدخل ( أبواب متحركة أتوماتيكياً من السيكوريت \r\n* نظام الأمن (بوابات أمان - كاميرات مراقبة بكامل المشروع - أفرا د أمن 24 ساعة - نظام إطفاء حرائق )\r\n* شركة إدارة وصيانة المشروع - وحدة معالجة المياه - مولدات كهرباء - إنترنت فائق السرعة - إنتركم -دش مركزي - سنترال داخلي \r\n* عربية إسعاف - عيادة طوارئ - عربية نقل مخلفات - جراجات \r\nللتواصل والإستفسار -  01000091296', NULL, 235, '2019-02-05 18:23:07', '2020-03-11 09:43:06', 1, 3, 1, 14, 1, 1, '2020-07-18', 42, 'true', 'true', 'true', 5, '[\"[\\\"\\\"]\"]', '2019-02-11 12:36:08', NULL, 0, NULL, 231, 8, 1, 0),
