(629, 'روف للبيع او للايجار في التجمع الخامس الحي الاول', '30.0444196', '31.23571160000006', 300, 15000, 0, 3, 3, NULL, 2010, '\"رووف في أرقي فيلات الحي الاول بالتجمع الخامس \r\nللبيع أو للإيجار مفروش لمدة طويلة \r\n------------------------------------\r\nالمساحة الكلية للروف ٣٠٠ متر والمباني ١٧٠ متر و١٣٠ متر تراس مفتوح – (دور كامل)\r\nتشطيب سوبر لوكس (الأرضيات بورسلين واتش دي اف | والاسقف جبس أون بورد | والحمامات خامات مستورده ويوجد غاز طبيعي)\r\nمكونة من ٣ غرف نوم منهم غرفة ماستر بإثنين دريسنج و٣ حمامات ومطبخ امريكان كونتشتال وسفرة ورسبشن واسع واتنين برجولا في التراس المفتوح ومجهزة بجميع الاجهزة الكهربائية\r\n(غسالة ملابس | غسالة اطباق | بوتاجاز بيلت ان | ثلاجة | سخانات وتكييفات) \r\nالڤيو مفتوح والفيلا علي ناصية وبحري في موقع مميز جدا بالقرب من شارع التسعين وكايرو فيستفال سيتي والداون تاون والمستشفي الجوي ومنطقة الخدمات (سعودي هايبر ماركت - ومسجد الحمد)', NULL, 257, '2019-02-16 18:48:02', '2019-04-15 18:36:48', 7, 3, 1, 16, 1, 2, '2020-07-18', 54, 'true', 'true', 'true', 1, '[\"17\",\"16\",\"15\"]', NULL, NULL, 0, NULL, 31, 0, 1, 0),
