(28, 'Target Real Estate', 'Target is a real estate broker', '22396', 'uploads/comapnies/32GE5Psd8qGYxZ8FTvCsyeHOKbZn6GdzCPjzBnXU.jpeg', '01023466888', 'cairo', '11211', NULL, 'uploads/comapnies/Dk0HeuUZjTeD8oPLS8EA0N5W5XlHexnW9VzRjuMN.jpeg', 75, '2018-10-29 16:16:08', '2018-11-19 15:35:47', 1, 0, 41, 6, 0, 0, 1, 0, '2019-02-03'),
(29, 'Premier Group', 'In Premier group we live and breathe the philosophy that people matter and results count, Whether you are a first time buyer or an experienced investor, you will find useful information about how to choose the \"right property\", making an offer, moving, and everything involved in making an informed real estate decision in today´s market.\r\nAn experienced management team heads up a fast growing company, highly trained sales teams are dedicated to the specific markets we operate in.\r\nPremier Group proudly offers variety of services such as:\r\n• Real Estate Services.\r\n• Property Management.\r\n• Home repairing services.\r\n• Moving & Packaging.\r\n• Interior Design & Renovation.\r\n• Investments & Legal Services.\r\n• Renting all kinds of cars.\r\n• Security Guards.\r\n• Security Systems.\r\n• Maids.', '82861', 'uploads/comapnies/8yZ7l2XsSKXWoJLZ8qTjgOZb1F2FKivxDoEfGjTK.jpeg', '01093988855', 'cairo', '11728', NULL, 'uploads/comapnies/VHRZL8HwCAAWiWr8WQEiReRzjUQT56tRWIeLd8kW.jpeg', 78, '2018-10-30 14:02:19', '2018-12-11 17:38:55', 1, 0, 16, 9, 0, 0, 1, 0, '2019-01-28'),
(30, 'RE/MAX Premier Realtors', 'RE/MAX Premier inspires individuals and families to build their Real Estate Wealth through diversified investment around the world. We achieve that through our well-trained team of licensed immigration advisors by handling the complexity and stressful process including the investor’s lack of knowledge of the local and international real estate investment. This enables us to maintain long-term relationships with our clients and their referrals.\r\n\r\nRE/MAX Premier is a Real Estate Development Company based in Cairo Egypt, with access to the global market through our affiliated company’s PAC America Real Estate Investment with its head office in Seattle Washington, United States of America.\r\n\r\nRE/MAX Premier global expansion brings new international standards to its clients in the Middle East. RE/MAX Premier has quickly become the leader when it comes to real estate investment in the region.\r\n\r\nWe help clients address serious needs involving real estate investment, seeking a more diversify and secure option to grow their wealth. RE/MAX Premier main core of the investment process is the security of your MONEY!\r\n\r\nRE/MAX Premier provides a credited, licensed real estate agents and investment banker, along with financial advisory and real estate consulting tailored to each individual, family and entrepreneur’s goals and future plans.', '118159', 'uploads/comapnies/3SGv8yuANnZwwrvwTzqkzjrbcWJ6PajqI5gTsDdf.jpeg', '01005586126', 'cairo', '11112', NULL, 'uploads/comapnies/Y9Ar19SYVn3xBdZZNvk5ybndc6jpnYxlQwJO997m.png', 80, '2018-10-30 16:54:54', '2018-11-08 16:20:08', 1, 0, 50, 20, 0, 0, 1, 0, '2019-02-02'),
(32, 'Xmove Real Estate', 'To be the most preferred real estate firm, providing the most creative and innovative services to win clients\' credibility and empowerment.', '111622', 'uploads/comapnies/sSUh25y2gixTSFbIkxfp4FoSWwZ3oABwlrWbWXpy.pdf', '01000917759', 'cairo', '11211', NULL, 'uploads/comapnies/jKgci3oRBaJE1UR7uAKqDSZp7T8d41qXgCMsRufo.png', 86, '2018-10-31 16:00:17', '2018-12-26 16:04:23', 1, 0, 92, 12, 0, 0, 1, 0, '2019-01-29'),
(34, 'Sweet Home', 'Sweet Home for Marketing and Projects Management \"Sweet Home “\r\nis a joint stock company, working in the field \r\nof property management and brokerage. \r\nSince 10 years based on highly professionally \r\nadministrative cadres as well as the latest \r\ntechniques in both marketing and selling \r\nthe real estate projects\r\nWe present Full real estate service that offer\r\nour clients property management services the real estate\r\n projects In New Cairo \r\nSweet Home for Real Estate\r\nOUR SERVICES INCLUDE:\r\n- Property Development\r\n- Property Management\r\n- Leasing and Renting\r\n- Buying and Selling of Property', '15729', 'uploads/comapnies/32sSMjlpgPsgQFzYWzSxUtIJxFzu3DRO3E9sshzP.jpeg', '01065752525', 'cairo', '11211', NULL, 'uploads/comapnies/CSZLeLZypgKA6Niki3rspOChr3tFO4yuVueKIpZn.jpeg', 92, '2018-10-31 18:54:32', '2018-11-18 18:10:02', 1, 0, 47, 20, 0, 0, 1, 0, '2019-02-02'),
