(45, 'Rea Egypt', 'Real Estate Advisors INC is a real estate brokerage company. We are challenged to rise above the traditional approach by constantly monitoring the real estate market, having the complete information about existing projects, their new phases that are being built or yet are planned to be built. Due to our experience and connections we have the opportunity to know all the “pros” and “cons” of the projects, tell about their perspective and market investment value. Our team includes highly professional young people who are trained to act in accordance with the most discreet code of conduct and never reveal the personal information about the clients or financial aspects of the deals.', '22379', 'uploads/comapnies/lmXz39MVqCl9Dq9nFKtbV8FlYeda9h7OZ1yCUCRU.ppt', '01211595779', 'Elshiekh Zayed', '11211', NULL, 'uploads/comapnies/D35Y3bQf4YyMRmwLyKZHKlfgF7Cp2dHEZs6SlV6E.png', 144, '2018-11-27 15:41:35', '2018-12-13 18:31:05', 1, 0, 91, 8, 0, 0, 1, 0, '2019-02-25'),
(46, 'Luxury House for real estate marketing', 'Luxury house Real Estate is one of the famous companies in \r\nreal estate market by our unique contemporary style for connecting our client with the property\'s.\r\n\r\nWe are able to find the right property for you in areas such as: all Maadi, all New Cairo.( Katameya Heights,West Golf,Arbella\r\nLake View,katameya hills . Mirage City . Katameya Residence ... etc.), Heliopolis, 6th of October, Cairo Alex Road \r\n\r\nOur real estate network includes\r\nResidential, commercial. Administrative. Property\r\nmanagement-Real Estate Consulting, Booking of hotels', '78097', 'uploads/comapnies/xiH3kmbCbnZl5vVyH2BxNBbOR905LdYt5CeBLwmq.pdf', '01069991516', 'Cairo', '11211', NULL, 'uploads/comapnies/O03gyr4qWvps2XblG3ASb4dEdMPJVtwrOwtAvpeY.png', 147, '2018-11-28 19:29:34', '2018-11-28 19:36:21', 1, 0, 50, 1002654439, 0, 0, 1, 0, NULL),
(47, 'kayan Real Estate', 'شركة كيان للتسويق العقارى تقدم لعملائها أعلى جودة من الخدمة العقارية .\r\nلدينا خبرة طويلة فى مجال العقارات مدعومة بفريق متخصص فى السوق العقارى و التنوع الكبير فى العقارات المتاحة لدينا.\r\nكيان تغطى لك أكبر مساحة من السوق العقارى فى القاهرة الكبرى مابين مشاريع الشركات العقارية و ملاك العقارات بمساحات و أسعار مختلفة تناسب احتياجاتك و ترضى تطلعاتك .\r\nاستثمر معنا و اختر من بين شقق , دوبلكسات , فيلات , تاون هاوس ...الخ\r\nبمساحات مختلفة و فى أماكن متعددة .\r\nمتاح لدينا وحدات كثيرة ما بين بيع و إيجار. تواصل معنا الان و امتلك بيتك فى الحال \r\n\r\nKayan Real Estate Consultancy is a professional real estate marketing consultant that provides its clients with the highest level of real estate services. \r\nWe have long experience in the Real Estate field, adding to that a highly experienced team dedicated to give you the expected results you desire.', '14858', 'uploads/comapnies/IsIoUtofqBnPX93OO5CTCkbdzBxzjwTqSiOyrSNx.pdf', '01126464693', 'القاهرة', '0000', NULL, 'uploads/comapnies/4mTxXk6rN70RHdzn7Ad6YvOJBwnWj9heynf6s0Q9.jpeg', 148, '2018-12-02 18:12:52', '2018-12-09 16:30:52', 1, 0, 100, 17, 0, 0, 1, 0, '2019-03-02'),
(48, 'Edar Prohomes', 'EDAR serves sellers, buyers and renters of residential and commercial property and vacation resorts throughout the major cities in Egypt.', '16906', 'uploads/comapnies/9siS0zFEv7L9lsHukR0RhU8Ec9oxeOjfpFN330Ul.jpeg', '01000013123', 'Cairo', '00000', NULL, 'uploads/comapnies/rs1szNj89fJgy47baGYn5ph6iYGYzaqFs9yXnfjT.jpeg', 149, '2018-12-02 18:28:02', '2019-01-20 18:51:11', 1, 0, 73, 4, 0, 0, 1, 0, '2019-03-02'),
(50, 'Sakan Real Estate', 'SAKAN one of Egypt’s leading Real Estate companies offering a prime variety of developments. SAKAN concept is based upon bringing together home buyers & the most reputable developers under one roof to serve as a permanent exhibition linking the projects in Egypt to buyers locally and globally, SAKAN specialized real estate consultants assist you to the right choice. Your one-stop shop solution for your Real Estate in Egypt.\r\n\r\nIn 2012, we founded SAKAN because we saw a tremendous need for better and professional services on the housing market. There is so much misunderstood, and often conflicting, data and sometimes it is in direct contradiction to what we see in the market and hear from our clients. Figuring out what it all means is what we do best.\r\n\r\nOur Clients are a very diverse mix of some of the aspirant\'s people, and our team members owners of real talent are passionate about helping our clients make the most informed decisions possible. We try to bring Transparency and credibility to their decision-making process. Our clients make decisions with confidence because we tell them what is best in the market?!\r\n\r\nIt is our mission to become Egypt’s most reliable Real Estate brokerage company and we intend to reach our goal by offering our clients all the efforts needed to fulfill their needs and requirements.\r\n\r\nWe hope that you will find SAKAN Real Estate the right partner for every real estate service and product you need, and as always and promoting the concept of Real Estate marketing in Egypt, we are ready to provide you with only the best that Egypt has to offer.', '68432', 'uploads/comapnies/1i5oaWjdoFMGSUHXZ70KpdRsFJR0ERIa74gwr67B.png', '01225949331', 'cairo', '0000', NULL, 'uploads/comapnies/5XpgQDOwAkKDMTMkSNsLXyFzZTESyLi5E4usiTBW.png', 156, '2018-12-03 18:37:37', '2018-12-24 22:10:50', 1, 0, 53, 3, 0, 0, 1, 0, '2019-03-03'),
(55, 'Abrag REAL ESTATE', 'About Us: Abrag Real Estate was founded in 1999 under the name of Engineering Marketing and Management Company (EMMC) based on a solid portfolio & great understanding of the market needs. In 2007, the company’s name changed to Abrag Real Estate while promising its customers the satisfaction and the trust they deserve.\r\n Our Services :\r\nAbrag Real Estate offers numerous real estate consultancy services & solutions.\r\nMarket survey and studies\r\nProduct development\r\nVolume of the market needs and demand\r\nPricing and Methods of Payment\r\nMarketing Communication plans\r\nPromotions\r\n The company deals with the most reputable real estate developers in the market standing on a solid background while depending on our achievements with most of them.\r\n Our Vision : To be a leading agent for real estate brokerage in Egypt, MENA region with consistent standards & excellent quality.\r\n Our Mission : In Abrag, we strive to deliver real estate sales & services including investment consultancy & opportunities with outstanding quality powered by our experts.\r\n Our Values :\r\nTeam Work\r\nTrust\r\nQuality\r\nCare', '23854', 'uploads/comapnies/X6KiphzkOCUM9evUWxwmCy1R9uHXkNJCqKwVaiMz.pdf', '01001188088', 'Egypt', '2354', NULL, 'uploads/comapnies/T0VMizEprfw3l3XUMvnkG35aKU2YriV167iVTZ2v.jpeg', 161, '2018-12-05 15:09:02', '2018-12-11 15:01:28', 1, 0, 49, 42, 0, 0, 1, 0, '2019-03-05'),
