(66, 'A Plus Real Estate', 'A Plus Real Estate is a brokerage real estate agency founded by The real estate expert Shorouk Tharwat. With our unique contemporary style and total passion for connecting people with property od their dreams, we aspire to provide the ultimate real estate experience for today’s modern consumer. We are not confined by traditional real estate boundaries when it comes to buying, selling, renting or asset management, as we understand how this might be the biggest investment of their life, we are always finding new and innovative ways to satisfy our clients', '112549', 'uploads/comapnies/zqnEhjwU8LiSOzfoAVO2X5EkhTGlRvVDH9xT44XC.jpeg', '01033302449', 'Cairo', '0000', NULL, 'uploads/comapnies/gFhfVYQzVv7lcHdifwhkd3rErfX1rbopIhv6z25Z.jpeg', 220, '2018-12-17 16:12:07', '2018-12-26 20:28:26', 1, 0, 83, 1, 0, 0, 1, 0, '2019-03-17'),
