(78, 'المدائن مصر للإستثمار العقاري', 'عن الشركة\r\nتأسست شركة المدائن مصر للإستثمار والتنمية والتطوير العقاري كشركة مساهمة مصرية تابعة لمجموعة المدائن مصر جروب (ALmadaean Misr Group )\r\n\r\nلتكون من الرواد في مجال الإستثمار العقاري والإسكان , وإدارة وتطوير مشروعات البنية التحية والمقاولات العامة .\r\n\r\nبعقول مستنيرة وأيدي فتية لمجموعة العمل المنتقاة بعناية والمستثمر فيها بقوة .\r\n\r\nلتنطلق الشركة في مجال الاستثمار العقاري والمقاولات وتتوسع أعمالها بخطوات ثابتة في محافظات مصر المختلفة وبعض الدول العربية الشقيقة إن شاء الله .\r\n\r\nبما يحقق اعلي درجات الثقة والرضا لعملائها الكرام .\r\n\r\nوذلك من خلال منظومة إدارية قوية حديثة تراعي أعلي معايير الجودة العالمية في الادارة والتنفيذ للمشروعات المختلفة .\r\n\r\nلماذا نحن ؟\r\n1-  لأننــا نعتمــد علــى إستقطــاب أكثــر الكفـــاءت تميزاً من الشبـاب بالســوق المصــرى والعــربى وبـنـــاء منظــومــة متطــــــــــورة تـتـــرتقــــــى بمـسـتـــــــوى مـوظـفـينــــا علمـيـــاً ومهنيـــــاً .\r\n\r\n2-  لأننــا نعتمـــد علــى بنـــاء منظـــومة إدارية قوية متميزة تقوم على معايير الجــــــــــــــودة العــالـمـيـــــــــــــــة ـ\r\n\r\n3-  لأننـــا نعتـمــــد علــى بنــاء منظومة خـــدمة العـمـــلاء للوصــول إلــى أعلـى درجات الثقة ورضـاء العميـــل .\r\n\r\n4-  لأننــا نعتمـد على بناء منظومة خدمات متكاملة تغطـــى كــافـــة إحتـيــاجـــات العمــلاء فى مجالات الإستـثـمــــار العقـــارى و المقـــاولات المتخـصـصــــة\r\n\r\n5 – لاننــا نعتمــد على التكامل فى تقديم الخدمات فى قطاع المقاولات التخصصيية بالتعاون بالشراكة الاستــراتيــجـيـــــة مــــع باقـــى شركـــات المجمـوعة – المـدائن لهندســة الإتصــالات والشبكــات وأنظمة تكـنــولوجـيــــــــا المـعـلـــومــــــــــات – المـــدائن للاسـتـثـمـــــــــــــار الطبـــــــــى و الدوائـــى – المـــدائن للتســــــــويـــق و ادارة المشـــــــروعــــــات\r\n\r\n6-  لأننـــا نعتمــد على بنــاء منظومة إستثمارية قوية تعـمـــــل وفـــق القوانيــــن واللـــوائـــــح المعـتـمـــدة – تاسـيــــس شـــــركـــات مساهمــة بـــــراس مـــــــال مصــــــــــرى عـــــــــــــــــــربــى مشـتــــــــــــــرك – تاسيــس شركات قابضــة اهلية برعاية المؤسسات الحكــــــومـيــــــة و الدولـــــــيــة\r\n\r\nأدوات قياس الأداء\r\n1 – الــــــوصــــــــــول إلى أعلــــــــى مسـتــــــــــويــــــــــــــــــات رضــــــــــــــــــــاء العـمـــــــــــــــــلاء .\r\n\r\n2 – تــوسـعـــــــــــات الشــــركــــــــة باسـتـمــــــــــــــــــرار مـحـلـيــــــــــــــــــــا وعـالـمـيــــــــــــــــــا .\r\n\r\n3 – زيـــادة حـجــــم الشـــركـــة بزيــــادة حـجــــم العمليـــات والمبـيـعـــات السـنــويـــة .\r\n\r\n4 – الدخول فى مجالات متنوعة وتغطية أكبر قدر من الوظائف الفنية فى المجال .\r\n\r\n5 – الـتـحـلـــــــــــى بالـسـمـعــــــــــــــــــــــــة الـطـيـبــــــــــــــــــــة فـــى ســـــــــــــوق الـعـمــــــــــل .\r\n\r\n6 – التسجيـــل كمـقــــــــــاول رئيســـــــــي معتمــــد بالسوق المحلـــــــى والعالمـــــى .', '5096', 'uploads/comapnies/efnwSNvG2lPBzjfccnJHEm84aKNkPY64lUW08erK.pdf', '01000211768', 'Alexandria', '00000', NULL, 'uploads/comapnies/QqZKDtLLpT2BfzNIF1H3hlxaF7Ok1jANCQxx2WP9.jpeg', 235, '2019-01-20 17:13:44', '2019-02-11 16:29:20', 1, 0, 44, 2, 0, 0, 1, 0, '2019-04-21'),
