(83, 'TRIO- Real Estate', 'تريو للتسويق العقاري الاختيار الأمثل لمساعدتك في اختيار وحدتك ، وذلك بحكم خبراتنا واحترافية فريقنا في التعامل مع كل متطلباتك من واحدات داخل مصر. \r\nاغتنم الفرصة بحجز وحدتك بمشروعات متعددة ومختارة بعناية مميزة وبعروض حصرية.\r\nخدمتك هي غايتنا!', '109339', 'uploads/comapnies/ocQuLHf2l4SG74N8tSUGVyVqkAHwxkbBJ0nKurvc.pdf', '01141111025', 'cairo', '00000', NULL, 'uploads/comapnies/oVkfKT9IirIqFfSlhCaaPSmsFhiaqXOnw7bbBM1X.jpeg', 243, '2019-01-28 18:58:53', '2019-02-11 17:40:24', 1, 0, 68, 5, 0, 0, 1, 0, '2019-05-12'),
