(87, 'House Finder', 'شركه هاوس فايندر للاستثمار العقاري شركه متخصصه فى مجال الاستثمار والتطوير العقاري بداء مجال الاستثمار والتطوير العقاري منذ 2006 حتى الآن سابقه اعمال مميزة بدأت بإنشاء عدة ابراج سكنيه بالمهندسين والمعراج ولها أكثر من كمبوند بالهضبى الوسطى بالمقطم ومشروعات اخرى بمدينه الشروق وتم تسليم الوحدات فى الموعيد المتفق عليها كامله الخدمات والمرافق ونسعى دائما لسد احتياجات السوق العقارى ببناء وحدات  سكنية مميزه فى التصميم المعمارى للوجهات والمداخل والتقسيمات الداخليه للوحدات بحيث تلقى رغبات عملائنا الكرام ويرعى فى التصميمات الخصوصيه والتقسيمات الداخليه المميزة', '75867', 'uploads/comapnies/SwJtymLPnY0VmuhI0ubY09ZuPzGUUFxcAAgvoKkr.jpeg', '01060004909', 'cairo', '00000', NULL, 'uploads/comapnies/7nSjw6HPoOfkbjS6qLvAZaxZ3BprUvYNipAtDFDE.jpeg', 251, '2019-02-07 18:50:58', '2019-02-07 18:51:58', 1, 0, 50, 5, 0, 0, 1, 0, NULL),
(88, 'Location Egypt', 'شركة لوكيشن للتسويق العقاري و المقاولات بمدينة القاهرة الجديده التجمع الخامس تأسست سنة ٢٠٠٠ و تعتبر من اقدم الشركات العامله في مجال الاستثمار العقاري بمدينة القاهرة الجديده و المدن الجديدة بصفه عامة و يتلخص نشاط الشركة في التسويق العقاري لشركات التطوير العقاري الكبري بالاضافة الي اعمال المقاولات العامه و الخاصه و البناء للغير و اصدار التراخيص و جميع الاجراءات الخاصه ببناء اي مشروع سكني او تجاري او اداري', '14779', 'uploads/comapnies/IvWg2jAzdngkKdFSAuTWWUSS54S46AvuZclPx07D.jpeg', '01114697025', 'cairo', '00000', NULL, 'uploads/comapnies/g3vNzeapzHe5u8qViGoz4njRJz7NiTuNtqhloXFx.jpeg', 252, '2019-02-11 14:19:27', '2019-02-11 14:20:08', 1, 0, 50, 50, 0, 0, 1, 0, NULL),
(89, 'al tarek', 'تسويق عقاري بالتجمع الخامس', '23740', 'uploads/comapnies/2ooLzTSkWKpXzFvpd3AWxt4SxrWkI2qhWjBfSWXV.jpeg', '01113336364', 'cairo', '00000', NULL, 'uploads/comapnies/xsTP2lCQTX70UvDus1djNVtl3FKmpzX99xy0tpAY.jpeg', 253, '2019-02-11 16:52:40', '2019-02-24 16:46:24', 1, 0, 99, 50, 0, 0, 1, 0, '2019-05-12'),
(90, 'chance', 'تأسست شركة Chance العقارية سنة 2011 لتكون شركة متخصصة في تسويق العقارات. تهدف شركة Chance العقارية أن تكون الشركة الأولى في مجال تسويق العقارات في مصر والشرق الأوسط.', '98946', 'uploads/comapnies/uSEsXWXiH7i4EN5sQYvtDTmfXQBSMfMZxqbtGDCv.jpeg', '01063684800', 'cairo', '00000', NULL, 'uploads/comapnies/lSiXcw3zJ8cX4ZKQhnfklfUzvhUcC3vRXR9EBmQF.jpeg', 254, '2019-02-11 18:42:07', '2019-02-11 19:15:22', 1, 0, 50, 5, 0, 0, 1, 0, NULL),
(91, 'REMAX Dynamics', 'ريماكس دينامكس أحدى شركات ريماكس في مصر - شركة التسويق والوساطة العقارية الأولى في العالم – تدير لك عمليات الشراء والبيع والأيجار لعقاراتك داخل وخارج مصر في أسرع وقت وبالسعر المناسب من خلال فريق عملها المتخصص في التسويق والتقييم العقاري وأدارة المعاينات والتفاوض تأسست شركة ريماكس في عام 1973 بواسطة ديف وجيل لينيجر في دينفر، كلورادو بالولايات المتحدة الأمريكية لتعمل في مجال التسويق والوساطة العقارية وفي عام 1995 توسعت وشمل نشاطها أوروبا والأن هي شركة التسويق والوساطة العقارية الأولى في العالم الموجودة في 100 دولة ويعمل بها أكثر من 110,000 وسيط/مستشار عقاري أستطاعوا تحقيق أعلى رقم مبيعات', '90701', 'uploads/comapnies/zQaHo61LNwrXZYGfMb375acT0Gv4XJL4ACsNxgJ7.pdf', '01093701406', 'cairo', '00000', NULL, 'uploads/comapnies/hVd8gY5DlkPrylgV2qEGcIYqRLAgclnJDiqxdOpo.jpeg', 256, '2019-02-13 18:29:54', '2019-02-13 19:04:16', 1, 0, 50, 20, 0, 0, 1, 0, NULL),
(92, 'Inspectors real estate consultancy', 'ABOUT US\r\n\r\nINSPECTORS real estate consultancy is a limited liability company (L.L.C) established in 2016 . We offer a complete portfolio of real estate services, including sales and leasing of residential and commercial property, projects sales and marketing, property consultancy and relocation services. We conduct research studies and valuation surveys upon request. INSPECTORS also advises individuals and corporate on growth strategies and real estate investment opportunities in current and new markets. We have a professional and committed team of sales and leasing property advisers.\r\n\r\nGOALS\r\n\r\n•	Regional expansion in the field of property management and marketing of all types of real estate.\r\n•	Develop the strong base of key customers to help building the capacity of the company.\r\n•	Increasing of investments and company assets to support the development of services and performance.\r\n•	Build credibility and reputation in the field of property management.', '120336', 'uploads/comapnies/1d1OjMQYRSPus0UDrUG0CVnUP22MoSAAEPXgzeeW.jpeg', '01066694906', 'cairo', '00000', NULL, 'uploads/comapnies/r4ogZdQFW985wVaTfsULcKFAwZNat6dMznrMe96Q.jpeg', 257, '2019-02-13 19:52:33', '2019-02-17 15:08:28', 1, 0, 100, 49, 0, 0, 1, 0, '2019-05-14'),
(94, 'دارك للعقارات', 'Darak is one of the leading companies in the field of real estate in AL Rehab City and Madinaty since 2007 due to  its expertise in the Egyptian market', '17337', 'uploads/comapnies/sKVTDsqKDPMoA3it4GrjS8zjnmVvJaa6foiqk0oX.jpeg', '01028070041', 'cairo', '00000', NULL, 'uploads/comapnies/n8E6tMBpshfWsdgFKqrmXAZl5dLFPBI0cA7YTEIk.jpeg', 269, '2019-02-17 18:34:50', '2019-02-17 18:40:04', 1, 0, 50, 10, 0, 0, 1, 0, NULL),
(96, 'City Mega Stores', 'شركة رائدة في مجال الاستثمار و التسويق العقاري ذات سابقة اعمال بروما في مجال السياحة و المطاعم تحت اسم (امبريال) لمواكبة المستقبل بما يحدث من انشاء و تطوير\r\n15 شارع عباس العقاد _ مدينه نصر', '99464', 'uploads/comapnies/7tjMqPyCIoqknJKRSpx5KMPw7B2R7eMQ6UB0opbK.pdf', '01006679628', 'cairo', '00000', NULL, 'uploads/comapnies/mqTRLTQYaJ9hwu7nfJbViSnY42hcSScL7GV4xdGv.jpeg', 271, '2019-02-17 19:01:03', '2019-02-17 20:18:17', 1, 0, 100, 10, 0, 0, 1, 0, '2019-05-18'),
(97, 'التوحيد والاستثمارات العقارية', 'شركة التوحيد و الاستثمارات العقارية هي شركة عقارية رائدة تتمتع بخبرة عشر سنوات\r\nفي تقديم خدمات عقارية فاخرة للأجانب \r\nوالسكان المحليين في مصر بما في ذلك العقارات المفروشة بالكامل \r\nوالممتلكات شبه المفروشة للأغراض السكنية والتجارية', '672614766', 'uploads/comapnies/4dmRcHox5PI0JX5Fw6zkVgjCLFYvqRJGzCcQZHd1.jpeg', '01097463935', 'cairo', '00000', NULL, 'uploads/comapnies/6eU4llogUPua7nesHA1c3mNGLrKThLEMUKYpdvFG.jpeg', 273, '2019-02-18 17:29:05', '2019-02-20 23:28:29', 1, 0, 100, 10, 0, 0, 1, 0, '2019-05-21'),
(98, 'REMAX Performance', 'لأكثر من 45 عام الآن، تواصل ريـ/ـماكس تتطورها من مجرد مكتب عقارات وحيد افتُتح عام 1973 في دنفر كولورادو إلى شبكة عقارات عالمية واليوم تضم أكثر من 7,900 مكتب مملوك ويتم إدارته من قبل حامل الامتياز، وحوالي أكثر من 120,000 من شركاء المبيعات عبر أكثر من 100 دولة. ريـ/ـماكس هي العلامة التجارية رقم 1 في العالم حيث تطبق أحدث التكنولجيات وتقدم أكثر تعليم عقاري متقدم ونطاق واسع من حلول الأعمال داخل سوق العقارات.\r\nانطلقت ريـ/ـماكس مصر خلال الربع الثاني من عام 2012 على الرغم من التحديات السياسية والاقتصادية في مصر استناداً على ثقة المؤسس السيد خالد ناصر في قوة واستقرار صناعة العقارات في مصر. ريـ/ـماكس مصر تؤمن بشدة بإمكانيات المصريين وتقدم لهم فرصة كبيرة لأمتلاك مشاريعهم الخاصة مع التحرر من القيود المفروضة على الدخل الثابت.\r\nمن خلال هذا النموذج فى السنوات الأخيرة تطورت ريـ/ـماكس مصر لتصبح شركة العقارات الأكبر و الأكثرانتشاراً في مصر. تعتبر ريـ/ـماكس مصر أقوى علامة تجارية فى العديد من المناطق في مصر والتي تلبي مختلف المتطلبات و المناطق المتنوعة و قطاعات السوق والمستهلكين. و نحن فخورون بأن نقول أن من بين 27 محافظة في مصر نحن موجودون حاليا في 6 محافظات: القاهرة والجيزة والإسكندرية والبحر الأحمر والدقهلية والغربية: فى مختلف المناطق مثل المعادي، الزمالك ، السادس من أكتوبر ، المهندسين ، القاهرة الجديدة ، الغردقة ، المنصورة ، طنطا والأكثر من ذلك.', '8835', 'uploads/comapnies/ACKZIAag7TrdW0BU3w97YpkCv1O8z6Hsu6P2YU4K.jpeg', '01033322853', 'Alexandria', '00000', NULL, 'uploads/comapnies/P1YZmO1Ou8127qKJwMpcjI2cBPEIicwf0RZSHpBU.jpeg', 274, '2019-02-18 17:59:35', '2019-02-25 17:23:05', 1, 0, 99, 0, 0, 0, 1, 0, '2019-05-22'),
(99, 'Impact Commercial Real Estate', 'Impact Commercial Real Estate is one of the most professional real estate companies in Egypt .our range of experience exceeds 15 years in the Egyptian real estate market. Our head office is located in Cairo business plaza building. We are providing a high quality and full integrated services in the commercial real estate.', '126847', 'uploads/comapnies/2l1pdKQevKIg1DY0YWRGYmVatyPFBrzUlVeKtFjU.pdf', '01000260263', 'cairo', '00000', NULL, 'uploads/comapnies/nRXQqKYZQG7rXPxwsSpkBfkdqv9UHldMBoYZKOq6.jpeg', 277, '2019-02-21 16:46:16', '2019-02-21 16:46:53', 1, 0, 50, 4, 0, 0, 1, 0, NULL),
(100, 'Emmar egypt', 'Real estate company', '91973', 'uploads/comapnies/2BFm1z54SuAlJeOKTSditlYQKP3XmWPcY1nDfswX.pdf', '01144523335', 'Alexandria', '21500', NULL, 'uploads/comapnies/PmzBqUrXXdWubNvQ5mAHPubyONMa5fSdskzDWG6K.jpeg', 278, '2019-02-24 14:22:28', '2019-02-27 20:29:18', 1, 0, 99, 20, 0, 0, 1, 0, '2019-05-28'),
(101, 'More Homes Real Estate', 'More Homes for Real Estate Development and Investment is a leading company in the Egyptian market . Our target is housing projects , commercial buildings and resorts. We aspire to be our customers’ first choice for purchasing , selling , or leasing of real estate in Egypt. That’s why we always work on building long term relationship with our customers to be their sole agent.', '239126', 'uploads/comapnies/p2I7XULVopW9exwwsp8AUf5pPqZiLybef9F750hc.jpeg', '01000934106', 'cairo', '00000', NULL, 'uploads/comapnies/2NRpm5xims6d2nPxmI1GWm1tcDZMxQtSVadIgkoX.jpeg', 285, '2019-02-26 17:03:23', '2019-04-03 20:13:40', 1, 0, 88, 35, 0, 0, 1, 0, '2019-05-28'),
