(1, 'Capital Gate - NEW CAIRO', 'Capital Gate - NEW CAIRO', 'New Cairo', 'Capital Gate is an exclusive compound with a prime location in New Cairo. It offers luxurious fully finished apartments, penthouses, duplexes and many amenities. Capital Gate is also distinguished by its spacious greenery and water features.\r\nThe Project is located in the fifth settlemen New Cairo on the Mid-Ring Road that is linking Cairo-Suez Road with Cairo-Sokhn Road and its major strength lies behind being on the border between New Cairo and Madinaty and adjacent to the New Capital; and that is why the project was Called Capital Gate.\r\nThe project will be developed over 97.5 Acres and will consist of 2,706 fully finished residential units divided into 87 Apartment Buildings with remarkable and outstanding views, 75% of the total land area will be occupied by greeny and swimming pools between the buildings and all units are guaranteed to have their maximum privacy.', 'Capital Gate\r\nCapital Gate is an exclusive compound with a prime location in New Cairo. It offers luxurious fully finished apartments, penthouses, duplexes and many amenities. Capital Gate is also distinguished by its spacious greenery and water features.\r\nThe Project is located in the fifth settlemen New Cairo on the Mid-Ring Road that is linking Cairo-Suez Road with Cairo-Sokhn Road and its major strength lies behind being on the border between New Cairo and Madinaty and adjacent to the New Capital; and that is why the project was Called Capital Gate.\r\nThe project will be developed over 97.5 Acres and will consist of 2,706 fully finished residential units divided into 87 Apartment Buildings with remarkable and outstanding views, 75% of the total land area will be occupied by greeny and swimming pools between the buildings and all units are guaranteed to have their maximum privacy.', 'When it comes to construction and development, Al Marasem Development is the first name to come in mind. Al Marasem Development is one of the leading companies in its field because of its professional and flawless execution and punctual completion of its numerous projects.\r\n\r\nAl Marasem Development is an Egyptian international company that was established in 1997 in Cairo – Egypt. It excelled in delivering exceptional construction projects in a time effective manner. Al Marasem Development crafted many masterpieces ranging from airports, housing projects, hotels, commercial and entertainment buildings. It’s also infiltrating the real estate market in many prestigious locations in Cairo.\r\n\r\nAl Marasem Development has two splendid compounds which are Capital Gate and Fifth Square.', 'When it comes to construction and development, Al Marasem Development is the first name to come in mind. Al Marasem Development is one of the leading companies in its field because of its professional and flawless execution and punctual completion of its numerous projects.\r\n\r\nAl Marasem Development is an Egyptian international company that was established in 1997 in Cairo – Egypt. It excelled in delivering exceptional construction projects in a time effective manner. Al Marasem Development crafted many masterpieces ranging from airports, housing projects, hotels, commercial and entertainment buildings. It’s also infiltrating the real estate market in many prestigious locations in Cairo.\r\n\r\nAl Marasem Development has two splendid compounds which are Capital Gate and Fifth Square.', '', 'uploads/projects/ipCLUUXx2u9mwnemmv5caV1fpJh7TomfLxsikgd2.mp4', 1, '2018-10-15 21:02:14', '2019-04-02 17:20:57', '31.605578299999934', '30.0458861', 1, 1, '', '', 1, 16, 31, NULL, NULL, NULL, NULL, NULL, 0),
(2, 'فيفث سكوير', 'Fifth Square -New Cairo', 'Fifth Square New Cairo', 'موقع فيفث سكوير\r\nيقع الكمبوند على مساحة هائلة (158 فدان) في المربع الذهبي في التجمع الخامس على شارع التسعين الشمالي بين توسعات بالم هيلز وفيلدج جاردنز القطامية. هذا الموقع الفريد على بعد 5 دقائق من الجامعة الأمريكية، جعل الكمبوند محيط بأكثر المناطق حيوية من نوادي ومراكز تسوق ومولات داخل القاهرة الجديدة وخارجها حيث انها تقع على بعد 20 دقيقة فقط من وسط المدينة.\r\nالحياة في فيفث سكوير\r\nتتميز الحياة في كمبوند فيفث سكوير بالعديد من الخدمات التي تشمل جوانب الحياة الفاخرة من رفاهية وأمان ورقي وهدوء وعصرية كما يلي:\r\n•	أحدث الأجهزة الرياضية في جيم رياضي متكامل.\r\n•	أمن على مدار 24 ساعة.سبا.\r\n•	مطاعم وكافيهات.\r\n•	حدائق عامة ومساحات خضراء شاسعة.\r\n•	خدمة استقبال على أعلى مستوى.\r\n•	كلوب هاوس خاص بمنطقة الشقق.\r\n•	كلوب هاوس خاص بمنطقة الفيلات.\r\n•	ممرات للمشي والجري وركوب العجل.\r\n•	نوافير صناعية.\r\n\r\nالوحدات السكنية في فيفث سكوير\r\nتتنوع الوحدات السكنية في فيفث سكوير بين شقق وفيلات بمساحات مختلفة في اربع مراحل. تم حجز وحدات المراحل 1،2،3 وتم فتح الحجز بالمرحلة 4.\r\nتنقسم الوحدات السكنية إلى:\r\n•	فيلات منفصلة نصف تشطيب (مساحة 350 متر).\r\n•	فيلات تاون هاوس نصف تشطيب (مساحة 250 متر).\r\n•	منازل مزدوجة نصف تشطيب (مساحة 300 متر).\r\n•	شقق منفصلة كاملة التشطيب (بمساحات تتراوح بين 80 متر و 270 متر).\r\n\r\n\r\nأسعار الوحدات السكنية في فيفث سكوير\r\n•	تبدأ أسعار فيلات للبيع في فيفث سكوير من: 4،500،000 جنيه.\r\n•	تبدأ أسعار منازل مزدوجة للبيع في فيفث سكوير من: 5،600،000 جنيه.\r\n•	تبدأ أسعار تاون هاوس للبيع في فيفث سكوير من: 3،900،000 جنيه.\r\n•	تبدأ أسعار شقق للبيع في فيفث سكوير من: 1،600،000 جنيه.\r\nطرق السداد والدفع\r\nتتعدد طرق السداد في فيفث سكوير لتسهيل عملية الدفع لمختلف المستويات كما يلي:\r\n•	0% مقدم وتقسيط حتى 4 سنوات.\r\n•	5% مقدم و 5% بعد 3 شهور وتقسيط حتى 6 سنوات.\r\n•	10% مقدم و10% بعد 3 شهور وتقسيط حتى 8 سنوات.\r\nتاريخ الإستلام : \r\n2020', 'The compound lies 20 minutes away from Downtown and 10 minutes away from Heliopolis, making it close to all the city services along with the compound’s special amenities.\r\nFifth Square Amenities\r\nLiving at Fifth Square means having a unique life experience while enjoying world-class facilities for all residents putting in mind safety and energy saving measures as follows:\r\n•	Clubhouse for Apartments area on an area of 15,000 meters square.\r\n•	Clubhouse for Villas area on an area of 5000 meters square.\r\n•	Gates with controlled access.\r\n•	Paths for walking, running, and cycling.\r\n•	Water features.\r\n•	Wide spaces of green landscape.\r\n•	Underground parking.\r\n•	High-speed fiber network.\r\n•	Street lighting powered by Solar energy.\r\nFifth Square Properties\r\nOn a project area of 158 acres, lies the residential part of Fifth Square to be divided among:\r\n•	Semi-finished Standalone Villas. (Available Sizes: 350 sqm)\r\n•	Semi-finished Townhouses. (Available sizes: 250 sqm)\r\n•	Semi-finished Twin Houses. (Available Sizes: 300 sqm)\r\n•	Fully Finished Super Lux Apartments. (Sizes ranging between 80 sqm and 270 sqm)\r\n\r\nFifth Square Prices\r\n•	Starting Price for Villas for Sale: 4,500,000 LE\r\n•	Starting Price for Townhouses for Sale: 3,900,000 LE\r\n•	Starting Price for Twin Houses for Sale: 5,600,000 LE\r\n•	Starting Price for Apartments for Sale: 1,600,000 LE\r\nPayment Plans\r\nAl Marasem Group offers a number of payment plans with small interest to facilitate payments for its residents as follows:\r\n•	0% down payment and 4 years installments.\r\n•	5% down payment, 5% after 3 months and 6 years installments.\r\n•	10% down payment, 10% after 3 months and 8 years installments.\r\nDelivery Date: 2020', 'أحدث مشروعات المراسم العالمية\r\nكمبوند فيفث سكوير، هو أحدث المشروعات التابعة لشركة مراسم الدولية للتطوير العقاري. قامت الشركة ببناء أكبر المشروعات العالمية في مصر مثل فندق فور سيزون وكمبوند ميفيدا وكمبوند ايستاون في التجمع الخامس ومنتجع مراسي في الساحل الشمالي. تتميز جميع مشروعات شركة مراسم بأن لها طابع خاص مختلف عن أى مشروع آخر وكذلك كمبوند فيفث سكوير حيث يتميز بالجمع بين الطبيعة والأمان والجو العائلي الهادئ في أجمل المناطق في التجمع الخامس وأكثرها حيوية.', 'Al Marasem International Group\r\nAl Marasem International Group has been building some of Egypt’s largest projects for the past 20 years. The worldwide company built EMAAR’s most well-known developments like Marassi, Uptown, and Mivida along with airports and hotels like “Four Seasons Hotel” and it is now developing for you its newest spectacular project, Fifth Square in New Cairo', '', NULL, 1, '2018-10-16 14:06:06', '2019-04-02 17:20:05', '31.537774000000013', '30.051521', 1, 1, '', '', 1, 16, 31, NULL, NULL, NULL, NULL, NULL, 0),
(3, 'Scenario', 'Scenario', 'New Capital', 'كمبوند سيناريو في العاصمة الإدارية الجديدة هو يقع R7 فى الحي السكنى السابع من القطعه A2 بجانب Bue الجامعه البريطانية وال Expo وخلف مشروع البوسكو العاصمة الادارية\r\nيحتوي علي 300 وحده مرحلة أولي مقسم الى دوبلكس و شقق تطل جميع الوحدات على لاند سكيب ومساحات خضراء واسعة  ، مساحات الشقق تبدأ من 112 متر كما ايضا يوجد دوبلكس من مساحه 200 مترحتى 300متر تسليم الوحدات نصف تشطيب وتشطيب كامل\r\nطرق السداد : \r\n- ٠٪ مقدم و أقساط ٥ سنوات \r\n- ٥٪ مقدم + ١٠٪ بعد سنتين و أقساط ٦ سنوات\r\n- ١٠٪ مقدم + ٥٪ بعد ٧ شهور و أقساط ٧ سنوات\r\n- ٢٥٪ مقدم + ١٢.٥٪ بعد سنتين + ١٢.٥٪ بعد ٣ سنوات و أقساط على ١٠ سنوات', 'Ever experienced a dreamlike lifestyle, like you truly have everythingWelcome to SCENARIO, AKAM Development\'s first and most exclusivephase. With exceptional services andextraordinary amenities, you can choose yourevery own scenario every dayand have\r\nthe power to shape your life in your home!Live your own magical scenario andexperience the life unlimited \r\nopportunities. you will shine and live your happiest moments with your beloved ones in everycorner.\r\nForget the troubles of the real world andstep into your selected SCENARIO!', 'شركة “آكام ”  شركة مساهمة مصرية مكونة من شركتين مصريتين هما شركة ريزيدنس وشركة بنايات بالإضافة إلى شركة سعودية هى شركة المحايد القابضة وبنك فيصل الإسلامى بشركته التى تمثل الذراع الإستثمارى له و هى الفيصل الإسلامي\r\nإستعانت شركة “آكام” فى التصميمات الخاصة بالمشروع بمكاتب استشارية مصرية واسبانية، ومن دبى والسعودية، لوضع المخطط الخاص بالمشروع .', 'AKAMaddresses the needs and priorities of itsclients and partners through long-termprofessional relationships based on strongvalues with a rigorous plan to become one of thefastest growing real estate developers in theregion creating happiness-based communities.\r\nLed by board members with a long history andstrong track record in real estate development,and collaboration withAlmuhaid Group, oneof the largest Engineering Consulting firms inthe middle East and a leadingfinancial entity,Faisal Islamic Bank, AKAMvows to offerexceptional quality and unique experience to itsclients in every project.AKAM builds communities inspired by your vision ofyour ideal world based onthe belief that luxury and quality are nolonger an option but a necessity.', '', NULL, 2, '2018-10-16 14:08:26', '2019-04-02 17:19:32', '31.71549440000001', '29.9723236', 1, 1, '', '', 1, 16, 23, NULL, NULL, NULL, NULL, NULL, 0),
(7, 'Marassi Bay - North Coast', 'Marassi Bay North Coast', 'North Coast', 'مراسى الساحل الشمالى Marassi North Coast يمثل المشروع  وجهة متوسطية متميزة، ويقع على مقربة من مطاري العلمين وبرج العرب مما يجعله وجهة يسهل الوصول إليها من مختلف المدن الأوروبية الكبرى ، كما أنه أحد المشاريع المملوكة لشركة إعمار مصر.\r\n\r\nوتبلغ مساحة مشروع “مراسي” 1500 فدان في منطقة خليج سيدي عبد الرحمن والعلمين التي تعتبر وجهة سياحية فريدة تتميز بشواطئها الساحرة ذات الرمال.\r\nالمساحات وانواع الوحدات المتاحه بالمشروع\r\nأنواع الوحدات : شاليه، شقه، تاون هاوس وفيلات\r\n\r\nمساحات الشاليهات تبدأ من 95 متر\r\nمساحات الفيلات تبدأ من 230 متر\r\n\r\nانظمة سداد المشروع\r\n5% مقدم وتقسيط حتى 7 سنوات', 'Sidi Abd El-Rahman Bay is full of childhood memories of afternoons spent tumbling down sand dunes and ducking and diving amongst gentle waves. \r\nMarassi Bay offers the opportunity for families to make wonderful new memories in this land of sparkling blue sea, white sand and spectacular desert sunsets.\r\nMarassi, the exclusive destination resort inspired by the best of Europe and the Middle East, illustrates a modern twist on Egypt’s most exquisite stretch of historic coastline.\r\nMarassi is the destination resort already known as the crème de la crème of beachfront living on the North Coast of Egypt.', 'Step into a realm of lavish living and vibrant sophistication with Emaar’s prodigious and exquisite communities. Upholding its reputation as one of the world’s largest and most progressive property developers, Emaar celebrates a decade of accomplishments with its distinguished gated communities across Egypt: Uptown Cairo in the heart of Cairo, Mivida in New Cairo and Marassi in the North Coast.\r\n\r\nWe build homes that redefine living standards, putting your needs and aspirations first. We develop thriving neighborhoods that reflect the quality of life you deserve. We create healthy, lively communities that blend extravagance with glamor and white-gloved finesse.', 'Step into a realm of lavish living and vibrant sophistication with Emaar’s prodigious and exquisite communities. Upholding its reputation as one of the world’s largest and most progressive property developers, Emaar celebrates a decade of accomplishments with its distinguished gated communities across Egypt: Uptown Cairo in the heart of Cairo, Mivida in New Cairo and Marassi in the North Coast.\r\n\r\nWe build homes that redefine living standards, putting your needs and aspirations first. We develop thriving neighborhoods that reflect the quality of life you deserve. We create healthy, lively communities that blend extravagance with glamor and white-gloved finesse.', '', 'uploads/projects/1gfTbXT14awvIh8Ncmpl18YMS6bbjPTBhoUfqhbN.mp4', 3, '2018-10-16 15:08:02', '2019-04-02 17:18:35', '28.756579099999954', '30.96287879999999', 1, 1, '', '', 1, 25, 401, NULL, NULL, NULL, NULL, NULL, 0),
(8, 'THE LAKEVIEW RESIDENCE - NEW CAIRO', 'THE LAKEVIEW RESIDENCE - NEW CAIRO', 'New Cairo', 'كمبوند ليك فيو ريزيدنس Lake View Residence فى قلب التجمع الخامس بجوار ميفيدا وفيلدج جيت وليان ريزيدنس - 5 دقائق من الجامعة الامريكية يمتد كمبوند ليك فيو على مساحة 77 فدان - حيث تمثل المبانى 23% فقط من اجمالى المساحة والمساخة المتبقية عبارة عن خدمات ومساحات خضراء وبحيرات .. يضم كمبوند ليك فيو 118 مبنى Ultra Modern Design - منطقة تجارية - جراجات تحت الارض - منطقة ترفيهية - بحيرات - مساحات خضراء - Club House يضم كمبوند ليك فيو شقق بمساحات تبدأ من 122 م امتلك بمقدم يبدأ من 5% وبالتقسيط حتى 7 سنوات', 'Lake View Residence’s location is 15 minutes away from Cairo International Airport, close to all international schools and universities who have moved their campuses, seeking a better environment for students, hospitals, clinics, malls, clubs, etc.\r\nLake View Residence has a neighboring retail area, an extension to the premises which is approximately 40,000 sqm consisting of a multitude of shops – global chains, high end local brands, F&B restaurants and cafes, and many more. The mall will not only serve as a shopping and dining destination, but will be of convenience to families who have children as well. All sorts of entertainment will be available for all ages, so as to give room for the parents to enjoy their outing experience.\r\nThe project has beautiful surroundings of landscape, an adjacent mall built with the latest technology next to the premises for shopping and entertainment. Residents get a controlled entrance and exit to the mall from within the compound for convenience and safety.', 'كمبوند ليك فيو ريزيدنس Lake View Residence فى قلب التجمع الخامس بجوار ميفيدا وفيلدج جيت وليان ريزيدنس - 5 دقائق من الجامعة الامريكية يمتد كمبوند ليك فيو على مساحة 77 فدان - حيث تمثل المبانى 23% فقط من اجمالى المساحة والمساخة المتبقية عبارة عن خدمات ومساحات خضراء وبحيرات .. يضم كمبوند ليك فيو 118 مبنى Ultra Modern Design - منطقة تجارية - جراجات تحت الارض - منطقة ترفيهية - بحيرات - مساحات خضراء - Club House يضم كمبوند ليك فيو شقق بمساحات تبدأ من 122 م امتلك بمقدم يبدأ من 5% وبالتقسيط حتى 7 سنوات', 'Lake View Residence’s location is 15 minutes away from Cairo International Airport, close to all international schools and universities who have moved their campuses, seeking a better environment for students, hospitals, clinics, malls, clubs, etc.\r\nLake View Residence has a neighboring retail area, an extension to the premises which is approximately 40,000 sqm consisting of a multitude of shops – global chains, high end local brands, F&B restaurants and cafes, and many more. The mall will not only serve as a shopping and dining destination, but will be of convenience to families who have children as well. All sorts of entertainment will be available for all ages, so as to give room for the parents to enjoy their outing experience.\r\nThe project has beautiful surroundings of landscape, an adjacent mall built with the latest technology next to the premises for shopping and entertainment. Residents get a controlled entrance and exit to the mall from within the compound for convenience and safety.', '', NULL, 4, '2018-10-16 15:54:23', '2019-04-02 17:10:11', '31.491318200000023', '30.00741300000001', 1, 1, '', '', 1, 16, 31, NULL, NULL, NULL, NULL, NULL, 0),
(9, 'OIA', 'OIA', 'New Capital', 'قد تم تصميم كمبوند أويا على مساحة 30 فدان لتوفر لك شركة إيدج كل ما تحتاج للأستمتاع بالحياة ، بخلاف العديد من المميزات الأخرى ، كـ الفنادق ، والنوادى ، وحمامات السباحة الخاصة ، والصالات الرياضية ، والمساحات الخضراء الواسعة ، بالأضافة إلى مجمع من المطاعم و الكافيهات ، وأيضا منطقة ترفيهية للأطفال ، لتضمن لك مكان آمن وصحى\r\nيقع مشروع اويا  OIA في قلب العاصمة الادارية بجوار ال Expo علي بعد 5 دقائق من النهر الاخضر و10 دقائق من حي السفارات و 20 دقيقة من القصر الرئاسي و مطار العاصمة الادارية الجديدة\r\nشقق : مساحات تبدأ من 123 متر إلى 268 متر ..', 'OIA is situated on the premium edge of the New AdministrativeCapital, strategically positioned to overlook four main roads and offereasy accessibility from all directions in the R7 District. The first of amyriad of outstanding developments in the area, the project is set tobecome a gateway to the new capital and the future it holds for itshomeowners and investors. Moreover, OIA’s distinct residents will findthemselves only minutes away from all that their hearts desire, both,inside and outside the development.', 'The inauguration of the New Administrative Capital marked the beginning of Edge\r\nHolding Group, which was founded in early 2018 as a mutual fund between\r\nAl-Borouj Egypt and El-Mashareq KSA.\r\nAt Edge Holding, we believe that life is all about the pleasant experiences that reflect our individualdreams and desires. \r\nOur aim is to develop and create harmonious communities that present new and exciting living experiences,all of which are customer-centric and fulfil the dream of a better future. Passion, integrity and clarityare the driving forces that propel us towards our vision of establishing another success story throughunique and heartwarming living communities.', 'The inauguration of the New Administrative Capital marked the beginning of Edge\r\nHolding Group, which was founded in early 2018 as a mutual fund between\r\nAl-Borouj Egypt and El-Mashareq KSA.\r\nAt Edge Holding, we believe that life is all about the pleasant experiences that reflect our individualdreams and desires. \r\nOur aim is to develop and create harmonious communities that present new and exciting living experiences,all of which are customer-centric and fulfil the dream of a better future. Passion, integrity and clarityare the driving forces that propel us towards our vision of establishing another success story throughunique and heartwarming living communities.', '', NULL, 5, '2018-10-16 15:57:11', '2019-04-02 17:09:40', '31.740025699999933', '29.9921489', 1, 1, '', '', 1, 16, 23, NULL, NULL, NULL, NULL, NULL, 0),
(10, 'ميفيدا', 'Mivida', 'Mivida  EMAAR - NEW CAIRO', 'Mivida” ميفيدا من إعمار مصر يعتبر مشروع Mivida Emaar من أحدث وأفخم المجمعات السكنية حيث صممت جميع الوحدات على مساحات واسعة تتميز باطلالتها المتميزة على المساحات الخضراء التي تتخللها المساحات المائية.\r\n\r\nوتتميز الوحدات السكنية في بتنوعها ما بين شقق مستقلة ودوبلكس وبنتهاوس. كما يحتوي الكمبوند على المرافق والخدمات المتكاملة التي من شأنها تلبية احتياجات السكان ليتمتع الأفراد بحياة عصرية راقية.\r\n\r\nو يمتد كمبوند Mivida Emaar علي مساحة 860 فدان مقسمة إلى وحدات سكنية ومساحات خضراء، الأمر الذي يتيح للأفراد فرصة التمتع بالطبيعة والهدوء والخصوصية.\r\nيقع مشروع  Mivida Emaarعلي شارع التسعين الجنوبي  مباشرة في قلب التجمع الخامس بالقاهرة الجديدة علي بعد 5 دقائق من الجامعة الأمريكية.\r\n\r\nعلي بعد 15 دقيقة من مصر الجديدة و مدينة نصر.\r\nعلي بعد 10 دقائق من مطار القاهرة الجوي.\r\nالمساحات والاسعار وانظمة السداد\r\nشقق : مساحات تبدأ من 133 متر إلى 290 متر.\r\nتاون هاوس : مساحات 250 متر.\r\nتوين هاوس :مساحات تبدأ من 270 متر الي 300 متر.\r\nفيلا : مساحات تبدأ من 350 متر الي 450 متر.\r\n%5  تعاقد و 10%  بعد 3 شهور و تقسيط حتي7 سنوات.\r\nتاون هاوس التجمع الخامس\r\nتوين هاوس التجمع الخامس\r\nدوبلكس التجمع الخامس\r\nشقق التجمع الخامس\r\nفيلات التجمع الخامس', 'Mivida Boulevard, the pulsing vibrant heart of the greenest development in New Cairo. Inspired by the famous Las Rambla of Barcelona, this one of a kind destinations is set to be a thriving cosmopolitan area featuring an array of upscale shopping, leisure and entertainment Venus. Set in a contemporary environment with lush landscaping, outdoor seating and beautiful canopies, discover life at its finest, discover the vibrant side of life.', 'تعتبر \"إعمار العقارية\" واحدة من أكثر شركات التطوير العقاري قيمةً واحتراماً في العالم. وتمتلك الشركة خبرات استثنائية في قطاعات التطوير العقاري ومراكز التسوق وتجارة التجزئة والضيافة والترفيه، وترسم ملامح جديدة لأنماط الحياة العصرية الراقية من خلال التركيز على تميز التصميم وجودة البناء وتسليم المشاريع في المواعيد المحددة.\r\n\r\n\"إعمار العقارية\"، شركة مساهمة عامة تتخذ من دبي مقراً لها، مدرجة في سوق دبي المالي، وهي من الشركات الرائدة عالمياً في مجال التطوير العقاري ومن أهم مطوري المجمعات السكنية المتكاملة، حيث ساهمت بدور حيوي في الارتقاء بالقطاع العقاري في دبي إلى آفاق غير مسبوقة من التميز.\r\n\r\nوتعمل \"إعمار\" على تعزيز خبراتها في تطوير المجمعات السكنية المتكاملة على المستوى الدولي حيث تتمتع اليوم بحضور قوي في عدد من أهم الأسواق العالمية، بالتزامن مع استمرار الشركة في تعزيز أدائها ضمن قطاعات أعمالها لتشمل الضيافة والترفيه، ومراكز التسوق، وتجارة التجزئة.\r\n\r\nتتجسد الإمكانات الكبيرة التي تتمتع بها \"إعمار\" في مجال تطوير المشاريع في مختلف المعالم الاستثنائية التي قامت بتطويرها في دبي وغيرها من الأسواق العالمية.\r\n\r\nيعتبر \" وسط مدينة دبي \" أبرز مشاريع شركة \" إعمار العقارية \"، وأصبح اليوم أكثر وجهات الحياة العصرية استقطاباً للزوار في العالم. يمتد المشروع على مساحة 500 فدان ويضم عدداً من أبرز معالم المدينة وفي مقدمتها \"برج خليفة\" و\"دبي مول\" و\"دبي فاونتن\".\r\n\r\nوقامت \"إعمار\" بتطوير مجموعة من أشهر المجمعات السكنية المتكاملة في دبي ومنها \"المرابع العربية\" و\"روعة الإمارات\" و\"مرسى دبي\".\r\n\r\nوتعمل \"إعمار\" على تطوير العديد من المشاريع التي ترسم ملامح جديدة لمدن المستقبل في دبي والأسواق العالمية. ومن خلال الشراكات الاستراتيجية التي تعقدها، نجحت الشركة في تعزيز رصيدها من الأراضي محلياً وعالمياً.', 'Step into a realm of lavish living and vibrant sophistication with Emaar’s prodigious and exquisite communities. Upholding its reputation as one of the world’s largest and most progressive property developers, Emaar celebrates a decade of accomplishments with its distinguished gated communities across Egypt: Uptown Cairo in the heart of Cairo, Mivida in New Cairo and Marassi in the North Coast.\r\n\r\nWe build homes that redefine living standards, putting your needs and aspirations first. We develop thriving neighborhoods that reflect the quality of life you deserve. We create healthy, lively communities that blend extravagance with glamor and white-gloved finesse.', '', NULL, 3, '2018-10-16 15:57:24', '2019-04-02 17:17:55', '31.539854800000057', '30.0075005', 1, 1, '', '', 1, 16, 31, NULL, NULL, NULL, NULL, NULL, 0),
(11, 'The Loft', 'The Loft', 'New Capital', 'يعد ذي لوفت من أحدث المشروعات الموجودة بالعاصمة الإدارية ، والتي سيتم تنفيذها بناء على معايير حضارية جديدة ذات بنية تحتية عالية ، لتجسد لك مفهوما جديدا حول حياة أكثر راحة ورفاهية من خلال توفير المعيشة الفاخرة إلى جانب الرفاهية العملية ، وجميع المرافق الأساسية، التى تأخذك إلى تجربة حياة جديدة بالكامل قد لا تتوفر فى أماكن أخرى\r\nيقع بموقع مميز جدا بالعاصمة الجديدة، ما بين الـ Expo سيتى وحى السفارات، وأيضا بالقرب من الجامعة البريطانية ، وعلي بعد دقيقتين من من محور محمد بن زايد الجنوبي والدائرى الإقليمى، وكذلك على بعد دقائق من النهر الأخضر و الكاتدرائية، كما يبعد عن مطار العاصمة الإدارية بـ 15 دقيقة\r\nصُمم مشروع لوفت العاصمة الإدارية الجديدة بأفخم التصميمات المعمارية الحضارية، بوحدات سكنية لها منظر خاص ومميز، تطل على الحدائق وحمامات السباحة والبحيرات ، مما يعطى لساكنى الوحدات الكثير من الراحة النفسية والهدوء ، يقع الكمباوند على مساحة 23 فدان مقسمة إلى مساحات مختلفة مابين (شقق – دوبلكس – بنتهاوس) ، مساحات الوحدات تبدأ من 78 متر إلى 379 متر', 'The Loft is a new residential compound by The Living Yards in the New Capital. It has an enigmatic location where it\'s just 25 km away from 5th Settlement and 10 minutes away from the massive green river.\r\n\r\nThe Loft covers 23 acres and offers luxurious customizable lofts in buildings with Post-modern British Architecture. These lofts range from 1 bedroom to 5 bedrooms that all directly overlook the park. \r\n\r\nThe Loft features various facilities including: a commercial area, BBQ area, kids area, bicycle track, jogging track, pools, lagoons, and a clubhouse.', 'THE LIVING YARDS DEVELOPMENTS IS A NEW REAL ESTATE DEVELOPER. THE LIVING YARDS DEVELOPMENTS HAS A NEW INSPIRING VISION. INTRODUCING A UNIQUE CONCEPT TO THE REAL ESTATE MARKET. PRACTICAL LUXURY, A MIX OF AFFORDABILITY WITH LAVISHNESS AND DIVERSITY WITH LUXURY. THE LIVING YARDS DEVELOPMENTS HAS A NEW PROJECT IN THE NEW CAPITAL CITY CALLED THE LOFT.', 'THE LIVING YARDS DEVELOPMENTS IS A NEW REAL ESTATE DEVELOPER. THE LIVING YARDS DEVELOPMENTS HAS A NEW INSPIRING VISION. INTRODUCING A UNIQUE CONCEPT TO THE REAL ESTATE MARKET. PRACTICAL LUXURY, A MIX OF AFFORDABILITY WITH LAVISHNESS AND DIVERSITY WITH LUXURY. THE LIVING YARDS DEVELOPMENTS HAS A NEW PROJECT IN THE NEW CAPITAL CITY CALLED THE LOFT.', '', 'uploads/projects/5jZzfHTbGlOxQT14xNJxWbwlJr2wA2eyNGn0ed9S.mp4', 6, '2018-10-16 16:25:43', '2019-04-02 15:04:22', '31.740025699999933', '29.9921489', 1, 1, '', '', 0, 16, 23, NULL, NULL, NULL, NULL, NULL, 0),
(12, 'ميد تاون كوندو - العاصمة الادارية الجديدة', 'MidTown Condo - New Capital', 'New Capital', 'هو احدث و اشهر كمبوندات  شقق اقيمت فى العاصمة الادارية الجديده\r\nفهو حديث الساعه فى العاصمة منذ ان تم الاعلان عنه مفاجأة العاصمة الادارية بعد نجاح ميدتاون فيلا و ميدتاون سولو فكمبوند ميد تاون كوندو العاصمة الادارية الجديدة  قد تم تخصيصه الكمبوند للشقق فقط بعد نجاح ميدتاون صولو فيلات قامت شركه بيتر هوم بفتتاح ميدتاون كوندو للشقق midtown condo و هو احدث مشرروع  شقق فى العاصمة الادارية الجديدة يقدم لك مفهوم مبتكر للحياة السكنية في مصر داخل مجتمع سكني متكامل الخدمات\r\n.و مختلف عن اى كمبوند اخر', 'The new administrative capital is located 45 kilometers east of Cairo and just outside\r\nthe Second Greater Cairo Ring Road. According to the plans, the city would become\r\nthe new administrative and financial capital of Egypt, housing the main government\r\ndepartments and ministries, as well as foreign embassies.\r\nThe city is planned to consist of 21 residential districts and 25 «dedicated districts. »\r\nIts downtown is to have skyscrapers and a tall monument said to resemble the Eiffel\r\nTower and Washington Monument.\r\nThe city will also have a park double the size of New York City’s Central Park, artificial\r\nlakes, about 2,000 educational institutions, a technology and innovation park, 663\r\nhospitals and clinics, 1,250 mosques, 40,000 hotel rooms, a major theme park four\r\ntimes the size of Disneyland, 90 square kilometers of solar energy farms, an electric\r\nrailway link with Cairo, and a new international airport. It is planned that the transfer\r\nof parliament, presidential palaces, government ministries and foreign embassies\r\nwill be completed between 2020 and 2022.', 'بيتر هوم للاستثمار العقارى\r\nشركه كبرى متخصصه فى مجال عقارات والاستثمار العقارى فى الشرق الاوسط وافريقيا ولديها العديد من المشروعات فى القاهره \r\nو ساهمت فى بناء العديد من الكومبوندات فى القاهره الجديده وهاى لاند بارك فى مدينه 6 اكتوبر', 'The group of companies specializes in the construction and operation of facilities that present a better way of living. It brings out the elegance of the old and well –established architecture, with a touch of modernity and practicality.\r\nBetter Home Group incorporates the following dedicated companies, each with a range of upscale projects. provides all-inclusive residential compounds with a modern\r\nand innovative flair.\r\nIts current projects are Highland Park 6th October City and Highland Park New Cairo.', '', NULL, 7, '2018-10-16 16:32:38', '2019-04-02 17:09:02', '31.758546300000035', '30.0154128', 1, 1, '', '', 0, 16, 23, NULL, NULL, NULL, NULL, NULL, 0),
(13, 'ميدتاون صولو - العاصمة الادارية الجديدة', 'MiDTown Solo - New Capital', 'New Capital', 'هو أول مشروع فيلات في قلب العاصمة الإدارية وهو احدث مشروعات شركة بيتر هوم الشهيرة Better Home\r\nأمام مدينة المعارض مباشرة ( Expo City ) و على بعد دقائق فقط من الكاتدرائية و المسجد الأكبر حيث يطل على النهر الأخضر مباشرة Green River اكبر حديقة فى العالم حيث يمتد طولها على امتداد العاصمة الادارية الجديدة و ذلك لضمان اقصى راحه للعميل و استمتاعه بالمساحات الخضراء و تجديد الهواء الطبيعي فى العاصمة و ايضا يقرب كمبوند ميد تاون من فندق الماسة الشهير حيث يتمتع ميدتاون صولو العاصمة الادارية الجديدة بموقع متميز جدا في قلب العاصمة الإدارية الجديدة بالقرب من الحى الدبلوماسى وهو ارقى مكان والأكثر تحضراً في العاصمة الأدارية الجديدة .', 'This location was chosen to be an extension of the current capital, it extends Cairo’s east between the way of ‘’Cairo- Suez,‘’ and ’’Cairo – al Ain sukhna‘’, east of the regional ring road, 45 km from the center of Cairo, 80 kilometers near the city of Suez, also near the red sea, which gives it a logistical advantage and strategic benefits, as it is expected to accommodate about seven million and adjusted capital area as well.\r\nHowever the new area of the state of Singapore which is approximately four times the Washington, DC,. Is an area of 170.000 acres. Capital Cairo will set a new design standard for the capital of the capital a sustainable and manufactured strategic, new urban center, that stimulates build a national spirit, enhance compatibility, and provide long-term growth of the country therefore this would ensure the survival of the cairn capital for upcoming generations, to be a new capital for all Egyptians.', 'بيتر هوم للاستثمار العقارى\r\n شركه كبرى متخصصه فى مجال عقارات والاستثمار العقارى فى الشرق الاوسط وافريقيا ولديها العديد من المشروعات فى القاهره \r\n و ساهمت فى بناء العديد من الكومبوندات فى القاهره الجديده وهاى لاند بارك فى مدينه 6 اكتوبر', 'The group of companies specializes in the construction and operation of facilities that present a better way of living. It brings out the elegance of the old and well –established architecture, with a touch of modernity and practicality.\r\n Better Home Group incorporates the following dedicated companies, each with a range of upscale projects. provides all-inclusive residential compounds with a modern\r\n and innovative flair.\r\n Its current projects are Highland Park 6th October City and Highland Park New Cairo.', '', NULL, 7, '2018-10-16 17:02:12', '2019-04-02 17:08:33', '31.740025699999933', '29.9921489', 1, 1, '', '', 0, 16, 23, NULL, NULL, NULL, NULL, NULL, 0),
(14, 'The City', 'The City', 'New Capital', 'يقع كمبوند ذا سيتي العاصمة الإدارية فى قلب العاصمة الادارية ويقام المشروع على مساحة 54 فدان ويوجد العديد من المميزات فى كمبوند ذا سيتي حيث ان نسبة البناء فى المشروع 22.5% فقط حتى لا يكون هناك كثافة سكانية عالية و بالتالى يتم التمتع بجو مختلف و مميز من الهدوء و الراحه النفسيه و البعد كل البعد عن روتين الحياة و ارهاق العمل و التلوث السمعى و البصرى بشتي انواعة و ذلك بجانب ان هناك ما يقرب من 12% خدمات و ذلك لتقديم افضل خدمات ممكنة للعميل و توفير كل ما يحتاجة بجانب المسطحات الخضراء و اللاند سكيب', 'THE CITY Projects in The New Capital, in R7 H2 region. The project features a privileged location; it is close to the Embassies’ area, El-Massa Hotel, the exhibition area, the Opera House and the Green River (which is one of the most important sights of The New Capital.\r\n\r\nThe project features a magnificent and distinctive design and provision of all types of buildings from separate villas and apartments, duplex or individual.\r\n\r\nThe project provides all the needs of shopping mall, Administration building, medical center, a social club and International Nursery.\r\n\r\nThe gardens are about 70% of the land’s area with artificial lakes. Also, includes City Square that consists of different cafes, restaurants, kids’ area and dancing fountain.', 'Master Group are a group of companies working on establishing projects in the residential real estate sector, constructing tourist villages, achieving the best performance & providing high standards of services in all projects.', 'Master Group are a group of companies working on establishing projects in the residential real estate sector, constructing tourist villages, achieving the best performance & providing high standards of services in all projects.', '', NULL, 14, '2018-10-16 18:03:45', '2019-04-02 17:00:16', '31.372424199999955', '30.0919936', 1, 1, '', '', 1, 16, 23, NULL, NULL, NULL, NULL, NULL, 0),
(15, 'Serrano', 'Serrano', 'New Capital', 'سيرانو العاصمة الإدارية الجديدة يقع الكمباوند بموقع مميز جدا بالعاصمة الجديدة، بمنطقة الـR7، بجوار حى السفارات و الـ Expo سيتى، وأيضا بالقرب من الجامعة البريطانية BUE، وعلي بعد دقيقتين من مجمع المدارس والمستشفيات، وكذلك على بعد دقائق من النهر الأخضر و الكاتدرائية، كما يبعد عن مطار العاصمة الإدارية والقصر الرئاسي بـ 15 دقيقة، ويعد كمباوند Serrano New capital من أحدث مشروعات العاصمة الإدارية الجديدة، فقد أطلقتها شركة New Plan أحد المطورين الجدد بالعقارات، والتى تعمل على تقديم نظرة جديدة من الحياة الحديثة، تأخذك إلى تجربة جديدة مليئة بالإنتعاش والتميز وتوفير كافة سبل الراحة\r\nصمم مشروع سيرانو العاصمة الإدارية الجديدة بتصميمات حديثة وإنشاءات عالمية ومميزة، والعديد من الحدائق والمساحات الخضراء مما يعطى لك المزيد من الراحة النفسية والهدوء، يقع الكمباوند على مساحة 15 فدان مقسمة إلى مساحات مختلفة مابين ( شقق – بنتهاوس – دوبلكس )، تبدأ من 67 متر إلى 302 متر\r\n .', 'Serrano is a gated modern community with unlimited privacy, absolute serenity, and unrivaled lifestyle within a breathtaking lush landscape representing 80% of the project’s total area.', 'New Plan Developments is a Shareholding company, its first real estate development project in Egypt is SERRANO Compound, in new capital, Cairo.\r\n\r\nNew Plan Developments has a long history in real estate and commercial activities in the Kingdom of Saudi Arabia; represented by:\r\n\r\nAl Rashed contracting company (KSA-class one)\r\nAl-Khalil construction company (KSA-egy) and subsidiaries\r\nand in Dubai; represented by:\r\nGlobal Overseas marime LTD.\r\nDimond oasis General Trading L.L.C Dubai.\r\nPioneer Egypt Shipping agencies.\r\nAl-‐Ashrafia Holiday Homes reuntel And subsidiaries.', 'New Plan Developments is a Shareholding company, its first real estate development project in Egypt is SERRANO Compound, in new capital, Cairo.\r\n\r\nNew Plan Developments has a long history in real estate and commercial activities in the Kingdom of Saudi Arabia; represented by:\r\n\r\nAl Rashed contracting company (KSA-class one)\r\nAl-Khalil construction company (KSA-egy) and subsidiaries\r\nand in Dubai; represented by:\r\nGlobal Overseas marime LTD.\r\nDimond oasis General Trading L.L.C Dubai.\r\nPioneer Egypt Shipping agencies.\r\nAl-‐Ashrafia Holiday Homes reuntel And subsidiaries.', '', NULL, 17, '2018-10-16 18:20:14', '2019-04-02 16:59:52', '31.710845999999947', '29.96306', 1, 1, '', '', 1, 16, 23, NULL, NULL, NULL, NULL, NULL, 0),
(16, 'تريو جاردنز', 'Trio Gardens', 'New cairo', 'TRIO Gardens is at New Cairo, right in the 5th settlement – at the highest point in Cairo, above sea \r\nlevel. It has been master planned over 35.5 acres, where %75 is dedicated to greenery, while \r\nbuildings are built over %25 of the total land area. \r\n\r\nTrio Gardens offers a new living concept under the name of Trio Villas; a set of three duplexes \r\noverlapping each other with a private garden and plunge pool for each one. Designed by HECATE \r\ninternational architectural house based in Paris-Beirut, led by the world-famous designer Eng. Paul \r\nAntonio’s. \r\n\r\nAll the buildings are connected with open gardens with lovely water features and fully functional \r\nparks with different zones for mixed-use. Kids zone that is creative as their young minds, Yoga & \r\nmeditation zone, barbeque gathering zone, work stations, and outdoor kids & adults gyms. \r\nThe project also has bike trails with automated rental bike storage and 3 different jogging trails; \r\nsmall, medium and large loops.', 'TRIO Gardens is at New Cairo, right in the 5th settlement – at the highest point in Cairo, above sea \r\nlevel. It has been master planned over 35.5 acres, where %75 is dedicated to greenery, while \r\nbuildings are built over %25 of the total land area. \r\n\r\nTrio Gardens offers a new living concept under the name of Trio Villas; a set of three duplexes \r\noverlapping each other with a private garden and plunge pool for each one. Designed by HECATE \r\ninternational architectural house based in Paris-Beirut, led by the world-famous designer Eng. Paul \r\nAntonio’s. \r\n\r\nAll the buildings are connected with open gardens with lovely water features and fully functional \r\nparks with different zones for mixed-use. Kids zone that is creative as their young minds, Yoga & \r\nmeditation zone, barbeque gathering zone, work stations, and outdoor kids & adults gyms. \r\nThe project also has bike trails with automated rental bike storage and 3 different jogging trails; \r\nsmall, medium and large loops.', 'شركة M2 لها سابقة اعمال عريقة للغاية في جميع مجالات المجتمع والحياة حيث تاسست شركة M2 جروب\r\n سنة 1980 وهذا مايميزها عن غيرها وهي خبرتها العملاقة واعمالها حيث ان شركة M2 لها العديد من الاعمال في مجال الصناعة والزراعة والإغذية والصناعة والنفط والغاز والاستثمار المالي في المجال الجوي وهي مؤسسة شركة INTRO للطاقة الشمسية سنة 2005 والعديد والعديد من الاعمال والمشاركة في جميع القطاعات الهامة والإساسية لها دور كبير للغاية في المجتمع وهذا بسبب سابقة اعمالها العملاقة بخلاف خبرتها وسابقة اعمالها في السوق العقاري.', 'M² Developments, part of the regional well known INTRO Group, which was established in 1980. INTRO is comprised of a diverse group of companies, with an overall of 5500 employees, which operate in different sectors including oil & gas, industrial automation, financial investment, atmospheric gases, and food &\r\n\r\nM² Developments was established with a new concept of altering the real estate market in Egypt, aiming to create a unique living experience, omit the excess beyond function and provide products that speak more.\r\n\r\nWe began a journey of thinking beyond the norm in Real Estate across Egypt, with a functional concept of slimming residential living spaces; focused on giving the customer.', '', NULL, 19, '2018-10-16 18:59:04', '2019-04-02 16:59:16', '31.606101800000033', '30.05727419999999', 1, 1, '', '', 1, 16, 31, NULL, NULL, NULL, NULL, NULL, 0),
(17, 'MOUNTAIN VIEW CHILLOUT PARK', 'MOUNTAIN VIEW CHILLOUT PARK', '6th Of October', 'Choose a life that is amidst lush greens, beautifully landscaped gardens and water features. At Mountain View Chillout Park, life is designed to encourage you to live happily and fully and make the most of every day. Boasting American style architecture, homes are nestled amidst acres of green, with a wide range of trees and plants to enjoy. A family-friendly environment that offers children an array of activities to entertain themselves, this place is truly safe thanks to the cross-over bridges that separate pedestrians from cars, so that the younger ones can truly enjoy the outdoors.\r\nPerfectly located in the heart of 6th of October City, Mountain View Chillout Park provides its residents with the convenience of being at proximity of key conveniences as well as the serenity of being in a green community. Minutes away from the 26th of July Mehwar and Ring Road, Mountain View Chillout Park provides its residents with direct access to both 6th of October and downtown Cairo in a matter of minutes', 'Choose a life that is amidst lush greens, beautifully landscaped gardens and water features. At Mountain View Chillout Park, life is designed to encourage you to live happily and fully and make the most of every day. Boasting American style architecture, homes are nestled amidst acres of green, with a wide range of trees and plants to enjoy. A family-friendly environment that offers children an array of activities to entertain themselves, this place is truly safe thanks to the cross-over bridges that separate pedestrians from cars, so that the younger ones can truly enjoy the outdoors.\r\nPerfectly located in the heart of 6th of October City, Mountain View Chillout Park provides its residents with the convenience of being at proximity of key conveniences as well as the serenity of being in a green community. Minutes away from the 26th of July Mehwar and Ring Road, Mountain View Chillout Park provides its residents with direct access to both 6th of October and downtown Cairo in a matter of minutes', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\nIn 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\nIn 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\nIn 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\nIn 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', '', NULL, 11, '2018-10-16 19:17:11', '2019-04-02 17:08:07', '30.918782700000065', '29.9285429', 1, 1, '', '', 0, 21, 74, NULL, NULL, NULL, NULL, NULL, 0),
(18, 'ساراي', 'SARAI', 'New Cairo', 'يقع مشروع «سراي» على مساحة ٥.٥ مليون متر مربع في القاهرة الجديدة وعلى مقربة من مشروع العاصمة الإدارية الجديدة. وسيضم المشروع عند اكتماله باقة هائلة ومتنوعة من المجمعات السكنية والمكاتب الإدارية وكذلك المساحات التجارية والمراكز الترفيهية، علمًا بان شركة Benoy قامت بتصميم المخطط العام للمشروع، وهي الشركة الإنجليزية البارزة التي قامت بتصميم مشروعي جزيرة ياس وحلبة سباق الفورمولا وان بأبو ظبي. وتقع المرحلة التي تم إطلاقها على مساحة ٢٢٠ ألف متر مربع، وهي مرحلة سكنية وتضم حوالي ١٣٠٠ وحدة تتراوح مساحاتها بين ١٢٠ و٢٤٠ متر مربع، كما إطلقت الشركة نوع جديد من الفيلات ضمن هذه المرحلة تحت اسم \"S Villa\"، حيث تتميز هذه الفيلات بتصميمها الابتكاري وتتراوح مساحتها بين ٢٦٠ و٢٩٥ متر مربع، علمًا بأن ٨٠ فدان إجمالي مساحة المرحلة الأولى سيتم تخصيصها للمساحات الخضراء والأماكن العامة، فضلاً عن احتواء المشروع على أكبر بحيرة صناعية في القاهرة.', 'Sarai believes that diversity is the key to life. Diversity promotes curiosity, exploration and discovery - allowing people to pursue their dreams and explore new angles that propel them outwards. Sarai employs a new concept of living that believes in personalizing every person’s living experience for their own luxury. Whether you seek a nurturing home that acts as a hive for your growing family or you’re after a custom-tailored home layout that guarantees you your very own private haven and oasis; Sarai has what you’re looking for. Explore the unrivaled lifestyle of Sarai, where the rhythm of life is dictated by your choices and the pace is yours to set. Located directly on the Cairo-Suez road, Sarai offers a perfect mix of urban to suburban exposure with a wide variety of spaces and units ranging from apartments to S-villas/ Town Houses among others set amidst a sprawling lush green landscape.', 'Founded in 1959 as a public real estate company, Madinet Nasr for Housing & Development (MNHD) is a leading real estate development company in Egypt and has been publicly traded on the Egyptian stock exchange since 1995.\r\n\r\nInitially MNHD was established with the primary objective of developing 40ml sqm of land in Nasr City as well as other nearby areas on the outskirts of Cairo. Since then, with a capable team of over 450 professionals, MNHD has developed mega projects and infrastructures across Egypt, serving the needs of thousands of middle-income Egyptians.\r\n\r\nWith its restructuring, MNHD has expanded its target audience to capitalize on potential opportunities in the upper end class of the real estate market.  Building on inherent capabilities and strengths of MNHD, the company has launched two new mega mixed use residential projects. To that end it has contracted the services of world renowned architecture companies to develop the master plan to align with their vision of creating a destination with all its facets rather than just another housing development project. Conforming to international standards Taj City is envisioned to be Cairo’s cultural destination and Sarai to be Cairo’s entertainment destination. The master plan of Taj City was developed by DDS & Partners, a renowned Belgian firm while the master plan of Sarai was developed by internationally recognized architectural firm Benoy.\r\n\r\nAs part of MNHD’s commitment to the development of Egypt and its local communities, the company uses its core expertise to support the development of communities in Nasr City. CSR initiatives are a key part of the company’s corporate philosophy.', 'Founded in 1959 as a public real estate company, Madinet Nasr for Housing & Development (MNHD) is a leading real estate development company in Egypt and has been publicly traded on the Egyptian stock exchange since 1995.\r\n\r\nInitially MNHD was established with the primary objective of developing 40ml sqm of land in Nasr City as well as other nearby areas on the outskirts of Cairo. Since then, with a capable team of over 450 professionals, MNHD has developed mega projects and infrastructures across Egypt, serving the needs of thousands of middle-income Egyptians.\r\n\r\nWith its restructuring, MNHD has expanded its target audience to capitalize on potential opportunities in the upper end class of the real estate market.  Building on inherent capabilities and strengths of MNHD, the company has launched two new mega mixed use residential projects. To that end it has contracted the services of world renowned architecture companies to develop the master plan to align with their vision of creating a destination with all its facets rather than just another housing development project. Conforming to international standards Taj City is envisioned to be Cairo’s cultural destination and Sarai to be Cairo’s entertainment destination. The master plan of Taj City was developed by DDS & Partners, a renowned Belgian firm while the master plan of Sarai was developed by internationally recognized architectural firm Benoy.\r\n\r\nAs part of MNHD’s commitment to the development of Egypt and its local communities, the company uses its core expertise to support the development of communities in Nasr City. CSR initiatives are a key part of the company’s corporate philosophy.', '', NULL, 25, '2018-10-16 19:41:46', '2019-04-02 16:57:54', '31.690621299999975', '30.1095311', 1, 1, '', '', 1, 16, 31, NULL, NULL, NULL, NULL, NULL, 0);
