(19, 'ماونتن فيو أكتوبر بارك', 'MOUNTAIN VIEW OCTOBER PARK', '6th Of October', 'Choose a life that is amidst lush greens, beautifully landscaped gardens and water features. At October Park, life is designed to encourage you to live life to the fullest and make the most of every day. Boasting American style architecture, at October Park, homes are nestled amidst acres of green, with a wide range of trees and plants to enjoy. From to the manicured Royal Gardens and the Organic Gardens, each resident will find pleasure strolling the different landscapes that make October Park the family', 'Choose a life that is amidst lush greens, beautifully landscaped gardens and water features. At October Park, life is designed to encourage you to live life to the fullest and make the most of every day. Boasting American style architecture, at October Park, homes are nestled amidst acres of green, with a wide range of trees and plants to enjoy. From to the manicured Royal Gardens and the Organic Gardens, each resident will find pleasure strolling the different landscapes that make October Park the family', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own