(20, 'MOUNTAIN VIEW EXECUTIVE RESIDENCE GIZA PLATEAU', 'MOUNTAIN VIEW EXECUTIVE RESIDENCE GIZA PLATEAU', '6th Of October', 'PROJECTSEXPLORE\r\nOCTOBER PROJECTS\r\n\r\nMOUNTAIN VIEW\r\nGIZA PLATEAU\r\nJOIN OUR COMMUNITY\r\n\r\nBACK TO ALL OCTOBER PROJECTS\r\nA Picture-Perfect Abode\r\nBuilt on 16 Acres of land, Mountain View Giza Plateau is designed to respond to the hectic day-to-day Cairene life and offer a charming green residential environment for everyone to enjoy. Open front yards, views of the rolling greens and manicured gardens are commonplace at GPL. Cobblestone streets adorn the landscape and make this place the perfect setting for a sunset stroll. The first home of Mountain View’s signature innovation the iVilla, GPL has become the address of choice for those who won’t compromise on comfort nor cost. With the iVilla, here the life you’ve dreamed of is finally within your reach.\r\nStrategically located on the Giza Plateau, a mere 18 kilometers from downtown Cairo, Mountain View Giza Plateau spoils its residents with the convenience of being at proximity of Cairo’s main road axis’s: Be it the Mehwar Road, Ring Road or the Alexandria Desert Road, wherever you are heading and coming from, Mountain View Giza Plateau is easily accessible to all.', 'PROJECTSEXPLORE\r\nOCTOBER PROJECTS\r\n\r\nMOUNTAIN VIEW\r\nGIZA PLATEAU\r\nJOIN OUR COMMUNITY\r\n\r\nBACK TO ALL OCTOBER PROJECTS\r\nA Picture-Perfect Abode\r\nBuilt on 16 Acres of land, Mountain View Giza Plateau is designed to respond to the hectic day-to-day Cairene life and offer a charming green residential environment for everyone to enjoy. Open front yards, views of the rolling greens and manicured gardens are commonplace at GPL. Cobblestone streets adorn the landscape and make this place the perfect setting for a sunset stroll. The first home of Mountain View’s signature innovation the iVilla, GPL has become the address of choice for those who won’t compromise on comfort nor cost. With the iVilla, here the life you’ve dreamed of is finally within your reach.\r\nStrategically located on the Giza Plateau, a mere 18 kilometers from downtown Cairo, Mountain View Giza Plateau spoils its residents with the convenience of being at proximity of Cairo’s main road axis’s: Be it the Mehwar Road, Ring Road or the Alexandria Desert Road, wherever you are heading and coming from, Mountain View Giza Plateau is easily accessible to all.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', '', NULL, 11, '2018-10-16 19:57:00', '2019-04-02 17:07:09', '30.918782700000065