(21, 'ماونتن فيو اي سيتي أكتوبر', 'MOUNTAIN VIEW iCity October', '6th Of October', 'ماونتن فيو أي سيتى اكتوبر هو إحدى المشاريع السكنية المميزة يقع في قلب مدينة 6 أكتوبر. ماونتن فيو أي سيتي هو إحدى الكمبوندات الراقية وتم تصميمها وفقا لأحدث وأرقى التصاميم الهندسية. ويحتوي الكمبوند على الخدمات الترفيهية والاجتماعية والتعليمية والصحية المختلفة، ليتمتع الأفراد بحياة عصرية فريدة من نوعها.', 'At iCity, we have created an environment that gives you the possibility to indulge in everything you wish for, without any compromise. iCity boasts a large and diverse bundle of features, homes and facilities that ensure there is something for everyone, that your every want and that your every need is met, even more that they are exceeded. Be it outdoor spaces, lush greens, tailor-made homes, sports facilities or outings for you to explore, at iCity, we have created an ideal environment for you, your family and your friends to grow and live happily. Even more, we have created an environment that is customizable and can be personalized at your own request.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', '', NULL, 11, '2018-10-16 20:25:44', '2019-04-02 17:06:38', '30.918782700000065', '29.9285429', 1, 1, '', '', 0, 21, 74, NULL, NULL, NULL, NULL, NULL, 0),
(22, 'تاج سيتي', 'TAJ CITY', 'Nasr City', 'يقع تاج سيتى فى قلب مدينة نصر وهو أحدث مشروعات الشركة انتظرته المنطقة فيعد تاج سيتى أضخم مشروع تم تطويره ليكون متعدد الاستخدامات الممتد على أكثر من ( 3,4 مليون متر مربع ) وعلى بعد دقائق فقط من هليوبوليس ومطار القاهرة الدولى . . والمدينة الجديدة لديها كافة متطلبات الحياة وتحتل موقعا استراتيجيا فى محيط أكبروأرقى تجمع للمراكز التجارية والأعمال بالقاهرة ويقدم تاج سيتى المكان المثالى للراغبين فى العيش والاستمتاع اللعب بالفخامة العصرية والمساحات الشاسعة الخضراء التى تحدد ملامح هذا الكمبوند الهادئ لنقدم شئ للجميع من وحدات سكنية وأماكن للتسوق ومحلات تجارية وفندق على درجة عالمية وأرقى المراكز الطبية والمدارس الدولية .', 'Taj City is the newest premium address for people who love luxurious living within a secure gated community – a place with a “get-away-from-it-all” ambience and one that has easy access to the heart of the Egyptian capital at the same time. It will also serve as an attractive venue to accommodate the most luxurious residential units, commercial areas, a world class hotel, strip mall, top notched medical facilities and an international school. Set to emerge as Cairo’s go-to cultural destination, Taj City will host a cultural wheel, an outdoor/indoor exhibition center and regular operatic performances.', 'Founded in 1959 as a public real estate company, Madinet Nasr for Housing & Development (MNHD) is a leading real estate development company in Egypt and has been publicly traded on the Egyptian stock exchange since 1995.\r\n\r\nInitially MNHD was established with the primary objective of developing 40ml sqm of land in Nasr City as well as other nearby areas on the outskirts of Cairo. Since then, with a capable team of over 450 professionals, MNHD has developed mega projects and infrastructures across Egypt, serving the needs of thousands of middle-income Egyptians.\r\n\r\nWith its restructuring, MNHD has expanded its target audience to capitalize on potential opportunities in the upper end class of the real estate market.  Building on inherent capabilities and strengths of MNHD, the company has launched two new mega mixed use residential projects. To that end it has contracted the services of world renowned architecture companies to develop the master plan to align with their vision of creating a destination with all its facets rather than just another housing development project. Conforming to international standards Taj City is envisioned to be Cairo’s cultural destination and Sarai to be Cairo’s entertainment destination. The master plan of Taj City was developed by DDS & Partners, a renowned Belgian firm while the master plan of Sarai was developed by internationally recognized architectural firm Benoy.\r\n\r\nAs part of MNHD’s commitment to the development of Egypt and its local communities, the company uses its core expertise to support the development of communities in Nasr City. CSR initiatives are a key part of the company’s corporate philosophy.', 'Founded in 1959 as a public real estate company, Madinet Nasr for Housing & Development (MNHD) is a leading real estate development company in Egypt and has been publicly traded on the Egyptian stock exchange since 1995.\r\n\r\nInitially MNHD was established with the primary objective of developing 40ml sqm of land in Nasr City as well as other nearby areas on the outskirts of Cairo. Since then, with a capable team of over 450 professionals, MNHD has developed mega projects and infrastructures across Egypt, serving the needs of thousands of middle-income Egyptians.\r\n\r\nWith its restructuring, MNHD has expanded its target audience to capitalize on potential opportunities in the upper end class of the real estate market.  Building on inherent capabilities and strengths of MNHD, the company has launched two new mega mixed use residential projects. To that end it has contracted the services of world renowned architecture companies to develop the master plan to align with their vision of creating a destination with all its facets rather than just another housing development project. Conforming to international standards Taj City is envisioned to be Cairo’s cultural destination and Sarai to be Cairo’s entertainment destination. The master plan of Taj City was developed by DDS & Partners, a renowned Belgian firm while the master plan of Sarai was developed by internationally recognized architectural firm Benoy.\r\n\r\nAs part of MNHD’s commitment to the development of Egypt and its local communities, the company uses its core expertise to support the development of communities in Nasr City. CSR initiatives are a key part of the company’s corporate philosophy.', '', NULL, 25, '2018-10-16 20:32:37', '2019-04-02 16:56:46', '31.426922699999977', '30.07845399999999', 1, 1, '', '', 1, 16, 68, NULL, NULL, NULL, NULL, NULL, 0),
(23, 'ميفيدا بيسنيز بارك', 'Mivida Business park', 'Mivida  EMAAR - NEW CAIRO', 'Mivida Business District - Emaar\r\n\r\nThe design architect L35 has created unobstructed open office space with a common core containing all services, allowing maximum efficiency and flexibility to users and tailor the office space according to their needs. Mivida Business District has shared underground parkings.\r\n\r\nThe building’s timeless environmentally sensitive and cost effective designs is both attractive and functional, balancing, natural lighting with energy saving.', 'Mivida Business District - Emaar\r\n\r\nThe design architect L35 has created unobstructed open office space with a common core containing all services, allowing maximum efficiency and flexibility to users and tailor the office space according to their needs. Mivida Business District has shared underground parkings.\r\n\r\nThe building’s timeless environmentally sensitive and cost effective designs is both attractive and functional, balancing, natural lighting with energy saving.', 'Emaar Misr’s vision is to become Egypt’s premier lifestyle community provider, through developing world class projects to fulfill the aspirations of its customer base. Emaar Misr’s aim is to continue to maintain a strong market position while increasing revenue and profitability.', 'Emaar Misr’s vision is to become Egypt’s premier lifestyle community provider, through developing world class projects to fulfill the aspirations of its customer base. Emaar Misr’s aim is to continue to maintain a strong market position while increasing revenue and profitability.', '', NULL, 3, '2018-10-16 20:33:12', '2019-04-02 17:15:39', '31.531348799999932', '30.0082823', 1, 1, '', '', 1, 16, 31, NULL, NULL, NULL, NULL, NULL, 0),
(24, 'تاج سلطان', 'TAG SULTAN', 'New Cairo', 'يوفر \"تاج سلطان\" تجربة حياة فريدة عن طريق تقديم أنماط مختلفة من الوحدات السكنية لتناسب جميع الاذواق و الاحتياجات حيث تتنوع تلك الانماط ما بين: الشقق، الدوبلكس، و الفيلات و تتسم جميعها بالتصميمات المعاصرة المميزة و بالاختيارات المتعددة فى المساحات. و يمكن القول بثقة أن \"تاج سلطان\" هو مجتمع مغلق (منعزل) وأمن تماما، ليس فقط بسبب توفر أنظمة الأمن الأكثر تطورا و لكن ايضا بسبب الموقع الاستراتيجى للمشروع الذى يجعلك وسط كل المناطق الحيوية و الذى يوفر مداخل يسهل الوصول اليها من اى مكان. صممت جميع المناطق السكنية فى\"تاج سلطان\" بعناية فائقة مع مراعاة توفر مساحات واسعة بين المبانى السكنية لتتمتع أنت و أسرتك بمنتهى الخصوصية فى اطلالة رائعة على المسطحات الخضراء. كذللك فالطرق والممرات تم تصميمها بدقة لتوفر اتساع مناسب يساعدكم على الاستمتاع بممارسة أنشطتكم اليومية بمنتهى السهولة.', 'Tag Sultan offers a unique living experience with diverse residential unit types to suit all tastes and needs; apartments, duplexes and villas with distinguished contemporary designs and a wide range of spaces, spread over 300,000 sqm. An enclosed, gated and secured community; not only because of the most advanced security systems but because of Tag Sultan’s location that puts you in the middle of a very vibrant and a strategic area with easy accessed entrances. All blocks in Tag Sultan are designed carefully to have wide spaces between the buildings for the residents to enjoy their privacy while overlooking beautifully planted green areas. Streets and walkways in Tag Sultan are also spacious for the residents to enjoy practicing their daily activities.', 'Founded in 1959 as a public real estate company, Madinet Nasr for Housing & Development (MNHD) is a leading real estate development company in Egypt and has been publicly traded on the Egyptian stock exchange since 1995.\r\n\r\nInitially MNHD was established with the primary objective of developing 40ml sqm of land in Nasr City as well as other nearby areas on the outskirts of Cairo. Since then, with a capable team of over 450 professionals, MNHD has developed mega projects and infrastructures across Egypt, serving the needs of thousands of middle-income Egyptians.\r\n\r\nWith its restructuring, MNHD has expanded its target audience to capitalize on potential opportunities in the upper end class of the real estate market.  Building on inherent capabilities and strengths of MNHD, the company has launched two new mega mixed use residential projects. To that end it has contracted the services of world renowned architecture companies to develop the master plan to align with their vision of creating a destination with all its facets rather than just another housing development project. Conforming to international standards Taj City is envisioned to be Cairo’s cultural destination and Sarai to be Cairo’s entertainment destination. The master plan of Taj City was developed by DDS & Partners, a renowned Belgian firm while the master plan of Sarai was developed by internationally recognized architectural firm Benoy.\r\n\r\nAs part of MNHD’s commitment to the development of Egypt and its local communities, the company uses its core expertise to support the development of communities in Nasr City. CSR initiatives are a key part of the company’s corporate philosophy.', 'Founded in 1959 as a public real estate company, Madinet Nasr for Housing & Development (MNHD) is a leading real estate development company in Egypt and has been publicly traded on the Egyptian stock exchange since 1995.\r\n\r\nInitially MNHD was established with the primary objective of developing 40ml sqm of land in Nasr City as well as other nearby areas on the outskirts of Cairo. Since then, with a capable team of over 450 professionals, MNHD has developed mega projects and infrastructures across Egypt, serving the needs of thousands of middle-income Egyptians.\r\n\r\nWith its restructuring, MNHD has expanded its target audience to capitalize on potential opportunities in the upper end class of the real