(25, 'AEON', 'AEON', 'El Sheikh Zayd', 'AEON first of its kind 20 floor towers that present the best of both urban and suburban living.\r\nAEON towers deliver an unparalleled, high end living experience accentuated by a diverse range of services and facilities', 'AEON first of its kind 20 floor towers that present the best of both urban and suburban living.\r\nAEON towers deliver an unparalleled, high end living experience accentuated by a diverse range of services and facilities', 'Marakez is a leading real estate developer in Egypt, with a complete portfolio of residential, commercial, entertainment and retail projects. With projects such as Mall of Arabia, Aeon Towers, and District 5, it has expanded its offering to ensure that its products cater to the entire market, which only Marakez, with its experience and track record in retail, services and residential development, can bring to life.', 'Marakez is a leading real estate developer in Egypt, with a complete portfolio of residential, commercial, entertainment and retail projects. With projects such as Mall of Arabia, Aeon Towers, and District 5, it has expanded its offering to ensure that its products cater to the entire market, which only Marakez, with its experience and track record in retail, services and residential development, can bring to life.', '', NULL, 26, '2018-10-16 21:22:47', '2019-04-02 16:43:49', '30.96735430000001', '30.0045635', 1, 1, '', '', 1, 21, 85, NULL, NULL, NULL, NULL, NULL, 0),
(26, 'MOUNTAIN VIEW I', 'MOUNTAIN VIEW I', 'New Cairo', 'Welcome to Mountain View’s earliest beginnings: a distinctive American style community that embodies exclusive living with beautiful settings. Built to offer the utmost of privacy and luxurious living to its residents, Mountain View I celebrates the serenity that comes with living in green spaces, surrounded by manicured gardens and inspiring landscapes. An invitation to choose living better, Mountain View I offers a tranquil yet friendly environment to its residents, where the community bonds are strong, and privacy is respected, and where life is made easy thanks to the wide range of facilities available at your fingertips.\r\n\r\nStrategically located in the heart of New Cairo, just 15 minutes away from the American University in Cairo, Mountain View I is close to all of the district’s attractions. Easily accessible through the ring road, Mountain View I’s location makes the most of suburban living all the while spoiling its residents with convenience in reach.', 'Welcome to Mountain View’s earliest beginnings: a distinctive American style community that embodies exclusive living with beautiful settings. Built to offer the utmost of privacy and luxurious living to its residents, Mountain View I celebrates the serenity that comes with living in green spaces, surrounded by manicured gardens and inspiring landscapes. An invitation to choose living better, Mountain View I offers a tranquil yet friendly environment to its residents, where the community bonds are strong, and privacy is respected, and where life is made easy thanks to the wide range of facilities available at your fingertips.\r\n\r\nStrategically located in the heart of New Cairo, just 15 minutes away from the American University in Cairo, Mountain View I is close to all of the district’s attractions. Easily accessible through the ring road, Mountain View I’s location makes the most of suburban living all the while spoiling its residents with convenience in reach.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', '', NULL, 11, '2018-10-17 12:47:25', '2019-04-02 17:06:07', '31.491318200000023', '30.00741300000001', 1, 1, '', '', 0, 16, 31, NULL, NULL, NULL, NULL, NULL, 0),
(27, 'MOUNTAIN VIEW II', 'MOUNTAIN VIEW II', 'New Cairo', 'Located in New Cairo, Mountain View is just a five-minute drive from the American University in Cairo and conveniently close to New Cairo’s major attractions. Easily reachable from all corners of the capital thanks to the ring road, Mountain View II brings together the pleasures of suburban living and the practicality that comes from being at the center.\r\nFeaturing four bedrooms and five bathrooms, the Mountain View Villa covers an area of 350 sqm, providing a spacious home for the whole family to be comfortable in. Featuring a laundry room, a maid’s quarter, private parking and ample storage space, our two-decker grand villas respond to your everyday needs and spoil you with exclusive luxuries.', 'Located in New Cairo, Mountain View is just a five-minute drive from the American University in Cairo and conveniently close to New Cairo’s major attractions. Easily reachable from all corners of the capital thanks to the ring road, Mountain View II brings together the pleasures of suburban living and the practicality that comes from being at the center.\r\nFeaturing four bedrooms and five bathrooms, the Mountain View Villa covers an area of 350 sqm, providing a spacious home for the whole family to be comfortable in. Featuring a laundry room, a maid’s quarter, private parking and ample storage space, our two-decker grand villas respond to your everyday needs and spoil you with exclusive luxuries.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', '', NULL, 11, '2018-10-17 13:01:40', '2019-04-02 17:05:38', '31.491318200000023', '30.00741300000001', 1, 1, '', '', 0, 16, 31, NULL, NULL, NULL, NULL, NULL, 0),
(28, 'ماونتن فيو اكزيكتيف ريزيدنس قطامية', 'MOUNTAIN VIEW EXECUTIVE RESIDENCE KATAMEYA', 'New Cairo', 'The best of both worlds reunites at Mountain View Executive Residence New Cairo: the intimacy of a friendly neighborhood and the convenience that comes with smartly designed and well-planned community that boast a wide range of facilities. Happiness, inspiration and tranquillity are what you will find at ERK. Where your wellbeing was kept in mind at each phase of the project from the conception to the delivery. An exclusive community flourishing amidst green spaces and winding lakes make this development a place that truly feels different, a place where after a long day at work you can come home and unwind. At ERK, everything has been taken care of down to the very last detail: from architecture to landscapes and facilities, the master planning and development of this project meets world-class standards making this tranquil abode a first-class, happy residential community that offers a pleasant day-to-day to all of its residents.\r\n\r\nIdeally located off Street 90, the artery of New Cairo, ERK is a few minutes away from the American University in Cairo and all its surrounding attractions. Conveniently close to the city’s biggest shopping and entertainment outlets all the while offering tranquillity to its residents. ERK\'s location is central, convenient and easily reachable. Only 14km away, the Ring Road connects it to all corners of the city and its main highways.', 'The best of both worlds reunites at Mountain View Executive Residence New Cairo: the intimacy of a friendly neighborhood and the convenience that comes with smartly designed and well-planned community that boast a wide range of facilities. Happiness, inspiration and tranquillity are what you will find at ERK. Where your wellbeing was kept in mind at each phase of the project from the conception to the delivery. An exclusive community flourishing amidst green spaces and winding lakes make this devel