(29, 'ماونتن فيو هايد بارك', 'MOUNTAIN VIEW HYDEPARK', 'New Cairo', 'تفتخر شركة ماونتن فيو بابلاغكم ان نسب التسليم بالمشروع قد بلغت 82% حيث تمثل هذه النسبة ما يقرب من 2600 وحدة مسلمة، و 350 وحدة حاليا في مرحلة التشطبيات، ولدينا الان 30 وحدة جاهزة للاقامة و 15 من عملائنا الكرام قد بدأوا بالفعل الاقامة في منازلهم.\r\nكما يسرنا ان نعلن عن التقدم الملحوظ في المجموعة رقم 1، فقد تم تسليم 100% من الوحدات السكنية حيث اكتملت اكثر من 90% من اعمال الطرق، و سوف يتم الانتهاء منها بالكامل في الربع الاخير من عام 2018.\r\nتخضع شبكات البنية التحيتة حاليا الى الاختبار و التشغيل. حيث يقوم فريق ادارة المرافق بوضع اللمسات الاخيرة على فحص شبكات الكهرباء، و المياه الصالحة للشرب، و الري و الصرف الصحي، للتأكد من بدء المشروع في الموعد المحدد.', 'Live inside a real park with incredible views of the well-known Hyde Park and its interconnected parks at Mountain View’s Hyde Park, where the community is designed to seamlessly intertwine nature and life, and offer a healthier alternative to the draining city life we all know too well. A very safe environment with a well-established security system, cross-over bridges and pedestrian only areas, Hyde Park provides a beautiful environment that is easy to live in, that promotes healthy living and encourages you to spend more time outdoors. Choose between a walk by the majestic lake or stroll down the many charming alleys, the outdoors have never been more attractive. Here, your peace of mind is your normal state of mind.\r\n\r\nHyde Park is well connected to all the districts of greater Cairo. At the heart of New Cairo just five minutes away from the American University in Cairo, Hyde Park is truly a short drive away from the district’s most happening attractions and everyday conveniences. Life is simple and enjoyable when you’re this well connected to everything that matters to you.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', '', NULL, 11, '2018-10-17 13:33:55', '2019-04-02 17:04:15', '31.491318200000023', '30.00741300000001', 1, 1, '', '', 0, 16, 31, NULL, NULL, NULL, NULL, NULL, 0),
(30, 'ماونتن فيو اي سيتي القاهرة الجديدة', 'MOUNTAIN VIEW ICITY NEW CAIRO', 'New Cairo', 'يتميز كمبوند ماونتن فيو اي سيتي بموقع استراتيجي بالقرب من عدد من المراكز التعليمية الهامة مثل الجامعة الأمريكية بالقاهرة وجامعة المستقبل والجامعة البريطانية بالقاهرة.\r\nويقع الكمبوند أيضاً بالقرب من مدينة الرحاب و فاميلي بارك وكمبوند ليك فيو وقطامية هيلز وسيتي جيت وهايد بارك ومجمع واتر واي.\r\nويعتبر ماونتن فيو أي سيتي من الكمبوندات الواسعة حيث يمتد على مساحة 500 فدان مقسمة إلى وحدات سكنية وحدائق ومساحات خضراء واسعة ليتمتع الأفراد بالهدوء وجميع وسائل الراحة والرفاهية. \r\nيتميز ماونتن فيو أي سيتي باحتوائه على نوعين من الحدائق هما “كلوب بارك” و “سنترال بارك” الذي بدوره يحفز الأفراد والعائلات على ممارسة الرياضة في الهواء الطلق.\r\nيحتوي كلوب بارك على مسار للركض ومقاعد للمشاهدين الرياضيين.\r\nأما “سنترال بارك” فهو يقدم مجموعة كاملة من الأنشطة الرياضية والاجتماعية ومن أمثلتها اليوجا والتأمل والتنزه في الممرات مع الأصدقاء.', 'At iCity, we have created an environment that gives you the possibility to indulge in everything you wish for, without any compromise. iCity boasts a large and diverse bundle of features, homes and facilities that ensure there is something for everyone, that your every want and that your every need is met, even more that they are exceeded. Be it outdoor spaces, lush greens, tailor-made homes, sports facilities or outings for you to explore, at iCity, we have created an ideal environment for you, your family and your friends to grow and live happily. Even more, we have created an environment that is customizable and can be personalized at your own request.\r\nIdeally located at the center of New Cairo, iCity New Cairo is set to become the pulsing heart of its district. Just 15 minutes away from the American University in Cairo and a short drive from all of the neighborhood’s schools, hospitals and entertainment venues, iCity is not only a city on its own, it is also conveniently close to many attractions. Directly connected to the ring road, it is easily accessible from any corner of the capital.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', '', NULL, 11, '2018-10-17 13:42:06', '2019-04-02 17:03:45', '31.491318200000023', '30.00741300000001', 1, 1, '', '', 0, 16, 31, NULL, NULL, NULL, NULL, NULL, 0),
(31, 'ETA PA', 'ETA PA', 'Sheikh Zayed', 'A concept driven from the belief that Nature and Cities can co-exist, ETAPA is bringing a new residential theory with an authentic vision to the real estate scene in Shekih Zayed City. A new living concept that responds to those submerged in the daily modern life and their innate craving to immerse themselves into the physical beauty and the inherent unity of the natural world. \r\nETAPA takes a leap of imagination to bring nature and city in one frame through innovative urban planning, unique architecture style, smart design choices, and the genuine community it aspires. ETAPA dares to ask how it would feel when your home becomes your daily getaway. An opportunity to live a life that is uncomplicated, detailed and TRUE', 'A concept driven from the belief that Nature and Cities can co-exist, ETAPA is bringing a new residential theory with an authentic vision to the real estate scene in Shekih Zayed City. A new living concept that responds to those submerged in the daily modern life and their innate craving to immerse themselves into the physical beauty and the inherent unity of the natural world. \r\nETAPA takes a leap of imagination to bring nature and city in one frame through innovative urban planning, unique architecture style, smart design choices, and the genuine community it aspires. ETAPA dares to ask how it would feel when your home becomes your daily getaway. An opportunity to live a life that is uncomplicated, detailed and TRUE', 'City Edge Developments is an Egyptian developer of suburban residential communities and top-quality mixed-use projects. A partnership between the New Urban Communities Authority and the Housing and Development Bank, we are set to bring forward superior quality products and best-in-class solutions that do not only cater to the modern lifestyle, but also adds value to the Egyptian market.', 'City Edge Developments is an Egyptian developer of suburban residential communities and top-quality mixed-use projects. A partnership between the New Urban Communities Authority and the Housing and Development Bank, we are set to bring forward superior quality products and best-in-class solutions that do not only cater to the modern lifestyle, but also adds value to the Egyptian market.', '', NULL, 32, '2018-10-17 13:54:58', '2019-04-02 16:39:01', '30.97483729999999', '30.0661315', 1, 1, '', '', 1, 21, 85, NULL, NULL, NULL, NULL, NULL, 0),
(32, 'MOUNTAIN VIEW DIPLOMATS', 'MOUNTAIN VIEW DIPLOMATS', 'North Coast', 'Indulge in the pleasures of the Tuscan experience at Diplomats’ Beach at Mountain View Ras El Hikma. From the charms of Italian architecture to spacious indoors designed with family life in mind, here your family is at the center and your family is celebrated, every day. A seamless blend of nature and hardscape, the Tuscan vibes of Diplomats’ Ras El Hikma promises to soothe your soul. It is a gathering of like-minded people who have travelled the world and come home to enjoy life’s simplest pleasures, our Mediterranean beachfront at the top of those. Sharing a full range of facilities with Mountain View Ras El Hikma, Diplomats’ Beach is fully serviced, operating and full of life. A happy place you can call your summer home, a place that is your own.\r\nA short drive from the hustle and bustle of Cairo, Mountain View Diplomats at Ras El Hikma is easily reachable from the Cairo-Alexandria Desert Road, the Wadi El Natroun Road and the recently inaugurated Dab’aa Road. At close proximity to Sidi Abdel Rahman, El Alamein Airport and Marsa Matrouh. This summertime heaven is surprisingly easily reachable from all that matters.', 'Indulge in the pleasures of the Tuscan experience at Diplomats’ Beach at Mountain View Ras El Hikma. From the charms of Italian architecture to spacious indoors designed with family life in mind, here your family is at the center and your family is celebrated, every day. A seamless blend of nature and hardscape, the Tuscan vibes of Diplomats’ Ras El Hikma promises to soothe your soul. It is a gathering of like-minded people who have travelled the world and come home to enjoy life’s simplest pleasures, our Mediterranean beachfront at the top of those. Sharing a full range of facilities with Mountain View Ras El Hikma, Diplomats’ Beach is fully serviced, operating and full of life. A happy place you can call your summer home, a place that is your own.\r\nA short drive from th