(33, 'MOUNTAIN VIEW SOKHNA I', 'MOUNTAIN VIEW SOKHNA I', 'Ein Sokhna', 'At Mountain View Sokhna, you are invited to indulge in this seemingly unreal tropical paradise that’s just a short drive away from Cairo’s hustle and bustle. Warm weather greets you all year long and incredible views will make it hard for you to leave. A setting reminiscent of picturesque dreams of a tropical life exists here, and it is incredibly close to you. A community of like-minded people eager to enjoy their time off. It’s the gateway of choice for people looking for a break from the city, somewhere where they can spoil themselves to some seaside luxury because that is what Mountain View Sokhna is all about. Gourmet dining options, incredible vistas and a wide array of activities for the whole family to enjoy in a safe environment making this compound a preferred destination, all year round.\r\n\r\nA daydream within reach all year round, just a little over an hour’s drive from your doorstep. On the newly renovated Sokhna Road there is a sanctuary for you to unwind and release the stresses of your everyday life. At Mountain View Sokhna, weekends are truly a break from everything else and luxury is the norm. A place that feeds your soul and spoils your family with unforgettable weekends and a seaside escapade, 12 months a year, easily reachable by car, the minute you put your mind to it.', 'At Mountain View Sokhna, you are invited to indulge in this seemingly unreal tropical paradise that’s just a short drive away from Cairo’s hustle and bustle. Warm weather greets you all year long and incredible views will make it hard for you to leave. A setting reminiscent of picturesque dreams of a tropical life exists here, and it is incredibly close to you. A community of like-minded people eager to enjoy their time off. It’s the gateway of choice for people looking for a break from the city, somewhere where they can spoil themselves to some seaside luxury because that is what Mountain View Sokhna is all about. Gourmet dining options, incredible vistas and a wide array of activities for the whole family to enjoy in a safe environment making this compound a preferred destination, all year round.\r\n\r\nA daydream within reach all year round, just a little over an hour’s drive from your doorstep. On the newly renovated Sokhna Road there is a sanctuary for you to unwind and release the stresses of your everyday life. At Mountain View Sokhna, weekends are truly a break from everything else and luxury is the norm. A place that feeds your soul and spoils your family with unforgettable weekends and a seaside escapade, 12 months a year, easily reachable by car, the minute you put your mind to it.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', '', NULL, 11, '2018-10-17 14:30:47', '2019-04-02 17:01:45', '32.633718499999986', '29.182124', 1, 1, '', '', 0, 37, 253, NULL, NULL, NULL, NULL, NULL, 0),
(34, 'MOUNTAIN VIEW SOKHNA II', 'MOUNTAIN VIEW SOKHNA II', 'Ein Sokhna', 'At Mountain View Sokhna, you are invited to indulge in this seemingly unreal tropical paradise that’s just a short drive away from Cairo’s hustle and bustle. Warm weather greets you all year long and incredible views will make it hard for you to leave. A setting reminiscent of picturesque dreams of a tropical life exists here, and it is incredibly close to you. A community of like-minded people eager to enjoy their time off. It’s the gateway of choice for people looking for a break from the city, somewhere where they can spoil themselves to some seaside luxury because that is what Mountain View Sokhna is all about. Gourmet dining options, incredible vistas and a wide array of activities for the whole family to enjoy, in a safe environment making this compound a preferred destination, all year round.\r\nA daydream within reach all year round, just a little over an hour’s drive from your doorstep: this is what we have achieved at Mountain View Sokhna I and what has pushed us to further develop Mountain View Sokhna II. Just over 100KMs from Cairo on the newly renovated Sokhna Road, there is a sanctuary for you to unwind and release the stresses of your everyday life. Just a short drive away from Mountain View Sokhna I and many of Sokhna’s attractions, this place embodies fun-filled weekends by the shore. Here, weekends are truly a break from everything else and feeling good is the norm.', 'At Mountain View Sokhna, you are invited to indulge in this seemingly unreal tropical paradise that’s just a short drive away from Cairo’s hustle and bustle. Warm weather greets you all year long and incredible views will make it hard for you to leave. A setting reminiscent of picturesque dreams of a tropical life exists here, and it is incredibly close to you. A community of like-minded people eager to enjoy their time off. It’s the gateway of choice for people looking for a break from the city, somewhere wher