(35, 'ماونتن فيو راس الحكمة الساحل الشمالي', 'MOUNTAIN VIEW RAS EL HIKMA', 'North Coast', 'Crystal blue waters and pristine white sands paired with the timeless charm of Greek architecture: The true essence of summer can be found at Mountain View Ras El Hikma. Because we value the importance of family, we have created a setting that makes each moment shared together, a memorable one. Comfortable homes, scenic architecture, everyday conveniences and a community you are proud to be part of Mountain View Ras El Hikma is all your summer dreams turned reality, an ideal setting for the perfect summer.\r\n\r\nA short drive from the hustle and bustle of Cairo, Mountain View Ras El Hikma is easily reachable from the Cairo-Alexandria Desert Road, the Wadi El Natroun Road and the recently inaugurated Fouka Road. At close proximity to Sidi Abdel Rahman, El Alamein Airport and Marsa Matrouh, this summertime heaven is surprisingly easily reachable from all that matters.', 'Crystal blue waters and pristine white sands paired with the timeless charm of Greek architecture: The true essence of summer can be found at Mountain View Ras El Hikma. Because we value the importance of family, we have created a setting that makes each moment shared together, a memorable one. Comfortable homes, scenic architecture, everyday conveniences and a community you are proud to be part of Mountain View Ras El Hikma is all your summer dreams turned reality, an ideal setting for the perfect summer.\r\n\r\nA short drive from the hustle and bustle of Cairo, Mountain View Ras El Hikma is easily reachable from the Cairo-Alexandria Desert Road, the Wadi El Natroun Road and the recently inaugurated Fouka Road. At close proximity to Sidi Abdel Rahman, El Alamein Airport and Marsa Matrouh, this summertime heaven is surprisingly easily reachable from all that matters.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', 'DMG is a vertically integrated group covering the overall horizon of the real estate development with the approach of “design and build”. We own the process from the concept development phase till the after-sales services and facilities management.\r\n In 1989 we started as an architectural office with ten engineers managed by Eng. Amr Soliman, the founder of the group. They served different clients and their goal was to integrate the eastern and western style in the designs; here was the start of Dar AlMimar Architecture (DMA), our main design office. \r\n In 1993 Dar AlMimar Construction (DMC) was established to ensure the integrity of our designs since we thought that the best way to show off our designs is to build them ourselves.', '', NULL, 11, '2018-10-17 14:55:26', '2019-04-02 17:00:43', '28.028368099999966', '31.08217099999999', 1, 1, '', '', 0, 25, 401, NULL, NULL, NULL, NULL, NULL, 0),
(36, 'Zahya', 'Zahya', 'New Mansoura', 'As the pioneering real estate company building a residential compound in New Mansoura City, we are excited to see the future come to life with a residential project bound to flourish amidst the bustling new capital of the Delta. With a promise of a new future equipped with technological advancements, trade, commercial and retail opportunities, Zahya will only provide more clarity for the vision of this new city by housing its residents in homes that provide complete living experiences.', 'As the pioneering real estate company building a residential compound in New Mansoura City, we are excited to see the future come to life with a residential project bound to flourish amidst the bustling new capital of the Delta. With a promise of a new future equipped with technological advancements, trade, commercial and retail opportunities, Zahya will only provide more clarity for the vision of this new city by housing its residents in homes that provide complete living experiences.', 'City Edge Developments is an Egyptian developer of suburban residential communities and top-quality mixed-use projects. A partnership between the New Urban Communities Authority and the Housing and Development Bank, we are set to bring forward superior quality products and best-in-class solutions that do not only cater to the modern lifestyle, but also adds value to the Egyptian market.', 'City Edge Developments is an Egyptian developer of suburban residential communities and top-quality mixed-use projects. A partnership between the New Urban Communities Authority and the Housing and Development Bank, we are set to bring forward superior quality products and best-in-class solutions that do not only cater to the modern lifestyle, but also adds value to the Egyptian market.', '', 'uploads/projects/NkJjBeiwOmWzdP8qU5CYfSquORo431Jl2rSIaQuo.mp4', 32, '2018-10-17 15:02:07', '2019-04-02 16:37:50', '31.44739770000001', '31.4697372', 1, 1, '', '', 1, 17, 242, NULL, N