(37, 'جراند سيتي - المعادي', 'Grand City - Maadi', 'Maadi', 'تم تصميم معادي جراند سيتي بغرض بناء مدينة تقدم الرفاهية لسكانها، فهي تضم 30 برج يعبر كل منهم عن ذوق فريد يحمل الكثير من الفخامة، كما تضم نادي رياضي بمساحة ثلاثة فدادين ليستطيع ساكني معادي جراند سيتي الاستمتاع بملاعب كرة القدم و التنس، فيما لا تغفل المدينة عن اماكن التسوق لذلك فهي تقدم مفهوم جديد للمجمع السكني الذي يوفر لك كامل احتياجاتك بالكامل على بعد امتار من منزلك.', 'Maadi Grand City has been designed to make multi-complex living an enjoyable\r\nexperience for both residents and visitors. Every element of the simple and strong\r\ndesjgn of the residential complex exudes splendor, whether lt1at be the beaut~ulty\r\nconstructed exterior or the inviting interior living space, Maadi Grand City Sporting\r\nClub oHers the residents the opportunity to enjoy a variety of indoor and outdoor\r\nsporting actMties, including football, tennis', 'تقدم مشروعات \"معمار المرشدي\" مفهومًا جديدًا للمعيشة يوفر مشاريع تنموية متكاملة تجمع بين المباني السكنية والإدارية والتجارية في مكان واحد لمساعدة عملائنا على الاستمتاع بحياة أكثر راحة.\r\n\r\nتتأهب شركة \"معمار المرشدي\" للنجاحات التي حققتها من خلال مجموعة واسعة من المشاريع العقارية التي تتراوح بين المساكن الإقتصادية والإسكان من الطبقة المتوسطة وحتى المساكن الفخمة في جميع أنحاء القاهرة والجيزة.', 'Memaar Al Morshedy introduces a new concept of living which provides fully integrated development projects that combine residential, administrative and commercial buildings in one place to help our customers enjoy a more convenient life.\r\n\r\nMemaar Al Morshedy comes to crown its successes with a wide variety of real estate projects that ranges from economy housing, middle class housing and up to premium housing all over Cairo and Giza', '', NULL, 33, '2018-10-17 16:21:37', '2019-04-02 16:33:38', '31.326893299999938', '29.9808548', 1, 0, '', '', 0, 16, 38, NULL, NULL, NULL, NULL, NULL, 0),
(38, 'جراند‭ ‬جيت', 'Grand Gate', 'Ring Road', 'جراند جيت هو مشروع متعدد الأغراض صمم بأحدث تقنيات فن الهندسة المعمارية و بأساليب الإستخدام الأمثل للمساحات من أجل خلق بيئة جميلة و مريحة للمعيشة أو العمل على مساحة حوالى 12,800 م٢.\r\n\r\nتقوم فكرة التصميم الأساسية على الترابط بين البرجين الأساسيين للمشروع و يحتوى كل منهما على  11 طابق و واجهات زجاجية تطل مباشرةً على الطريق الدائري و أمام نادى الصيد بالقطامية و يحتوى كل برج من البرجين على شقق سكنية و محلات تجارية، و تحتل المحلات التجارية الطابقين الأرضي و الميزانين فى كل برج .', 'Grand Gate is a mixed-use complex that was designed with modem\r\narchitectural and space management techniques to create a beautiful\r\nand comfortable Ming and work environment. The design concept\r\nconnects the towers. which consist of 11 glass fronted levels.\r\nEach tower offers both residential and commercial spaces. The\r\ncommercial areas stretch over 10,626 square meters occupying the\r\nground and mezzanine floor.', 'تقدم مشروعات \"معمار المرشدي\" مفهومًا جديدًا للمعيشة يوفر مشاريع تنموية متكاملة تجمع بين المباني السكنية والإدارية والتجارية في مكان واحد لمساعدة عملائنا على الاستمتاع بحياة أكثر راحة.\r\n \r\n تتأهب شركة \"معمار المرشدي\" للنجاحات التي حققتها من خلال مجموعة واسعة من المشاريع العقارية التي تتراوح بين المساكن الإقتصادية والإسكان من الطبقة المتوسطة وحتى المساكن الفخمة في جميع أنحاء القاهرة والجيزة.', 'Memaar Al Morshedy introduces a new concept of living which provides fully integrated development projects that combine residential, administrative and commercial buildings in one place to help our customers enjoy a more convenient life.\r\n \r\n Memaar Al Morshedy comes to crown its successes with a wide variety of real estate projects that ranges from economy housing, middle class housing and up to premium housing all over Cairo and Giza', '', NULL, 33, '2018-10-17 16:41:15', '2019-04-02 16:25:12', '31.327899000000002', '29.98189399999999', 1, 1, '', '', 0, 16, 6, NULL, NULL, NULL, NULL, NULL, 0),
(39, 'سكاى لاين', 'Skyline', 'Katamya', 'سكاى لاين هو تحفة معمار المرشدى الجديدة من تصميم  المعمارى المصرى رائف فهمى و ستوديو  VDP بأسبانيا و المعمارى العالمى محمد حديد و من المخطط ان يكون هو أكبر مبنى سكنى فى العالم على مساحة اجمالية  200  الف متر مربع تقريباً فى موقع عبقرى فى قلب القطامية بالقرب من الطريق الدائرى و طريق القطامية-العين السخنة. تتكامل في سكاى لاين كل ما تحتاجه الأسرة خلال اليوم من الوحدات السكنية الراقية، الخدمات الاساسية و الاختيارات الترفيهية المتنوعة.و يعد سكاى لاين بحق هو انتاج لدراسة دقيقة لأسلوب الحياة الذى يتمناه الجميع، حيث تتكامل في نفس المبنى كل ما تحتاجه الأسرة خلال اليوم بدءا من الوحدات السكنية الراقية مرورا بالخدمات الاساسية و الاختيارات الترفيهية المتنوعة. و يتميز سكاى لاين بتقديم مجموعة متنوعة من مساحات الوحدات  التي تتراوح بين الاستديوهات الصغيرة و شقق غرفة واحدة أو غرفتين أو ثلاثة غرف بمساحات تبدأ من59  الى132 متر مربع و التى تطل كلها على علامة مميزة فى سكاى لاين مثل: المساحات الخضراء المفتوحة او المسطحات المائية .\r\n\r\nالموقع:\r\n\r\nيقع مشروع سكاى لاين فى اهم المناطق الواعدة فى القطامية، فمكانه المتميز على الطريق الدائرى الأوسطى بالقرب من الطريق الدائرى و طريق القطاميه - العين السخنه, بما يجعلك على بعد دقائق من مناطق: القاهرة الجديدة ، زهراء المعادى، مدينة نصر و المقطم. و يظهر تميز الموقع فى سهولة الوصول اليه من مختلف الطرق الرئيسية وكذلك سهولة الوصول  منه الى العاصمة الادارية فى خلال 30 دقيقة تقريبا عبر طريق القطامية - العين السخنه . و يعتبر سكاى لاين هو ثالث مشروعات شركة معمار المرشدى فى القطامية بعد وان قطامية و قطامية جيت .', 'Every massive metropolis needs the balance and contrast of a vibrant park space. Once again, Skyline surprises and captivates your senses with a sprawling park that rivals even Manhattan\'s Central Park. This immense greenspace is truly one of a kind and spans the ENTIRE rooftop of the complex offering an amazing vantage point to view your city from the sky. Enjoy the diverse cycling trails, rollerblade, jog or stroll along the many paths woven throughout this gorgeous park. The crown jewel of the rooftop: The world\'s largest infinity pool. Truly embracing where the water meets the sky, relax poolside with your friends and family and take in the spectacular view as the water appears to cascade endlessly into the heart of Skyline.\r\n\r\nYour lifestyle demands Sophistication and Style with Ease, so immerse yourself in Skyline’s vast and record breaking 200,000 square meter landscape of shops, entertainment and luxury living. Nothing is beyond your reach in this one of a kind complex that puts everything at your fingertips and literally outside your front door. It truly is YOUR CITY for the taking. Own it.', 'تقدم مشروعات \"معمار المرشدي\" مفهومًا جديدًا للمعيشة يوفر مشاريع تنموية متكاملة تجمع بين المباني السكنية والإدارية والتجارية في مكان واحد لمساعدة عملائنا على الاستمتاع بحياة أكثر راحة.\r\n \r\n تتأهب شركة \"معمار المرشدي\" للنجاحات التي حققتها من خلال مجموعة واسعة من المشاريع العقارية التي تتراوح بين المساكن الإقتصادية والإسكان من الطبقة المتوسطة وحتى المساكن الفخمة في جميع أنحاء القاهرة والجيزة.', 'Memaar Al Morshedy introduces a new concept of living which provides fully integrated development projects that combine residential, administrative and commercial buildings in one place to help our customers enjoy a more convenient life.\r\n \r\n Memaar Al Morshedy comes to crown its successes with a wide variety of real estate projects that ranges from economy housing, middle class housing and up to premium housing all over Cairo and Giza', '', NULL, 33, '2018-10-17 17:28:47', '2019-04-02 16:24:26', '31.349404800000002', '29.96643320000001', 1, 1, '', '', 0, 16, 34, NULL, NULL, NULL, NULL, NULL, 0),
(40, 'قطامية جيت', 'Kattameya Gate', 'Kattameya', '“قطامية جيت” هو من أحدث مشروعات شركة معمار المرشدى فى اضافة جديدة لمعطيات سوق العقارات فى مصر، والذى تنفذه الشركة على مساحة اجمالية تبلغ حوالى ٤٣,٧٠٠ متر مربع تقريبا ، و يتوفر فى مشروع “قطامية جيت” مفهوم التكامل فى عناصر البناء و التشييد فهو مشروع سكنى تجارى يقع فى  موقع مميز بحى القطامية الراقى صممته أمهر بيوت التصميم الاوروبية VDP على أحدث صيحات التصميم العالمية ليحتوى المشروع على عدد ٢ دور جراچ و دور ارضى تجارى و ١١ دور متكرر  بإجمالى ٣,٠٨٨ وحدة سكنية بمساحات مختلفة تبدأ من ستوديو ٤٧ م\r\n#المساحات : - 43 م حتى 156 م\r\n# الاستلام : بعد - 3 سنوات ونصف وتسهيلات فى السداد حتى 7 سنوات\r\n#نظام الدفع :-\r\n15 % مقدم على 4 شهور ) 5% تعاقد - 10 % دفعه بعد اربع شهور(\r\n65 % أقساط ربع سنوية أو شهرية وسنوية وتسهيلات فى السداد حتى 7 سنوات\r\n20 % دفعة أستلام بعد 3 سنوات ونصف\r\n+صيانة 7 % +جراج )إختيارى(تر مربع حتى شقق ١٥٦ متر مربع.', 'Kattameya gate is one of the newest projects of Memaar AlMorshedy in a new addition to the attributes of the architecture market in Egypt, at which the company is constructing it over an area of 43,700 m2, Kattameya Gate provides the concept of perfectness in the elements of building and construction as it is a residential and commercial complex which is located in a unique location in Kattameya and was designed by one of the most talented designer VDP with the latest international design trends to make the complex provide 2 floors as a parking, a commercial ground floor, and 11 repeated floors with a total of 3,088 residential units that varies from 47 m2 up to 156 m2.', 'تقدم مشروعات \"معمار المرشدي\" مفهومًا جديدًا للمعيشة يوفر مشاريع تنموية متكاملة تجمع بين المباني السكنية والإدارية والتجارية في مكان واحد لمساعدة عملائنا على الاستمتاع بحياة أكثر راحة.\r\n \r\n تتأهب شركة \"معمار المرشدي\" للنجاحات التي حققتها من خلال مجموعة واسعة من المشاريع العقارية التي تتراوح بين المساكن الإقتصادية والإسكان من الطبقة المتوسطة وحتى المساكن الفخمة في جميع أنحاء القاهرة والجيزة.', 'Memaar Al Morshedy introduces a new concept of living which provides fully integrated development projects that combine residential, administrative and commercial buildings in one place to help our customers enjoy a more convenient life.\r\n \r\n Memaar Al Morshedy comes to crown its successes with a wide variety of real estate projects that ranges from economy housing, middle class housing and up to premium housing all over Cairo and Giza', '', NULL, 33, '2018-10-17 18:10:24', '2019-04-02 16:23:54', '31.35875699999997', '29.9764249', 1, 1, '', '', 0, 16, 34, NULL, NULL, NULL, NULL, NULL, 0),
(41, 'أب تاون كايرو', 'UPTOWN CAIRO', 'Mokattam City', 'In the heart of Cairo - yet away from its hustle and bustle - Uptown Cairo stands as the first and only integrated development in the centre of the capital with easy accessibility from Maadi, Heliopolis, Nasr City and West Cairo. Bringing the best of both worlds, Uptown Cairo combines suburban tranquillity with city centre convenience, thanks to Emaar Drive that connects it to almost every district in the capital. Uptown Cairo is ideally situated 200m atop Cairo beyond pollution and congestion, spoiling each home with spectacular city views. Representing the size of Zamalek, the upscale development is built on 1,000 acres that blend in the natural mountainous settings with landscaped foliage and outstanding architecture.\r\n\r\nThis self-contained and self-sufficient development offers everything you need from world-class golfing facilities to trendy cafes and eateries, prestigious shopping districts and state-of-the-art recreation and entertainment. Housing units are designed with the highest international standards, ranging from Mediterranean and Spanish motifs to Italian and Arabian ones. Unsurpassed contracting companies have aided in the construction of commercial and office units to create a holistic city within Uptown Cairo. Within the walls of Uptown Cairo, low- and high-rise houses elegantly line the hills and valleys, creating an equilibrium of architecture as far as the eye can see. By enclosing all amenities and services that cater to homeowners’ needs, this tranquil archipelago isolates itself from the city, drowning out the crowded streets and busy vibes of downtown Cairo. Click here to down', 'In the heart of Cairo - yet away from its hustle and bustle - Uptown Cairo stands as the first and only integrated development in the centre of the capital with easy accessibility from Maadi, Heliopolis, Nasr City and West Cairo. Bringing the best of both worlds, Uptown Cairo combines suburban tranquillity 