(42, 'وان قطامية', 'One Kattameya', 'Nasr City', 'وان قطامية هو من أهم مشاريع معمار المرشدى و هو عبارة عن مجمع متعدد الأغراض و يتكون من ٨ مبانى إدارية و تجارية و ٣٠ مبنى سكنى يوفرون  ٣,٦٧٠  وحدة سكنية.\r\n\r\n \r\n\r\nيوفر موقع وان قطامية سهولة الوصول إلى جميع المناطق الرئيسية في القاهرة الكبرى، و يحيط به العديد من الأماكن الحيوية مثل النوادى الرياضية الكبرى و مراكز التسوق. وان قطامية هو مجتمع سكنى وادارى راقى يتمتع بواجهات شفافة تسمح لكل مساحة بإحتضان الضوء الطبيعى.', 'One Kattameya is one of the most important projects at Memaar Al Morshedy and it is a multifunction complex as it contains 8 commercial and administrative buildings along with 30 residential buildings which provide 3,670 residential unit.\r\n\r\nOne Kattameya is centrally located in the upscale district of Kattameya. Its location provides the highest level of accessibility to all major districts in greater Cairo, surrounded with many local attractions such as major sporting clubs and shopping malls.\r\n\r\nOne Kattameya\'s location also offers a direct route to Maadi, Nasr City, Ain-Sokhna desert road, 6th of October city & Cairo International Airport.', 'تقدم مشروعات \"معمار المرشدي\" مفهومًا جديدًا للمعيشة يوفر مشاريع تنموية متكاملة تجمع بين المباني السكنية والإدارية والتجارية في مكان واحد لمساعدة عملائنا على الاستمتاع بحياة أكثر راحة.\r\n \r\n تتأهب شركة \"معمار المرشدي\" للنجاحات التي حققتها من خلال مجموعة واسعة من المشاريع العقارية التي تتراوح بين المساكن الإقتصادية والإسكان من الطبقة المتوسطة وحتى المساكن الفخمة في جميع أنحاء القاهرة والجيزة.', 'Memaar Al Morshedy introduces a new concept of living which provides fully integrated development projects that combine residential, administrative and commercial buildings in one place to help our customers enjoy a more convenient life.\r\n \r\n Memaar Al Morshedy comes to crown its successes with a wide variety of real estate projects that ranges from economy housing, middle class housing and up to premium housing all over Cairo and Giza', '', NULL, 33, '2018-10-17 18:24:17', '2019-04-02 16:22:00', '31.356706499999973', '29.9801136', 1, 1, '', '', 0, 16, 68, NULL, NULL, NULL, NULL, NULL, 0),
(43, 'لايك فرونت', 'Lakefront', '6th Of October', 'لايك فرونت هو من أحدث مشروعات شركة معمار المرشدى التى تقدمها إلى سوق العقارات المصرى، و التى تتكامل فيها عناصر البناء، بداية من اختيار موقع عبقرى فى منطقة مميزة من مدينة السادس من أكتوبر، مرورا بالتصميم الحديث من أحد أمهر بيوت التصميم الأوروبية الذى يحقق توازن مثالىت بين المبانى السكنية و الخدمية التى تشكل نسبة ٢٦٪ و بين المساحات الخضراء والبحيرات و المسطحات المائية و الطرق و ممرات التنزه التى تشكل نسبة ٧٤٪ على مساحة  إجمالية تبلـغ ٣٧ فدان تقريبا تتناغم فـيه مكونــات الحيـاة المثالية، و صولا إلى التخطيط العـام لمبانى سكنية كل منها يتكون من بدروم جراج و دور أرضى و ٥ أدوار باجمالى ١,٣٠٢ وحدة سكنية تتنـوع بين الشقـق و الدوبلـكس بمسـاحات مختلـفة تبـدأ من  ١٠٩ متر مربع الى ٣٤٤ متر مربع.\r\nالاستلام : بعد 3 سنوات و نصف\r\nنظام السداد:- 10 % تعاقد\r\n5% دفعة بعد 4 شهور\r\n5% دفعة بعد 8 شهور\r\n 60 % اقساط حتى 3 سنوات بدون فوائد وتسهيلات فى السداد حتى 6 سنوات\r\n20% استلام + 7 صيانة', 'Lakefront is one of the latest projects from Memaar el Morshedy presented to the Egyptian real estate market. Starting from the special designs along with the exceptional location at Sixth of October city, the special designs quoted from one of the best European architectural designers that make a balance between the residential buildings and the commercial which is 26%, and the perfect landscape, lakes, roads, which covers 74% on a total of 37 FD.\r\n\r\nAnd finally the special buildings structures that consists of a GF and 5 floors with a total of 1,203 residential units that varies between flats and duplexes with various areas starting from 109 m2 up to 344 m2.', 'تقدم مشروعات \"معمار المرشدي\" مفهومًا جديدًا للمعيشة يوفر مشاريع تنموية متكاملة تجمع بين المباني السكنية والإدارية والتجارية في مكان واحد لمساعدة عملائنا على الاستمتاع بحياة أكثر راحة.\r\n \r\n تتأهب شركة \"معمار المرشدي\" للنجاحات التي حققتها من خلال مجموعة واسعة من المشاريع العقارية التي تتراوح بين المساكن الإقتصادية والإسكان من الطبقة المتوسطة وحتى المساكن الفخمة في جميع أنحاء القاهرة والجيزة.', 'Memaar Al Morshedy introduces a new concept of living which provides fully integrated development projects that combine residential, administrative and commercial buildings in one place to help our customers enjoy a more convenient life.\r\n \r\n Memaar Al Morshedy comes to crown its successes with a wide variety of real estate projects that ranges from economy housing, middle class housing and up to premium housing all over Cairo and Giza', '', NULL, 33, '2018-10-17 18:42:22', '2019-04-02 16:21:16', '31.078857800000037', '29.9444177', 1, 1, '', '', 0, 21, 74, NULL, NULL, NULL, NULL, NULL, 0),
(44, 'دجلة بالمز', 'Degla Palms', '6th Of October', 'على طريق أكتوبر الواحات بعد دريم لاند ودريم بارك ومول مصر\r\nبحوالى 15 دقيقة\r\nمبنى على مساحة 325 فدان ويتكون من 272,34 وحدة سكنية.حيث المناظر\r\nالطبيعية،\r\nوشبكات الطرق والساحات العامة ، والمساحات المفتوحة. بالإضافة إلى المساحات الخضراء\r\nالواسعة التي تحتل 82 ٪ من المساحة لقضاء وقت الفراغ والاستخدامات', 'Degla Palms compound, recently added by Memaar Al Morshedy, delivers such an experience for you. Located in 6th of October City, the compound combines landscapes with great architectural designs, plazas and open spaces in wide roads and natural sights.\r\nThe compound is well-situated in 6th of October city, a few minutes away from Dream Land, MSA University and Media Production city.\r\nThe compound lies 20 minutes away from Downtown and is easily accessible through the Ring Road and 26th of July axis.', 'تقدم مشروعات \"معمار المرشدي\" مفهومًا جديدًا للمعيشة يوفر مشاريع تنموية متكاملة تجمع بين المباني السكنية والإدارية والتجارية في مكان واحد لمساعدة عملائنا على الاستمتاع بحياة أكثر راحة.\r\n \r\n تتأهب شركة \"معمار المرشدي\" للنجاحات التي حققتها من خلال مجموعة واسعة من المشاريع العقارية التي تتراوح بين المساكن الإقتصادية والإسكان من الطبقة المتوسطة وحتى المساكن الفخمة في جميع أنحاء القاهرة والجيزة.', 'Memaar Al Morshedy introduces a new concept of living which provides fully integrated development projects that combine residential, administrative and commercial buildings in one place to help our customers enjoy a more convenient life.\r\n \r\n Memaar Al Morshedy comes to crown its successes with a wide variety of real estate projects that ranges from economy housing, middle class housing and up to premium housing all over Cairo and Giza', '', NULL, 33, '2018-10-17 19:12:00', '2019-04-02 16:20:38', '30.91591310000001', '29.8849496', 1, 1, '', '', 0, 21, 74, NULL, NULL, NULL, NULL, NULL, 0),
(45, 'North Edge Towers', 'North Edge Towers', 'New Alamein', 'North Edge Towers are the pioneering pillars of the New Alamein waterfront with a mission to begin a new era of all-year round living. \r\n\r\nAs the first and only towers in the area, they stand as landmarks of luxurious, self-sufficent homes that don\'t close their doors after any season, evolving our perception of the North Coast experience. \r\n\r\nFirst row turquoise views & a philosophy of convenience through sky high sea side living, North Edge is nothing short of incomparable.', 'North Edge Towers are the pioneering pillars of the New Alamein waterfront with a mission to begin a new era of all-year round living. \r\n\r\nAs the first and only towers in the area, they stand as landmarks of luxurious, self-sufficent homes that don\'t close their doors after any season, evolving our perception of the North Coast experience. \r\n\r\nFirst row turquoise views & a philosophy of convenience through sky high sea side living, North Edge is nothing short of incomparable.', 'City Edge Developments is an Egyptian developer of suburban residential communities and top-quality mixed-use projects. A partnership between the New Urban Communities Authority and the Housing and Development Bank, we are set to bring forward superior quality products and best-in-class solutions that do not only cater to the modern lifestyle, but also adds value to the Egyptian market.', 'City Edge Developments is an Egyptian developer of suburban residential communities and top-quality mixed-use projects. A partnership between the New Urban Communities Authority and the Housing and Development Bank, we are set to bring forward superior quality products and best-in-class solutions that do not only cater to the modern lifestyle, but also adds value to the Egyptian market.', '', NULL, 32, '2018-10-17 19:43:21', '2019-04-02 16:36:55', '28.93756110000004', '30.8566119', 1, 1, '', '', 1, 25, 404, NULL, NULL, NULL, NULL, NULL, 0),
(46, 'جرين سكوير -  القاهرة الجديدة', 'GREEN SQUARE COMPOUND - New Cairo', 'Mostakbal City', 'يقع الكمباوند في مدينة المستقبل بجوار كمباوند لافينير ، وعلي بعد 15 دقيقة من الجامعه الامريكية ، ويعد كمباوند Green Square New Cairo هو أمتداد لمجموعة من المشروعات التابعة لشركة الأهلى للتنمية العقارية والتى تأسست عام 1994 كشركة مساهمة مصرية ، وهى من أوائل الشركات الهندسية  الأستثمارية ، مملوكة لعائلة صبور بنسبة 60 % ويمتلك البنك الأهلى حصة قدرها 40 % وهو يعتبر أكبر بنك فى الشرق الأوسط  \r\nصمم كمباوند جرين سكوير القاهرة الجديدة على مساحة 100 فدان مقسمة إلى  وحدات (دوبليكس – وتاون هاوس) مصممة على شكل كلاسيكى ، يتميز المشروع بجود مساحات خضراء واسعة مما يتيح جو هادئ ونظيف بعيدا عن الزحام والأستمتاع بمعني حقيقي للهدوء والرفاهية ، بالأضافة إلى منطقة خدمات متكاملة توفر جميع إحتياجات السكان، مول تجارى، حراسة 24 ساعة، كلوب هاوس، ملاعب رياضية، حمامات سباحة، مساحات خضراء، وغيرها من الخدمات.\r\nالمساحات :\r\nمساخات تبدأ من 135 متر الى 256 متر\r\n\r\nالأسعار وأنظمة السداد  :\r\n10 % مقدم ، وتقسيط على 6.5 سنوات\r\n\r\nالأستلام :\r\nأستلام 3 سنوات', 'The residential compound is located at Future City zone in New Cairo over the area of 80 feddan.\r\nThe Future City is an innovation urban construction project encompassing of Green buildings compounds with sustainable development principles.\r\n\r\nThe main components of compounds are:\r\nTown houses\r\nVillas duplex\r\nResidential buildings (G+5)\r\nServices buildings Site infrastructure networks\r\nLandscape\r\nThe buildings are designed to meet LEED specifications\r\ngreen buildings\r\nA special green corridor is designed to assure rainwater and site drainage.', 'Sabbour Consulting is one of the establishments founded by the Cons. Eng. Hussein Sabbour. The Consultancy work of Mr. Sabbour started 1957. He has been working in several activities of business during the last 50 years.Mr. Sabbour has individually as well as with others established a lot of groups, offices, companies and establishment. HSCB is the summary of all this experiences. All these establishments have had a vital and basic role in The development of engineering as well as governmental or private consultancy services in all fields and branches of engineering in Egypt and some Arab countries .', 'Sabbour Consulting is one of the establishments founded by the Cons. Eng. Hussein Sabbour. The Consultancy work of Mr. Sabbour started 1957. He has been working in several activities of business during the last 50 years.Mr. Sabbour has individually as well as with others established a lot of groups, offices, companies and establishment. HSCB is the summary of all this experiences. All these establishments have had a vital and basic role in The development of engineering as well as governmental or private consultancy services in all fields and branches of engineering in Egypt and some Arab countries .', '', NULL, 41, '2018-10-18 13:17:20', '2019-04-02 16:16:08', '31.491318200000023', '30.00741300000001', 1, 1, '', '', 1, 16, 66, NULL, NULL, NULL, NULL, NULL, 0),
(47, 'كمبوند لافينير - القاهرة الجديدة', 'L\'Avenir - New Cairo', 'Mostakbal City', 'L’avenir  كلمة فرنسية تعنى المستقبل\r\nوقد تم اختيار هذا الاسم تحديداً لوقوع الكمبوند فى مدينة المستقبل التى تعد التطور العمرانى الطبعيى فى القاهرة للجديدة فهى الحل الأمثل لضمان قضاء مستقبل أفضل و ارقى \r\nكما يتميز كمبوند لافنير بموقع جغرافى فريد حيث يقع بأكثر بقاع القاهرة الجديدة تميزاً و حيوية فهو يبعد 5 دقائق فقط من الهايد بارك و مدينتي كما أنه يقع وسط مجموعة كبيرة من المشاريع الضخمه\r\nصمم المشروع على الطراز الفرنسى الذى يضيف اجواء من الرقى و الفخامة على الكمبوند\r\nمما يضمن لك حياة راقية تضيف عليك و على اسرتك مزيد من السعادة و المتعة\r\nيقام كمبون لافنير علي مساحة 99 فدان\r\nفهو يمثل مفهوماً جديدا على مستوى المشاريع السكنية في مصر من حيث يتم تقديم وحدات سكنية مقسمة داخلياً بشكل عملى يمنحك راحة اكثر  ، في الوقت ذاته تشطب جميع الوحدات وفق معايير الجودة العالمية فهذا المشروع يضم وحدات سكنية ومساحات تجارية ومرافق متنوعة تجعله الاختيار الأنسب و النموذجى للسكن والعمل\r\nمتاح بالمشروع العديد من انواع الشقق بمساحات من 120 متر تصل الى 230 متر و \r\nالدوبلكسات بمساحات من 245 مترالى 265 متر\r\nيشتمل الكمبوند على العديد من الخدمات التى توفر حياة اسهل و امتع\r\nالاستلام : 12/2020', 'L’Avenir Compound in El Mostkbal City nearby New Cairo is Developed by Sabbour Egypt, The Compound is Ideally located. L’Avenir means the future, as buying in this compound is buying the future with the best available prices\r\nThe Compound french exterior designs are marvelous and unique, moreover, all units are overlooking wide views of greenery or main streets .Sabbour is one of the best developers working in Egypt, and lately expanded company’s scope to include Dubai.\r\nTypes : Town House – Duplex – Apartments\r\n Delivery : 12/2020\r\n Maintenance : 10% to be paid on installments till the delivery.\r\n Payment Plan : 10% Down Payment & the rest over 6.5 years.', 'Sabbour Consulting is one of the establishments founded by the Cons. Eng. Hussein Sabbour. The Consultancy work of Mr. Sabbour started 1957. He has been working in several activities of business during the last 50 years.Mr. Sabbour has individually as well as with others established a lot of groups, offices, companies and establishment. HSCB is the summary of all this experiences. All these establishments have had a vital and basic role in The development of engineering as well as governmental or private consultancy services in all fields and branches of engineering in Egypt and some Arab countries .', 'Sabbour Consulting is one of the establishments founded by the Cons. Eng. Hussein Sabbour. The Consultancy work of Mr. Sabbour started 1957. He has been working in several activities of business during the last 50 years.Mr. Sabbour has individually as well as with others established a lot of groups, offices, companies and establishment. HSCB is the summary of all this experiences. All these establishments have had a vital and basic role in The development of engineering as well as governmental or private consultancy services in all fields and branches of engineering in Egypt and some Arab countries .', '', NULL, 41, '2018-10-18 13:37:12', '2019-04-02 16:15:24', '31.618824000000018', '30.054833', 1, 1, '', '', 1, 16, 66, NULL, NULL, NULL, NULL, NULL, 0),
(48, 'Odyssia Alaire Park', 'Odyssia Alaire Park', 'El Mostakbal City', 'The City of Odyssia is opening its first chapter, Alaire, the soul of the city, taking advantage of the amenities and the cultural offerings provided by the Design Hub area of the core CBD. By definition, our first chapter – Alaire is cheerful and exquisite, making it the right place to live, work and have a good time.', 'The City of Odyssia is opening its first chapter, Alaire, the soul of the city, taking advantage of the amenities and the cultural offerings provided by the Design Hub area of the core CBD. By definition, our first chapter – Alaire is cheerful and exquisite, making it the right place to live, work and have a good time.', 'Sabbour Consulting is one of the establishments founded by the Cons. Eng. Hussein Sabbour. The Consultancy work of Mr. Sabbour started 1957. He has been working in several activities of business during the last 50 years.Mr. Sabbour has individually as well as with others established a lot of groups, offices, companies and establishment. HSCB is the summary of all this experiences. All these establishments have had a vital and basic role in The development of engineering as well as governmental or private consultancy services in all fields and branches of engineering in Egypt and some Arab countries .', 'Sabbour Consulting is one of the establishments founded by the Cons. Eng. Hussein Sabbour. The Consultancy work of Mr. Sabbour started 1957. He has been working in several activities of business during the last 50 years.Mr. Sabbour has individually as well as with others established a lot of groups, offices, companies and establishment. HSCB is the summary of all this experiences. All these establishments have had a vital and basic role in The development of engineering as well as governmental or private consultancy services in all fields and branches of engineering in Egypt and some Arab countries .', '', NULL, 41, '2018-10-18 14:19:42', '2019-04-02 16:13:59'