(49, 'كمبوند ذا سكوير – القاهرة الجديدة', 'The Square Compound - New Cairo', 'New Cairo', 'Inspired by being positioned in a central and trendy hot spot, the square was created to become a focal gathering point in new Cairo, in addition to the greenery area where you can enjoy the fresh air and the outdoor spaces\r\nAt the square you will find all of the facilities that make you live in a world of luxury, comfort and convenience; so it’s the perfect place to call home\r\nThe Square is built over an area of over 100 acres; including retail and commercial purposes, ensuring its status as the new modern hub in New Cairo… In addition to rich green parks to appreciate the outdoors in, smart designs and layouts of the duplexes and apartments of the project, as well as facilities and services that cater to the residents who lead professional hectic lives.', 'Inspired by being positioned in a central and trendy hot spot, the square was created to become a focal gathering point in new Cairo, in addition to the greenery area where you can enjoy the fresh air and the outdoor spaces\r\nAt the square you will find all of the facilities that make you live in a world of luxury, comfort and convenience; so it’s the perfect place to call home\r\nThe Square is built over an area of over 100 acres; including retail and commercial purposes, ensuring its status as the new modern hub in New Cairo… In addition to rich green parks to appreciate the outdoors in, smart designs and layouts of the duplexes and apartments of the project, as well as facilities and services that cater to the residents who lead professional hectic lives.', 'Sabbour Consulting is one of the establishments founded by the Cons. Eng. Hussein Sabbour. The Consultancy work of Mr. Sabbour started 1957. He has been working in several activities of business during the last 50 years.Mr. Sabbour has individually as well as with others established a lot of groups, offices, companies and establishment. HSCB is the summary of all this experiences. All these establishments have had a vital and basic role in The development of engineering as well as governmental or private consultancy services in all fields and branches of engineering in Egypt and some Arab countries .', 'Sabbour Consulting is one of the establishments founded by the Cons. Eng. Hussein Sabbour. The Consultancy work of Mr. Sabbour started 1957. He has been working in several activities of business during the last 50 years.Mr. Sabbour has individually as well as with others established a lot of groups, offices, companies and establishment. HSCB is the summary of all this experiences. All these establishments have had a vital and basic role in The development of engineering as well as governmental or private consultancy services in all fields and branches of engineering in Egypt and some Arab countries .', '', NULL, 41, '2018-10-18 14:51:47', '2019-04-02 16:13:24', '31.551824399999987', '29.9977783', 1, 1, '', '', 1, 16, 31, NULL, NULL, NULL, NULL, NULL, 0),
(50, 'أمواج -  الساحل الشمالى', 'Amwaj - North Coast', 'North Coast', 'تقع فى الكيلو 135 طريق اسكندرية / مطروح بمنطقة سيدى عبد الرحمن ، ويعد منتجع Amwaj North Coast أرقى مشروع سياحى على البحر مباشرة من أعمال شركة الأهلى للتنمية العقارية (صبور) والتى تأسست عام 1994 كشركة مساهمة مصرية ، وهى من أوائل الشركات الهندسية  الأستثمارية \r\nصممت القرية على مساحة 200 فدان بعرض شاطىء 1300 متر وعمق 1200 متر، وتعنى كلمة أمواج هو مفهوم مبتكر مستوحى من مجموعة من الجزر الآسيوية ، كما يتميز المشروع بجود مساحات خضراء واسعة تساعد فى الاسترخاء ، بالأضافة إلى منطقة خدمات متكاملة مما يتيح جو من الأستمتاع والرفاهية .', 'Amwaj’s lifestyle is a dream come true, where the experience is designed to meet its guests and residents needs of relaxation, fun, part, leisure activities. Amwaj provides all guests & residents with many opportunities to\r\nobtain a pleasurable stay for a weekend or long holiday. Unhurried, unencumbered and unbelievably liberating from every day cares and stress, Amwaj’s lifestyle is captivated in the enchanting Sidi Abdel Rahman bay an all-inclusive vacation experience of the highest quality. Amwaj’s vacation includes pampering amenities and services, top-notch choice of restaurants and many fun illed spots and entertainment areas\r\nadding to it, the charm of the sea, sand and sun. Amwaj unfolds an exceptionally unique lifetime experience; its magical location give you the rejuvenation of being in a serene realm.', 'Sabbour Consulting is one of the establishments founded by the Cons. Eng. Hussein Sabbour. The Consultancy work of Mr. Sabbour started 1957. He has been working in several activities of business during the last 50 years.Mr. Sabbour has individually as well as with others established a lot of groups, offices, companies and establishment. HSCB is the summary of all this experiences. All these establishments have had a vital and basic role in The development of engineering as well as governmental or private consultancy services in all fields and branches of engineering in Egypt and some Arab countries .', 'Sabbour Consulting is one of the establishments founded by the Cons. Eng. Hussein Sabbour. The Consultancy work of Mr. Sabbour started 1957. He has been working in several activities of business during the last 50 years.Mr. Sabbour has individually as well as with others established a lot of groups, offices, companies and establishment. HSCB is the summary of all this experiences. All these establishments have had a vital and basic role in The development of engineering as well as governmental or private consultancy services in all fields and branches of engineering in Egypt and some Arab countries .', '', NULL, 41, '2018-10-18 15:13:33', '2019-04-02 16:12:32', '28.68043179999995', '30.996363', 1, 1, '', '', 0, 25, 401, NULL, NULL, NULL, NULL, NULL, 0),
(51, 'جايا - راس الحكمة', 'GAIA - Ras El Hikma', 'North Coast', 'تقع فى الكيلو 192 طريق الإسكندرية / مطروح، بجوار قرية سيتى ستارز وقبل قرية ماوتن فيو بـ خليج راس الحكمة، وهى من أرقى المناطق بالساحل الشمالى، والتى تتميز بالمياة النقية والرمال البيضاء، ويعتبر مشروع Gaia Ras El Hikma هو أحدث مشروعات شركة الأهلي للتنمية العقارية (صبور) التى تأسست عام 1994 كشركة مساهمة مصرية، وهى من أوائل الشركات الهندسية الأستثمارية\r\nصممت قرية جايا راس الحكمة بتصميمات تجمع بين الأساليب المعمارية المعاصرة والهندسة المعمارية العربية ، على مساحة 284 فدان ، مقسمة إلى مجموعة من الوحدات بمساحات مختلفه ما بين (chalet – town houses – Twin House – Villas – Duplexes)', 'GAIA is the Greek goddess of the Earth who is usually depicted as a beautiful woman surrounded by fruits. In modern times, some earth scientists use the term GAIA to mean the complete living planet. This is what we aim to have in our resort—a living planet that offers all services that makes life complete.\r\nLocation:\r\nGAIA is situated on the North Coast far from the maddening crowd and in the prime location of Ras El Hekma, Egypt, 190 KMS from Alexandria. It is a tranquil yet exotic resort.  Al Ahly Real Estate Development, which is the developer of the project, is a partner with the land owner with an area of 280 acres.\r\nGAIA blends together contemporary and Arabian architectural styles in order to allow residents and visitors to enjoy the best of both worlds. While contemporary architecture offers more space, big windows, light, with a view overlooking the sea, the Arabian architectural style blends in authenticity, adds a grandeur style and provides a cozy atmosphere. Added to this are the great views of large lakes and the accessibility of 20,000 meters of swimmable water lagoons to all residents even those who live far from the sea. The resort satisfies all needs as it provides a variety of styles from stand-alone villas to attached twin houses, duplexes, chalets of one, two and three bedrooms and Cabanas. \r\nCabanas are a crucial part of the resort, allowing the owners to have these cabanas, gives them good access to the beach. It is perceived as the newest trend in beach resorts.', 'Sabbour Consulting is one of the establishments founded by the Cons. Eng. Hussein Sabbour. The Consultancy work of Mr. Sabbour started 1957. He has been working in several activities of business during the last 50 years.Mr. Sabbour has individually as well as with others established a lot of groups, offices, companies and establishment. HSCB is the summary of all this experiences. All these establishments have had a vital and basic role in The development of engineering as well as governmental or private consultancy services in all fields and branches of engineering in Egypt and some Arab countries .', 'Sabbour Consulting is one of the establishments founded by the Cons. Eng. Hussein Sabbour. The Consultancy work of Mr. Sabbour started 1957. He has been working in several activities of business during the last 50 years.Mr. Sabbour has individually as well as with others established a lot of groups, offices, companies and establishment. HSCB is the summary of all this experiences. All these establishments have had a vital and basic role in The development of engineering as well as governmental or private consultancy services in all fields and branches of engineering in Egypt and some Arab countries .', '', NULL, 41, '2018-10-18 16:13:01', '2019-04-02 16:11:53', '28.629963387890598', '31.003674219478786', 1, 1, '', '', 1, 25, 401, NULL, NULL, NULL, NULL, NULL, 0),
(52, 'انترادا - العاصمة الادارية', 'ENTRADA - New Capital', 'New Capital', 'احتضنت انترادا العاصمة الجديدة بالمناطق الرائعة والمساحات الخضراء وتم اطلاق اسم انترادا على المشروع، مشيراً إلى أنه يقع في مدخل العاصمة الإدارية الجديدة، يشار إلى أن كلمة انترادا إسبانية وتعنى انترانس أى المدخل، ويرجع اختيارها لدعم الهدف الرئيسى للمشروع والذى يقع بمدخل العاصمة الادارية الجديدة. وبالقرب من الجامعة البريطانية وفندق الماسة والكاتدرائية يقام المشروع علي مساحة 72 فدانا يضم حوالي 3 الآلف وحدة سكينة ويضم المشروع 10 مراحل ما بين شقق وبينت هاوس ودوبلكس بمساحات تتراوح ما بين 120 إلى 220 مترا مربعا، حرصت شركة صروح علي اختيار المميز لموقع مشروعها في قلب العاصمة الادارية الجديدة بقلب العاصمة الادارية بمنطقة R7', '“Entrada” is the Spanish synonym for “Entrance”. The choice of the name fulfills the desired purpose, as it defines the position of the compound as a gate to the future, as well as its genuine location at the entrance of The NEW Capital. Entrada is the entrance to a new city, a new lifestyle, a new community, and a new worldwide\r\ncenter of attraction.', 'شركة صروح هي مجموعة من مطوري العقارات المتميزين في الشرق الأوسط الذين قرروا لعب دور مهم في تنمية مصر ، حيث نقدم بفخر تطويرًا حضريًا متكاملاً وفريدًا وعصريًا لا نهاية له ، حيث سنقوم بنقش توقيع صروح شركة صروح تضم مجموعة كبيرة من المستثمرين المصريين والعرب الذين لديهم خبرة واسعة فى مجال التطوير العقارى والعمارة نفذوا أكثر من 250 مشروعا عقاريا في مصر والإمارات والكويت وتركيا والسعودية.، وتمتلك خبرات تؤهلها لتنمية العدد من المشروعات المميزة', 'a group of premium real estate developers in the Middle East who decided to play a significant role in the development of Egypt. we proudly present an integrated, unique, modern and endless urban development.', '', 'uploads/projects/75izHRCTGvGR2h4IjAou0ZWn2Iqsr5R4bumjMCW7.mp4', 43, '2018-10-18 16:54:06', '2019-04-02 16:09:51', '31.740025699999933', '29.9921489', 1, 1, '', '', 1, 16, 23, NULL, NULL, NULL, NULL, NULL, 0),
(53, 'سيتي ستارز - الساحل', 'Citystars - Al Sahel', 'North Coast', 'Set in the spectacular surroundings of the exclusive North Coast, Citystars Al Sahel delivers everything you could dream of in a summer home. Pristine stretches of white sand beaches lining azure waters, all bordering at one of the most exciting projects in Sahel. Here you will find your lifetime opportunity to seek the ultimate escape from the city.\r\n\r\nMesmerizing views of one of the most exclusive beaches of the North Coast. Top that off with stunning contemporary residential units, superlative recreational facilities and an excellent location and you have all the ingredients for the ultimate summer home.', 'Set in the spectacular surroundings of the exclusive North Coast, Citystars Al Sahel delivers everything you could dream of in a summer home. Pristine stretches of white sand beaches lining azure waters, all bordering at one of the most exciting projects in Sahel. Here you will find your lifetime opportunity to seek the ultimate escape from the city.\r\n\r\nMesmerizing views of one of the most exclusive beaches of the North Coast. Top that off with stunning contemporary residential units, superlative recreational facilities and an excellent location and you have all the ingredients for the ultimate summer home.', 'Arco is a leading real estate company in the Egyptian market, primarily developing integrated residential, commercial real estate and resort projects. founded in 2005 Arco has expanded its total investment to 20 billion EGP. in less than 5 years.', 'Arco is a leading real estate company in the Egyptian market, primarily developing integrated residential, commercial real estate and resort projects. founded in 2005 Arco has expanded its total investment to 20 billion EGP. in less than 5 years.', '', NULL, 40, '2018-10-18 17:47:15', '2019-04-02 16:19:51', '28.525100599999973', '31.0362604', 1, 1, '', '', 0, 25, 401, NULL, NULL, NULL, NULL, NULL, 0),
(54, 'كمبوند بلوم فيلدز -  القاهرة الجديدة', 'BLOOMFIELDS - New Cairo', 'New Cairo', 'الكمبوند موجود على مساحة شاسعه جدا فسيقام على مساحة 410 فدان اى ما يعادل 1.6592 كيلو متراً وهو من اكبر الكمبوندات فى مدينة المستقبل و تم تقسيم ال 410 فدان على النحو التالى :\r\n320 فدان سكنى اى ما يُعادل 1.29499 كيلو مترً\r\n90 فدان للخدمات اى ما يُعادل 0.364217 كيلو متراً\r\nو تقع بلوم فيلدز من اطراف مدينتى و حتى العاصمة الادارية الجديدة و هى تلك المدينة الاخرى التى يذهب اليها الكثيرين لشهرتها بالرقي هى الاخرى و لكن بالطبع لن تكون مثل مدينة المستقبل و قد تم شراء قطعه الارض تلك عن طريق البنوك وبالتعاون مع المقاولون العرب و كل تلك المساحة مقامه بالكامل من اجل كمبوند واحد فقط لتكون مثل مدينه مغلقة لك انت و اسرتك فقط و تقع امام مدينتى و امتداد التجمع الخامس بجانب حسن علام و صبور الشهيرين', 'Welcome to BLOOMFIELDS; the most charming and interconnected green town in Mostakbal City; always on the rise, and in search for fresh bold ideas to surround you with sweeping views over lush sun-kissed parks, open-air galleries, top-notch education, a burgeoning cultural scene, as well as world-class facilities, and a sustainable lifestyle inspired by the best integrated ecosystems in the world. Designed to offer something for just everyone, BLOOMFIELDS is Tatweer Misr’s prime innovative project in Cairo that’s set to become Egypt’s hotbed for startups, entrepreneurs, as well as makers and doers who wish to execute flawlessly at home, in the office or at the gym. Boasting one-of-a-kind functions, and top-notch amenities at every doorstep, BLOOMFIELDS is carefully planned for opportunities to find you making life easier, and more enjoyable without having to commute. BLOOMFIELDS is the town to share ideas, create, but most importantly grab a piece of the magic that balances the best of community living, studying and work — all artfully combined under one roof. Between New Cairo’s Golden Square, and Cairo’s New Capital, not only offering easy access to Egypt’s top-educational institutions such as, the American University In Cairo and Road 90’s lively happenings, but also providing direct access to New Cairo Capital’s fast train station and International Airport. The project also enjoys a strategic location just 45 minutes away from Al Ein El Sokhna, and can be easily accessed via the Middle Ring Road, and the Regional Ring Road.', 'تأسست الشركة في عام 2014، وهي شركة مساهمة مصرية مصرية، تستفيد من ثروة من الخبرة الصناعية والعقارية التي طرحها المساهمون على الطاولة. يقدم كبار المساهمين مثل عرفة وداعود والأهرام المجموعات الخبرة التجارية والتقنية اللازمة لتحقيق رؤية الاستخدامات السكنية متعددة الاستخدامات على أساس الهندسة المعمارية الأنيقة والفاخرة الحديثة والمناظر الطبيعية. إن الخبرة المشتركة لفريق إدارة تطوير مصر تتيح للشركة الحفاظ على التميز على جميع مستويات تطوراتها. من البناء والتصميم والهندسة المعمارية، إلى المناظر الطبيعية، وخدمات نمط الحياة ووسائل الراحة، وتطير مصر تغطي جميع جوانب صناعة العقارات تقدم نظرة جديدة على مشاريعهم', 'Tatweer Misr is an Egyptian shareholding real estate company, that capitalizes on a wealth of industrial and real estate experience brought to the table by its shareholders. Major shareholders such as Arafa, Daoud and Ahram Groups provide the business and technical expertise needed to fulfill the vision of mixed use residential developments based on elegant and luxurious modern architecture and landscaping.', '', NULL, 45, '2018-10-18 18:29:24', '2019-04-02 16:09:17', '31.643876099999943', '30.0714075', 1, 1, '', '', 0, 16, 66, NULL, NULL, NULL, NULL, NULL, 0),
(55, 'La Fontaine', 'La Fontaine', 'New Cairo', '“La Fontaine” Essential to life in landscape; water triggers the mind and concentrates meanings. Its surface reflects the landscape it nourishes, increasing this communication; the sound of water further augment meaning and reinforce the communication. The lapping wave, gurgling brook, thunder of waterfalls, splash of trout contribute to the power that water affords to mental images.\r\nThe sight, sound, smell and feel of water on skin are stimuli that enrich a sensation of the place.', '“La Fontaine” Essential to life in landscape; water triggers the mind and concentrates meanings. Its surface reflects the landscape it nourishes, increasing this communication; the sound of water further augment meaning and reinforce the communication. The lapping wave, gurgling brook, thunder of waterfalls, splash of trout contribute to the power that water affords to mental images.\r\nThe sight, sound, smell and feel of water on skin are stimuli that enrich a sensation of the place.', 'Arco is a leading real estate company in the Egyptian market, primarily developing integrated residential, commercial real estate and resort projects. founded in 2005 Arco has expanded its total investment to 20 billion EGP. in less than 5 years.', 'Arco is a leading real estate company in the Egyptian market, primarily developing integrated residential, commercial real estate and resort projects. founded in 2005 Arco has expanded its total investment to 20 billion EGP. in less than 5 years.', '', NULL, 40, '2018-10-18 18:44:28', '2019-04-02 16:18:59', '31.535778499999992', '30.0378474', 1, 1, '', '', 0, 16, 31, NULL, NULL, NULL, NULL, NULL, 0),
(56, 'فوكا باي -  الساحل الشمالي', 'FOUKA BAY - North Coast', 'North Coast', 'على أجمل شواطىء الساحل الشمالى شواطئ رأس الحكمه الشهيره بأنها افضل و اجمل بحر فى الساحل الشمالي و رابع اجمل بحر على مستوى العالم فى الجمال و النظافه و هدوء الامواج وتقع  بالقرب من طريق مخرج الفوكا تعطيك الاحساس الذى دائما ما تتمناه و تبحث عنه وهو شعور الهدوء و الراحه النفسيه و البعد عن الروتين و عن مشاكل الحياه المرهقه فكل ما ستراه حولك هو اللاند سكيب و الكريستال لاجونز حولك من كل مكان وسيكون  البحر امامك مباشره حيث تتمركز الوحدات الخاصة بالمشروع حول الحدائق وحمامات السباحة والكريستال لاجونز بالإضافة الى اللاند سكيب المحيطه بالقرية والتى تغطى أكبر جزء من مساحة المشروع حيث تقام الوحدات السكنيه على مساحه 20% فقط و باقى المساحه كلها مقام عليها الخدمات و اللاند سكيب وكل ذلك واكثر لضمان اقصى وسائل الراحه الممكنه للعميل', 'Blissfully basking by Ras El Hekma’s gleaming coastline to boast an exclusive spot on the North Coast’s azure shoreline, Fouka Bay rolls out on 1 million sq. meters to offer an abundance of signature experiences, you’d normally have to travel thousands of miles for. Planned with your convenience in mind, the idyllic development is\r\njust a pleasant 2 hour drive from Cairo, and only one minute away from Fouka Highway. It is also ideally located 211 km from Alexandria, and 75 km from Marsa Matrouh, setting itself as the greatest year-round escape in the North Coast.\r\nFouka Bay offers that otherworldly island experience you’d normally have to travel thousands of miles for. Wake up to your own slice of paradise where 800 meters of white secluded sandy beaches stretch to spoon turquoise lagoons in the heart of Ras El Hekma’s gleaming coastline. This is the place to experience the best of life where the striking interplay between nature and elegant contemporary designs come to life. Breathe in the fresh air and enjoy unique tropical scents, as you indulge in an unparalleled fusion of adventure and tranquility not offered elsewhere.', 'تأسست الشركة في عام 2014، وهي شركة مساهمة مصرية مصرية، تستفيد من ثروة من الخبرة الصناعية والعقارية التي طرحها المساهمون على الطاولة. يقدم كبار المساهمين مثل عرفة وداعود والأهرام المجموعات الخبرة التجارية والتقنية اللازمة لتحقيق رؤية الاستخدامات السكنية متعددة الاستخدامات على أساس الهندسة المعمارية الأنيقة والفاخرة الحديثة والمناظر الطبيعية. إن الخبرة المشتركة لفريق إدارة تطوير مصر تتيح للشركة الحفاظ على التميز على جميع مستويات تطوراتها. من البناء والتصميم والهندسة المعمارية، إلى المناظر الطبيعية، وخدمات نمط الحياة ووسائل الراحة، وتطير مصر تغطي جميع جوانب صناعة العقارات تقدم نظرة جديدة على مشاريعهم', 'Tatweer Misr is an Egyptian shareholding real estate company, that capitalizes on a wealth of industrial and real estate experience brought to the table by its shareholders. Major shareholders such as Arafa, Daoud and Ahram Groups provide the business and technical expertise needed to fulfill the vision of mixed use residential developments based on elegant and luxurious modern architecture and landscaping.', '', NULL, 45, '2018-10-18 18:50:06', '2019-04-02 16:08:40', '27.94023440000001', '31.0900271', 1, 1, '', '', 0, 25, 401, NULL, NULL, NULL, NULL, NULL, 0),
(57, 'Lagoon', 'Lagoon', 'North Coast', 'Overlooking the pure and pristine aquamarine waters the characteristics of the Mediterranean Sea, Lagoon resort is strategically nestled on Egypt’s Northern Coastline. Feeling relaxed already? Wait until you truly experience its laid-back rhythm beating at heart: The landscaping, the scenic views of the clear blue skies against sparkling beach, and the welcoming sunny weather. Lagoon resort was meticulously planned to instill a feeling of comfort, simplicity and warmth; the modern and sleek architectural design give way for the revival of healthy living. Adults and children alike can enjoy their outdoor activities and truly indulge in the simple pleasures of their summer vacation. Not only will you be spoilt for choice when it comes to the summer home varieties and unit designs, but also for the range of amenities and fun-inducing facilities. Offering you everything from the long view lagoon, the best water sports in the North Coast, and swimming pools all the way to a ﬁtness and spa center, cafes, restaurants and shopping areas, Lagoon Resort is no doubt an all-embracing vacation venue.', 'Overlooking the pure and pristine aquamarine waters the characteristics of the Mediterranean Sea, Lagoon resort is strategically nestled on Egypt’s Northern Coastline. Feeling relaxed already? Wait until you truly experience its laid-back rhythm beating at heart: The landscaping, the scenic views of the clear blue skies against sparkling beach, and the welcoming sunny weather. Lagoon resort was meticulously planned to instill a feeling of comfort, simplicity and warmth; the modern and sleek architectural design give way for the revival of healthy living. Adults and children alike can enjoy their outdoor activities and truly indulge in the simple pleasures of their summer vacation. Not only will you be spoilt for choice when it comes to the summer home varieties and unit designs, but also for the range of amenities and fun-inducing facilities. Offering you everything from the long view lagoon, the best water sports in the North Coast, and swimming pools all the way to a ﬁtness and spa center, cafes, restaurants and shopping areas, Lagoon Resort is no doubt an all-embracing vacation venue.', 'Arco is a leading real estate company in the Egyptian market, primarily developing integrated residential, commercial real estate and resort projects. founded in 2005 Arco has expanded its total investment to 20 billion EGP. in less than 5 years.', 'Arco is a leading real estate company in the Egyptian market, primarily developing integrated residential, commercial real estate and resort projects. founded in 2005 Arco has expanded its total investment to 20 billion EGP. in less than 5 years.', '', NULL, 40, '2018-10-18 19:01:07', '2019-04-02 16:18:07', '29.004098999999997', '30.825427', 1, 1, '', '', 0, 25, 401, NULL, NULL, NULL, NULL, NULL, 0),
(58, 'Il MONTE GALALA - CLIFFTOP CONDOS', 'Il MONTE GALALA - CLIFFTOP CONDOS', 'Ein Sokhna', 'Cliff-Top Condos revolutionize the ordinary sea view home; elevated and designed on the natural topography of Il Monte Galala, each unit is granted unobscured views and uninterrupted privacy. With its breathtaking architecture and mesmerizing fully-finished interiors, Cliff-Top Condos is the perfect year-round getaway.', 'Cliff-Top Condos revolutionize the ordinary sea view home; elevated and designed on the natural topography of Il Monte Galala, each unit is granted unobscured views and uninterrupted privacy. With its breathtaking architecture and mesmerizing fully-finished interiors, Cliff-Top Condos is the perfect year-round getaway.', 'تأسست الشركة في عام 2014، وهي شركة مساهمة مصرية مصرية، تستفيد من ثروة من الخبرة الصناعية والعقارية التي طرحها المساهمون على الطاولة. يقدم كبار المساهمين مثل عرفة وداعود والأهرام المجموعات الخبرة التجارية والتقنية اللازمة لتحقيق رؤية الاستخدامات السكنية متعددة الاستخدامات على أساس الهندسة المعمارية الأنيقة والفاخرة الحديثة والمناظر الطبيعية. إن الخبرة المشتركة لفريق إدارة تطوير مصر تتيح للشركة الحفاظ على التميز على جميع مستويات تطوراتها. من البناء والتصميم والهندسة المعمارية، إلى المناظر الطبيعية، وخدمات نمط الحياة ووسائل الراحة، وتطير مصر تغطي جميع جوانب صناعة العقارات تقدم نظرة جديدة على مشاريعهم', 'Tatweer Misr is an Egyptian shareholding real estate company, that capitalizes on a wealth of industrial and real estate experience brought to the table by its shareholders. Major shareholders such as Arafa, Daoud and Ahram Groups provide the business and technical expertise needed to fulfill the vision of mixed use residential developments based on elegant and luxurious modern architecture and landscaping.', '', NULL, 45, '2018-10-18 19:01:59', '2019-04-02 16:05:07', '31.753754399999934', '29.9038879', 1, 1, '', '', 0, 37, 253, NULL, NULL, NULL, NULL, NULL, 0),
(59, 'Il MONTE GALALA -  MAESTA', 'Il MONTE GALALA -  MAESTA', 'Ein Sokhna', 'Imagine an intimate yet perfectly majestic world, gently rising from clear turquoise waters to proudly crown its own soul-stirring mountain, 210 meters above the Red Sea’s glistening coast. A top coastal address, upping the exclusivity factor by mere topography where every little detail is sympathetic to nature, painting a bigger, mesmerizing picture of your mountain-top life. It is here on the highest plateau of IL Monte Galala where proud\r\npeaks effortlessly embrace the best elements of the sun and sea, and your luxurious cliff-top home gently clings to rocks, to take in the infinite Crystal Lagoon views. Maestà proves once and for all that beauty can be seized from summit to sea and that good things indeed come in grand packages. Perfectly located 210 meters high above sea levels to roll out on 218,000 m2, Maestà’s architecturally inspired cliff-top homes are treated to a spectacular bird’s eye view of IL Monte Galala’s coastal universe with its 200,000 m2 of cascading mountaintop lagoons, the Red Sea’s infinite hues, and a wealth of retail and leisure facilities. Imaginatively conceived by Tatweer Misr Developments and Italian architects Gianluca Peluffo & Partners to challenge the conventional norms of topography, Maestà’s gated community is not only aesthetically designed to respect its surrounding nature, but is also built on varied altitudes to guarantee unobscured sea and lagoons views for all homeowners alike. This year-round gated community with its verdant one kilometre stretch of mountain-top broad-walks and idyllic lifestyle takes luxury living to new photogenic heights by introducing the first- of- its kind mountain-top promenade, rising above 170 meters for residents to experience the best of exclusivity.', 'Imagine an intimate yet perfectly majestic world, gently rising from clear turquoise waters to proudly crown its own soul-stirring mountain, 210 meters above the Red 