(60, 'Il MONTE GALALA', 'Il MONTE GALALA', 'North Coast', 'Il Monte Galala Ain Sokhna articulates a unique living experience not offered elsewhere. Inspired by Portfolio\'s spellbinding surroundings in Italy, this year - round mountain community with its lush landscapes and idyllic beach lifestyle sets a global benchmark for luxury living sustainability and unrivaled hospitality Flowing into a landscape of natural wealthiness.\r\nIl Monte Galala Ain Sokhna has been designed to bring to life an abundance of colorful. experiences at different heights Set over 5 different altitudes and designed with varied communities in mind, each of Il Monte Galala Ain Sokhna ’s distinct zones reflect the unique character and environment of the site, setting it to become an international destination by choice From villas and elegantl condos to cozy cabanas overlooking 45,000 m of crystal clear lagoons. Il Monte Galala Ain Sokhna offers a world of contemporary living options,', 'Il Monte Galala Ain Sokhna articulates a unique living experience not offered elsewhere. Inspired by Portfolio\'s spellbinding surroundings in Italy, this year - round mountain community with its lush landscapes and idyllic beach lifestyle sets a global benchmark for luxury living sustainability and unrivaled hospitality Flowing into a landscape of natural wealthiness.\r\nIl Monte Galala Ain Sokhna has been designed to bring to life an abundance of colorful. experiences at different heights Set over 5 different altitudes and designed with varied communities in mind, each of Il Monte Galala Ain Sokhna ’s distinct zones reflect the unique character and environment of the site, setting it to become an international destination by choice From villas and elegantl condos to cozy cabanas overlooking 45,000 m of crystal clear lagoons. Il Monte Galala Ain Sokhna offers a world of contemporary living options,', 'تأسست الشركة في عام 2014، وهي شركة مساهمة مصرية مصرية، تستفيد من ثروة من الخبرة الصناعية والعقارية التي طرحها المساهمون على الطاولة. يقدم كبار المساهمين مثل عرفة وداعود والأهرام المجموعات الخبرة التجارية والتقنية اللازمة لتحقيق رؤية الاستخدامات السكنية متعددة الاستخدامات على أساس الهندسة المعمارية الأنيقة والفاخرة الحديثة والمناظر الطبيعية. إن الخبرة المشتركة لفريق إدارة تطوير مصر تتيح للشركة الحفاظ على التميز على جميع مستويات تطوراتها. من البناء والتصميم والهندسة المعمارية، إلى المناظر الطبيعية، وخدمات نمط الحياة ووسائل الراحة، وتطير مصر تغطي جميع جوانب صناعة العقارات تقدم نظرة جديدة على مشاريعهم', 'Tatweer Misr is an Egyptian shareholding real estate company, that capitalizes on a wealth of industrial and real estate experience brought to the table by its shareholders. Major shareholders such as Arafa, Daoud and Ahram Groups provide the business and technical expertise needed to fulfill the vision of mixed use residential developments based on elegant and luxurious modern architecture and landscaping.', '', NULL, 45, '2018-10-18 19:39:32', '2019-04-02 16:03:40', '31.753754399999934', '29.9038879', 1, 1, '', '', 1, 25, 401, NULL, NULL, NULL, NULL, NULL, 0),
(61, 'The Wharf - Al Sahel', 'The Wharf - Al Sahel', 'North Coast', 'The Design driving force for this project is a new lifestyle that is set to be a reference in this region of the world .\r\n\r\nOwning your Own beach …\r\n\r\nA revolutionary idea that would redefine the parameters of real estate ownership on Egypt’s North Coast. Front row Villas & Beach Cabanas traditionally get the lion’s share of the water front , the remaining units of the developments are always left out with bits and pieces of landscape with the occasional Water\r\n\r\npond or a pool that is shared with all the neighborhood.', 'The Design driving force for this project is a new lifestyle that is set to be a reference in this region of the world .\r\n\r\nOwning your Own beach …\r\n\r\nA revolutionary idea that would redefine the parameters of real estate ownership on Egypt’s North Coast. Front row Villas & Beach Cabanas traditionally get the lion’s share of the water front , the remaining units of the developments are always left out with bits and pieces of landscape with the occasional Water\r\n\r\npond or a pool that is shared with all the neighborhood.', 'Arco is a leading real estate company in the Egyptian market, primarily developing integrated residential, commercial real estate and resort projects. founded in 2005 Arco has expanded its total investment to 20 billion EGP. in less than 5 years.', 'Arco is a leading real estate company in the Egyptian market, primarily developing integrated residential, commercial real estate and resort projects. founded in 2005 Arco has expanded its total investment to 20 billion EGP. in less than 5 years.', '', 'uploads/projects/PittdeJvW6milM7L1YhTvzAovdIyivwb1Gr14tcu.mp4', 40, '2018-10-19 03:36:04', '2019-04-02 16:17:31', '28.525100599999973', '31.0362604', 1, 1, '', '', 0, 25, 401, NULL, NULL, NULL, NULL, NULL, 0),
(62, 'La Vande', 'La Vande', 'Sheikh Zayed', 'La Vande the French provincial country style combines the best of old world elegance with comfortable interiors. With its roots in the sunny hillside of rural France where each province has its own colloquial style, French country architecture reflects a wealth of diversity. Old and new, Formal and informal elements are mixed in houses ranging from humble cottages and farm houses to Grande chateaux.\r\nCommon elements include tall, thin windows, often with slate–board shutters, steep roofs, multiple gables, and assorted curved arches. Stucco and stones are frequently used trimmed with painted timbers, window boxes, wrought iron railing and brick highlights around windows and doors. Inside, you’ll find wood beams, plaster walls and stone floors as common thematic features.', 'La Vande the French provincial country style combines the best of old world elegance with comfortable interiors. With its roots in the sunny hillside of rural France where each province has its own colloquial style, French country architecture reflects a wealth of diversity. Old and new, Formal and informal elements are mixed in houses ranging from humble cottages and farm houses to Grande chateaux.\r\nCommon elements include tall, thin windows, often with slate–board shutters, steep roofs, multiple gables, and assorted curved arches. Stucco and stones are frequently used trimmed with painted timbers, window boxes, wrought iron railing and brick highlights around windows and doors. Inside, you’ll find wood beams, plaster walls and stone floors as common thematic features.', 'Arco is a leading real estate company in the Egyptian market, primarily developing integrated residential, commercial real estate and resort projects. founded in 2005 Arco has expanded its total investment to 20 billion EGP. in less than 5 years.', 'Arco is a leading real estate company in the Egyptian market, primarily developing integrated residential, commercial real estate and resort projects. founded in 2005 Arco has expanded its total investment to 20 billion EGP. in less than 5 years.', '', NULL, 40, '2018-10-19 11:47:01', '2019-04-02 16:16:58', '31.02358819999995', '30.0002179', 1, 1, '', '', 0, 21, 85, NULL, NULL, NULL, NULL, NULL, 0),
(63, 'المصيف - الساحل الشمالي', 'El Masyaf - North Coast', 'North Coast', 'المنتجع بالكامل جميع الوحدات سي فيو ما اجمل ان تعيش في جزيرة منفصلة عن العالم امام البحر داخل الامواج الهادئة والمياه الزرقاء ان تعيش في عالم من الخيال في اعماق البحر المتوسط ان تمتلك شاليهك وتصحو وتغفو كل ليلة علي رؤعة بحر خليج الحكمه الان مع منتجع المصيف لن تدفع الكثير والكثير وتنفق العديد من الاموال حتي تكون في مكان مميزةعلي البحر لاول مرة قرية تجعلك في قلب البحر بامتلك لشالية وليس فيلا حرصت شركة M2 ان تكون الفيلا والشالية الاختلاف الوحيد بينهم هو المساحة وجود الفيلا لمحبين المساحات الواسعة وليس الموقع او ان الفيلا اميز برؤيتها للبحر الاختلاف فقط هو المساحة', 'NESTLED ALONG AL SAHEL EL SHAMALY’S COAST, EL MASYAF COVERS 171 ACRES OF NATURALLY LEVELED LAND WITH A BEACH FRONT STRETCHED OVER 1 KM.\r\nA sensuous experience capturing the forgotten senses of well being and enjoying the timeless simple pleasures of life. It is the feel of nostalgic summer days with the function of today, creating an oasis of joy. The wind in your hair, the sand on your toes, and the sound of waves becomes the soundtrack of your life. Setting the stage for a spiritual and adventurous experience for all. Suited young to old, active to passive, morning till night, summer to winter, land to sea. We have handpicked our partners and consultants, making El Masyaf an even more personal and special experience for everyone to rejoice in. Reshuffling the Sahel game, by having sea-view staggered chalets next to standalone right on the beach, El Masyaf gives you the flexibility to own summer the way you want it to be. \r\nStaying true to the name and its meaning, El Masyaf contributes to giving you a summer destination where it features a variety of homes and views, from family homes to standalone villas, staggered chalets and twin houses. \r\n\r\nMASTER PLAN\r\nDownload Master Plan  \r\n\r\nUNITS & FLOORPLANS\r\nEl Masyaf offers a wide range of variety of unit types; from Staggered Chalets, Family Houses, Standalone Villas and Twin Houses.\r\n\r\nSpaces ranging from 110 to 580 sqm.\r\n\r\n\r\nDownload Floorplan s\r\n\r\nTotal Area\r\n171 acres\r\nSwimmable Lagoons\r\n12% of land area\r\nOpen spaces\r\n35% of total land area\r\nRoads\r\n17% of total land area\r\nLOCATION :\r\n75km from Marssa Matrouh\r\n10km from Fouka Road', 'شركة M2  لها سابقة اعمال عريقة للغاية في جميع مجالات المجتمع والحياة حيث تاسست شركة M2 جروب\r\nسنة 1980 وهذا مايميزها عن غيرها وهي خبرتها العملاقة واعمالها حيث ان شركة M2 لها العديد من الاعمال في مجال الصناعة والزراعة والإغذية والصناعة والنفط والغاز والاستثمار المالي في المجال الجوي وهي مؤسسة شركة INTRO للطاقة الشمسية سنة 2005 والعديد والعديد من الاعمال والمشاركة في جميع القطاعات الهامة والإساسية لها دور كبير للغاية في المجتمع وهذا بسبب سابقة اعمالها العملاقة بخلاف خبرتها وسابقة اعمالها في السوق العقاري.', 'M² Developments, part of the regional well known INTRO Group, which was established in 1980. INTRO is comprised of a diverse group of companies, with an overall of 5500 employees, which operate in different sectors including oil & gas, industrial automation, financial investment, atmospheric gases, and food &\r\n \r\n M² Developments was established with a new concept of altering the real estate market in Egypt, aiming to create a unique living experience, omit the excess beyond function and provide products that speak more.\r\n \r\n We began a journey of thinking beyond the norm in Real Estate across Egypt, with a functional concept of slimming residential living spaces; focused on giving the customer.', '', 'uploads/projects/BCSYSiynqI5sBII5ZGSHMvyB353UFHLJ8sXPGR9J.mp4', 19, '2018-10-21 13:51:57', '2019-04-02 16:58:23', '28.96603611572266', '30.83188111059941', 1, 1, '', '', 0, 25, 401, NULL, NULL, NULL, NULL, NULL, 0),
(64, 'أزهى - العين السخنة', 'AZHA - AIN SOKHNA', 'Ain Sokhna', 'يعد منتجع “أزهى” مدينة سكنية ساحلية عصرية متكاملة تقع على مساحة 1.6 مليون متر مربع، وتطل مباشرة على مساحة مائية تقدر ب 700 متر (البحر الأحمر). يقع المنتجع على بعد 15 دقيقة من العاصمة الإدارية الجديدة ويحتوي على مجموعة من القرى السكنية والساحلية التي تضم عدد من الوحدات السكنية المتنوعة التي تناسب مختلف الأذواق؛ بداية من الفلل والشقق السكنية الفاخرة حتى الشاليهات كل ذلك متوفر بمساحات وأسعار مختلفة تناسب جميع الفئات.', 'Madaar has successfully redefined high end lifestyle through superior planning of Azha, located 12 kilometers from the toll station and just outside the Second Greater Cairo Ring Road. Azha is a waterfront luxury residential resort positioned on the left side of Ain Sokhna, a project that cemented itself especially with Egypt’s large-scale project-proposed new capital of Egypt.  Azha brings a new vitality to the authentic lifestyle of a city resort living, a host of exceptional amenities, encompassing spacious and inspiring residential villas, apartment complexes and twin houses as well as signature restaurants, serene facilities and community centers.', 'شركة مدار للتطوير العقاري، شركة ذات ملكية خاصة تقدم خدمات متكاملة وتعمل في استثمار العقارات التجارية والسكنية وتطويرها، وتفتخر بتقديمها لأفضل الخدمات وتوفير الوظائف ونمط الحياة المريح.\r\n\r\nتأسست شركة مدار في مارس 2015، وقد دعمت مكانتها في مجال العقارات، حيث أجرت تعاقد مع اثنتين من الشركات الدولية الرئيسية لاستشارات التخطيط والتصميم الأكثر شهرة وهي بارتون ويلمور، وميكستي، وبدعم من شركة صن رايز لإدارة المنتجعات والفنادق العائمة بصفتها شركة شقيقة وعلامة تدل على حسن الضيافة، أمضت شركة مدار طريقًا صعبًا لكي تحقق النجاح.', 'Madaar Development is a full-service, privately held commercial and residential real estate investment and development company with a distinguished ability to rapidly move any project from site selection, acquisition, ﬁnancing, construction, property management and maintenance. The Core Principles that deﬁne the Madaar are the stability, creativity and professional expertise of our management team; an aggressive long-term business plan; a commitment to excellence and tenant service; our close relationships with strategic partners, tenants and real estate professionals; a consistent ability to add value; and most importantly, our unwavering pursuit of visionary development.', '', NULL, 50, '2018-10-21 15:21:06', '2019-04-02 16:01:57', '32.36804010000003', '29.7172031', 1, 1, '', '', 0, 37, 253, NULL, NULL, NULL, NULL, NULL, 0),
(65, 'بافو - أزهى', 'PAVO - AZHA', 'Ain Sokhna', 'This is a contemporary development of a spacious apartments. Everything about the building has been carefully considered to work in harmony with the surrounding waterscapes. As a result, the finishes used reflect the local microclimate throughout. The waterscapes’ setting is integral throughout the development, from the pleasing walkway at the front entrance, to the lagoon waters.', 'This is a contemporary development of a spacious apartments. Everything about the building has been carefully considered to work in harmony with the surrounding waterscapes. As a result, the finishes used reflect the local microclimate throughout. The waterscapes’ setting is integral throughout the development, from the pleasing walkway at the front entrance, to the lagoon waters.', 'شركة مدار للتطوير العقاري، شركة ذات ملكية خاصة تقدم خدمات متكاملة وتعمل في استثمار العقارات التجارية والسكنية وتطويرها، وتفتخر بتقديمها لأفضل الخدمات وتوفير الوظائف ونمط الحياة المريح.\r\n \r\n تأسست شركة مدار في مارس 2015، وقد دعمت مكانتها في مجال العقارات، حيث أجرت تعاقد مع اثنتين من الشركات الدولية الرئيسية لاستشارات التخطيط والتصميم الأكثر شهرة وهي بارتون ويلمور، وميكستي، وبدعم من شركة صن رايز لإدارة المنتجعات والفنادق العائمة بصفتها شركة شقيقة وعلامة تدل على حسن الضيافة، أمضت شركة مدار طريقًا صعبًا لكي تحقق النجاح.', 'Madaar Development is a full-service, privately held commercial and residential real estate investment and development company with a distinguished ability to rapidly move any project from site selection, acquisition, ﬁnancing, construction, property management and maintenance. The Core Principles that deﬁne the Madaar are the stability, creativity and professional expertise of our management team; an aggressive long-term business plan; a commitment to excellence and tenant service; our close relationships with strategic partners, tenants and real estate professionals; a consistent ability to add value; and most importantly, our unwavering pursuit of visionary development.', '', NULL, 50, '2018-10-21 15:44:04', '2019-04-02 16:01:28', '32.36804010000003', '29.7172031', 1, 1, '', '', 0, 37, 253, NULL, NULL, NULL, NULL, NULL, 0),
(66, 'TUCANA - AZHA', 'TUCANA - AZHA', 'Ain Sokhna', 'At the center of all life is a place from which all energy flows. In the heart of Azha’s lush landscape and infinite crystal waters views, this is TUCANA - the new luxury address inspired by today’s modern lifestyles. Smart and sleek... Dreamy and livable...\r\nInviting and exclusive... the Tucana experience takes you away from the cosmopolitan city to a dwelling level of imagination.', 'At the center of all life is a place from which all energy flows. In the heart of Azha’s lush landscape and infinite crystal waters views, this is TUCANA - the new luxury address inspired by today’s modern lifestyles. Smart and sleek... Dreamy and livable...\r\nInviting and exclusive... the Tucana experience takes you away from the cosmopolitan city to a dwelling level of imagination.', 'شركة مدار للتطوير العقاري، شركة ذات ملكية خاصة تقدم خدمات متكاملة وتعمل في استثمار العقارات التجارية والسكنية وتطويرها، وتفتخر بتقديمها لأفضل الخدمات وتوفير الوظائف ونمط الحياة المريح.\r\n \r\n تأسست شركة مدار في مارس 2015، وقد دعمت مكانتها في مجال العقارات، حيث أجرت تعاقد مع اثنتين من الشركات الدولية الرئيسية لاستشارات التخطيط والتصميم الأكثر شهرة وهي بارتون ويلمور، وميكستي، وبدعم من شركة صن رايز لإدارة المنتجعات والفنادق العائمة بصفتها شركة شقيقة وعلامة تدل على حسن الضيافة، أمضت شركة مدار طريقًا صعبًا لكي تحقق النجاح.', 'Madaar Development is a full-service, privately held commercial and residential real estate investment and development company with a distinguished ability to rapidly move any project from site selection, acquisition, ﬁnancing, construction, property management and maintenance. The Core Principles that deﬁne the Madaar are the stability, creativity and professional expertise of our management team; an aggressive long-term business plan; a commitment to excellence and tenant service; our close relationships with strategic partners, tenants and real estate professionals; a consistent ability to add value; and most importantly, our unwavering pursuit of visionary development.', '', NULL, 50, '2018-10-21 16:16:59', '2019-04-02 16:01:02', '32.36804010000003', '29.7172031', 1, 1, '', '', 0, 37, 253, NULL, NULL, NULL, NULL, NULL, 0);
