(67, 'كمبوند لاميرادا المستقبل - القاهرة الجديدة', 'LA MIRADA EL MOSTAKBAL CITY - New Cairo', 'New Cairo', 'إمتلك في أفضل فرصة استثمارية في القاهرة الجديدة في لاميرادا مستقبل سيتي - وحدات فاخرة بمقدم حجز 10٪ و الباقي على ٨ سنوات ، مساحات تبدأ من ١٢٠ متر حتى ٢٤٠ متر - بين العاصمه الاداريه و مدينتى ويبعد ايضا عن الجامعه الامريكيه ب 15 دقيقه فقط ، يقام الكمبوند على مساحه ٧٧ فدان نسبة المباني ٢٠ ٪ فقط و الباقي مساحات خضراء و بحيرات .\r\nيتمتع كمبوند لاميرادا المستقبل بالكثير من الخدمات الترفيهية المتكاملة لتلبية احتياجات مالكى المشروع من تراك للمشي و الدراجات - نادي رياضي إجتماعي - مول تجاري - مساحات خضراء و بحيرات - نادي صحي - مسجد - و حضانة عالمية', 'LA MIRADA EL-MOSTAKBL is located in New Cairo only 15 minutes away from the AUC, 3 minutes away from new capital and gate to gate with Madinaty La Mirada compound stretches over 77 Fadden of residential units, open green spaces and lakes.\r\nLa Mirada El Mostakbal is a collection of Luxuries residentials apartments divided into small clusters, Each Clusteris inwardly by a verdant greenery landscape and soothing water features.\r\nA Residence that keeps you close to the buzz of the city yet far from it, La Mirada AI Mostakbal assures you of com•fort and convenience in your day-to-day life. We have meticulously planned each home to suit your every requirement and offer peace and prosperity with already inhabited Madinety neighborhood.', 'A shareholding company established by a group of real estate developers with the aim of owning development and management of real estate projects. Shareholders are a group of investors who have a long-term industrial record to establish and develop many projects in Egypt are currently being led by a new entrepreneur generation engineer. Sharif Farouk Osman, who represents the young driving force. The Group has expanded its investments and success in the new few years. The Group has recently faced the diversification of the real estate sector with a financial background along with a proven track record in the real estate market\r\nLa Mirada (in Spanish: The View) is a distinct community established in the 5th settlement in New Cairo.\r\nThe name of the project in Mostakbal City: La Mirada', 'A shareholding company established by a group of real estate developers with the aim of owning development and management of real estate projects. Shareholders are a group of investors who have a long-term industrial record to establish and develop many projects in Egypt are currently being led by a new entrepreneur generation engineer. Sharif Farouk Osman, who represents the young driving force. The Group has expanded its investments and success in the new few years. The Group has recently faced the diversification of the real estate sector with a financial background along with a proven track record in the real estate market\r\nLa Mirada (in Spanish: The View) is a distinct community established in the 5th settlement in New Cairo.\r\nThe name of the project in Mostakbal City: La Mirada', '', 'uploads/projects/CV1zMcX1D1PJEQJXEKMTAOe1eRjUx0uvNUx3PdH6.bin', 51, '2018-10-21 16:35:37', '2019-04-02 16:00:07', '31.424719600000003', '30.02080350000001', 1, 1, '', '', 1, 16, 66, NULL, NULL, NULL, NULL, NULL, 0),
(68, 'كمبوند اريا - مدينة المستقبل', 'ARIA - Mostakbal City', 'Mostakbal City', 'كمبوند اريا  هو إحدى المشاريع السكنية لشركة صبور الاستثمارية العقارية ويقع في مدينة المستقبل بجوار كمبوند سيتي جيت في قلب التجمع الخامس. يعتبر كمبوند أريا من أحدث المجمعات السكنية في التجمع الخامس تم تصميمه وفقا لأحدث وأرقى التصاميم الهندسية العالمية، ويتميز الكمبوند بتنوع الوحدات السكنية فيه ما بين شقق وبنتهاوس التي من شأنها إرضاء كافة الأذواق. كما يحتوي الكمبوند على العديد من المرافق والخدمات الترفيهية التي تتمثل في النادي والمنطقة التجارية والمنطقة الترفيهية لتلبية احتياجات قاطني الكمبوند.\r\nيتميز كمبوند اريا صبور بموقعه الجغرافي المتميز في مدينة المستقبل بالتجمع الخامس حيث يقع في اول قطعة على شارع الدائري الأوسطي مباشرة مقابل كمبوند بالم هيلز السكني وماوتن فيو اي سيتي، كما يقع بالقرب من مدينتي والجامعة الأمريكية بالقاهرة. يمتد الكمبوند على مساحة 108 فدان تنقسم الى وحدات سكنية ومساحات خضراء ليتمتع السكان بحياة هادئة ونقية تتميز بالخصوصية بعيدا عن ضوضاء المدينة.', 'At first the need was to create more houses, but then the game started getting more advanced & the buyers started expecting the bar to get raised. Buyers today aspire advanced facilities & higher standards of living. This was why Landmark came up with the idea of ARIA. ARIA is Located in Mostakbal city, Egypt’s newest city destination, with over 11,000 Acres of a fully integrated mega green city. ARIA hits the bullseye when it comes to serving the market’s exact needs, with more greeneries, open\r\nspaces, modern designs & advanced facilities. ARIA was conceived with a strong belief in the benefits of open spaces & how it can affect lives positively. Public open space & parks as well as playgrounds have been associated with better perceived general health & reduced stress levels, with ARIA, home buyers can now raise their expectations bar.', 'الشركة الرائدة في مجال الإنشاء العقاري المتطور منذ عهد بعيد والتي تعتمد على الفكر الحديث في نظم البناء والمعمار مستعينة في ذلك بمجموعة كبيرة من الخبراء والمهندسين الذين يمتلكون\r\nعقلية متفتحة وليونة في إجراء أفخم المجمعات السكنية التي تلبي رغبة المالكين حيث توفر لهم الكثير من الأفكار العصرية في طريقة بناء مشاريع العقارات التي تخص الشركة من أجل رضا العملاء وتعتبر شركة لاند مارك صبور رائدة فى مجال التطوير العقارى وحققت المزيد من الإستثمار والنجاح.', 'Landmark was among a few Egyptian real estate companies that expanded business across borders, Due to the high demand and the booming in the real estate sector in Dubai, Landmark decided to penetrate the UAE market by establishing Continental Investment Company in 2011.', '', NULL, 52, '2018-10-21 17:18:01', '2019-04-02 15:59:18', '31.463389000000006', '30.02647', 1, 1, '', '', 1, 16, 66, NULL, NULL, NULL, NULL, NULL, 0),
(69, 'كمبوند لايان - القاهرة الجديدة', 'LAYAN - New Cairo', 'New Cairo', 'كمبوند ليان التجمع الخامس احدى مشروعات شركة الاهلى للتنمية العقارية ( م. حسين صبور ) على مساحة 233 فدان على شارع التسعين الشمالى بجوار فيلدج جاردنز ونادى بلاتينيوم - 5 دقائق من الجامعة الامريكية .. تمتع بتجربة مختلفة واستكشف الثقافة والتراث الفرنسى العريق الذى ينعكس فى تصميم كمبوند ليان وتصميم الفيلات .. يضم كمبوند ليان 1200 وحدة سكنية ما بين فيلات مستقلة وتوين هاوس وتاون هاوس بمساحات تبدأ من 266م .. احجز وحدتك الان بمقدم 25% وبالتقسيط على 5 سنوات واستلم فى اكتوبر 2018', '“France has something for everyone”. That is commonly known, and the exquisite compound ‘’Layan” promises the same, it has something for everyone, it has it all! Turn your daily life into magical experience, explore the French culture and heritage, live the fantasy and fly to the land of art and beauty in just a few minutes in New Cairo. Layan is located in the heart of New Cairo, where everything is accessible, and Platinum Club is just around the corner. Layan is built upon 233 acres influenced by the French beauty, offering 1200 units of villas, twin houses, and townhouses.', 'الشركة الرائدة في مجال الإنشاء العقاري المتطور منذ عهد بعيد والتي تعتمد على الفكر الحديث في نظم البناء والمعمار مستعينة في ذلك بمجموعة كبيرة من الخبراء والمهندسين الذين يمتلكون\r\n عقلية متفتحة وليونة في إجراء أفخم المجمعات السكنية التي تلبي رغبة المالكين حيث توفر لهم الكثير من الأفكار العصرية في طريقة بناء مشاريع العقارات التي تخص الشركة من أجل رضا العملاء وتعتبر شركة لاند مارك صبور رائدة فى مجال التطوير العقارى وحققت المزيد من الإستثمار والنجاح.', 'Landmark was among a few Egyptian real estate companies that expanded business across borders, Due to the high demand and the booming in the real estate sector in Dubai, Landmark decided to penetrate the UAE market by establishing Continental Investment Company in 2011.', '', NULL, 52, '2018-10-21 17:35:33', '2019-04-02 15:58:48', '31.547494599999936', '30.0317303', 1, 1, '', '', 1, 16, 31, NULL, NULL, NULL, NULL, NULL, 0),
(70, 'زويا - خليج غزاله', 'ZOYA - GHAZALA BAY', 'North Coast', 'يقع مشروع\r\nزويا الساحل الشمالى Zoya North Coast\r\nفى موقع متميز جدا فى الكليو 142 طريق اسكندرية مطروح فى سيدي عبد الرحمن خليج غزاله باي وهي من أرقى مناطق الساحل الشمالي كما هتضمن أنك هتستمتع بواحد من أجمل\r\nوأهدى الشواطئ في الساحل يتمتع بموقع متميز على البحر مباشرة بالإضافة إلي المساحات الخضراء الشاسعة في حضن الطبيعة لتجربة أكثر تميز للباحثين عن الرفاهية بعيدًا عن زحام القاهرة بالإضافة إلى المناظر الطبيعية التي تتميز بها خليج غزاله تمثل الينابيع والبحيرات و حمامات السباحة والمساحات الخضراء حوالي 88% من مساحة المنتجع و تعكس الشاليها في منتجع زويا الساحل الشمالى البساطة والرقي والتميز', 'Zoya is a boutique sea front development covering 60 acres in Ghazala Bay of the North Coast in Kilo 142.\r\n\r\nZOYA IN NUMBERS\r\nDeveloped Land Area: 60 acres\r\nBeachfront: 425 metres\r\nTotal number of units: 350\r\nZOYA HIGHLIGHTS\r\nFeaturing 2 and 3 bedroom chalets, twin houses and standalone villas, all units are delivered fully finished with air conditioners, fitted kitchen cabinets and kitchen appliances.\r\nZoya North Coast residents can enjoy a state of the art clubhouse, a five star hotel and a shopping area.', 'الشركة الرائدة في مجال الإنشاء العقاري المتطور منذ عهد بعيد والتي تعتمد على الفكر الحديث في نظم البناء والمعمار مستعينة في ذلك بمجموعة كبيرة من الخبراء والمهندسين الذين يمتلكون\r\n عقلية متفتحة وليونة في إجراء أفخم المجمعات السكنية التي تلبي رغبة المالكين حيث توفر لهم الكثير من الأفكار العصرية في طريقة بناء مشاريع العقارات التي تخص الشركة من أجل رضا العملاء وتعتبر شركة لاند مارك صبور رائدة فى مجال التطوير العقارى وحققت المزيد من الإستثمار والنجاح.', 'Landmark was among a few Egyptian real estate companies that expanded business across borders, Due to the high demand and the booming in the real estate sector in Dubai, Landmark decided to penetrate the UAE market by establishing Continental Investment Company in 2011.', '', 'uploads/projects/HnCAqK9h2jnGvULRIn1Pt9gthSqnjQ4cwlqbKHsN.mp4', 52, '2018-10-21 18:16:34', '2019-04-02 15:57:42', '28.591084000000023', '31.02989300000001', 1, 1, '', '', 0, 25, 401, NULL, NULL, NULL, NULL, NULL, 0),
(71, 'ركان', 'RUKAN COMPOUND', 'Wadi ElSafa', 'في ركان، لا نبني بيوتًا بل نحيي أوطانًا. تعكس تصاميمنا اهتمامنا الأول بالسكان ليحظوا بفرصة الإقامة في بيئة تنعم بأجواء الإيجابية والإلهام والقيم النبيلة. أعددناه لا ليكون منزلاً فقط، بل ليكون وطنك الخاص بك. تتمسك ركان بجذورها العربية ويتجلى ذلك في طابعها الذي يجمع بين الشرقي والغربي في مساحة غنية بالثقافات وتصميمها العصري فضلًا عن اتسامها\r\nبالهدوء التقليدي. وهذا المشروع يطرح أسلوبًا جديدًا للعيش في دبي مستوحى من ثقافة المجتمع، إذ يتكون من مساحات للبيع بالتجزئة ومرافق ترفيهية ومنازل للإقامة ويحيط بها جميعًا المساحات الخضراء ومراكز التسوق وطرق مخصصة للدراجات وأماكن مميزة للتنزه. وسواء كان اختيارك إحدى الفيلات المنفصلة أو المنازل ذات الطابقين أو البيوت الصغيرة أو الشقق، فكل منها مصمم بحيث يحقق الاستخدامات العملية دون التنازل عن التصميم العصري الذي يليق بكم.\r\nيقع ركان في قلب وادي الصفا بإمارة دبي، لا سيما وإنه على بعد خطوات من المرابع العربية وكذلك يقع على مقربة من أبرز مراكز التسوق وملاعب الجولف والمجمعات الترفيهية. وتمتد ركان على مساحة تصل إلى 2,600,000 قدم مربع، مع تخصيص % 70 من هذه إلى المساحة إلى الأماكن العامة المفتوحة والمساحات الخضراء، ما يمنحك ويمنح جميع أفراد عائلتك بيئة هادئة تدعو إلى الاسترخاء.', 'The luxurious Rukan residential compound provides an unparalleled opportunity to acquire the ultimate comfort and rewarding sense of happiness.\r\nRukan is located in Wadi ElSafa, Dubai Land, behind Arabian ranches. Rukan compound lies on approximately 2,600,000 SQ. feet with a total footprint around 30% and the rest are public areas and greeneries.\r\nIn Rukan everything is Equipped with the highest quality of facilities and homes.\r\nRukan compound comprises retail areas and residential unit of stand-alone villas, twin houses, town houses, and apartments.', 'الشركة الرائدة في مجال الإنشاء العقاري المتطور منذ عهد بعيد والتي تعتمد على الفكر الحديث في نظم البناء والمعمار مستعينة في ذلك بمجموعة كبيرة من الخبراء والمهندسين الذين يمتلكون\r\n عقلية متفتحة وليونة في إجراء أفخم المجمعات السكنية التي تلبي رغبة المالكين حيث توفر لهم الكثير من الأفكار العصرية في طريقة بناء مشاريع العقارات التي تخص الشركة من أجل رضا العملاء وتعتبر شركة لاند مارك صبور رائدة فى مجال التطوير العقارى وحققت المزيد من الإستثمار والنجاح.', 'Landmark was among a few Egyptian real estate companies that expanded business across borders, Due to the high demand and the booming in the real estate sector in Dubai, Landmark decided to penetrate the UAE market by establishing Continental Investment Company in 2011.', '', NULL, 52, '2018-10-21 18:44:23', '2018-10-22 22:11:29', '55.28884849999997', '25.042635', 3, 1, '', '', 0, 41, NULL, NULL, NULL, NULL, NULL, NULL, 0),
(72, 'بلوز تيفني - راس الحكمه', 'BLUES TIFFANY - Ras Elhekma', 'North Coast', 'مكان المشروع : يقع علي البحر مباشره ك 204 اسكندريه مطروح وقبل مرسي\r\nمطروح ب 84 كيلو وعلي بعد 7 كيلو من مخرج طريق الفوكه الجديد الكيلو 19\r\nمساحه المشروع : 248 فدان مقسم الي 4 مراحل بوجهه علي البحر 800\r\nمتر وعمق مشروع 1700 متر علي ارتفاعات تبدء من صفر الي 24 متر', 'Blues tiffany is located at the 204 km sign on the international coastal road, Ras el-Hekma, north coast. Spread over a land of 250 acres of luxury and comfort, 85% of which are landscapes and beautiful water bodies. Delivery date: Phase 1 in 2020', 'تاسست شركه بروجيكت سنه 2015 علي يد المهندس / حسام الدين بهاء الاستشاري\r\nالهندسي لمجموعه شركات طلعت مصطفي سابقا وايضا الاستشاري الهندسي\r\nلمجموعه شركات مينا سابقا وصاحب شركه اعمار مصر للمقاولات والذي\r\nقد قام بتنفيذ العديد من المشروعات', 'Projects real estate development was established in 2015. Its board members have experience of more than 35 years in Egypt and the GCC area in construction and engineering. Projects is committed to building long-term relationships based on integrity performance, value and clients satisfaction.', '', NULL, 53, '2018-10-21 19:31:32', '2019-04-02 15:56:05', '27.987795900000037', '31.0894411', 1, 1, '', '', 1, 25, 401, NULL, NULL, NULL, NULL, NULL, 0),
(73, 'THE LOFT - New Capital', 'THE LOFT - New Capital', 'New Capital', 'THE LOFT is LIVING YARDS\' first project located in the New Capital, extended on a surface of 23 acres and offering real lofts in luxurious buildings with Post Modern British Architecture.\r\nLuxury is a state of great comfort where there is no roof for imagination; fantasies become the only dominant thing.\r\nTHE LOFT is a world where imagination meets real life. It is the perfect harmony between fanciness and practicality, to effectively achieve the desired picture for your place. THE LOFT is what we call a dream enabler. THE LOFT boasts an enigmatic location in The New Capital which is 25 Kilometers away from Fifth Settlement. THE LOFT overlooks the amenities area of the New Capital and lies between Expo and diplomatic areas.\r\nTHE LOFT is 10 minutes away from the massive green river. There is no need to worry about Cairo\'s traffic congestion while you are there, because the New Capital has a monorail that connects it with Nasr City and New Cairo and hence it combats the traffic ordeal in Egypt There is also High Speed Train that will connect the New Capital with 6th of October City also with Ain-EI-Sokhna.', 'THE LOFT is LIVING YARDS\' first project located in the New Capital, extended on a surface of 23 acres and offering real lofts in luxurious buildings with Post Modern British Architecture.\r\nLuxury is a state of great comfort where there is no roof for imagination; fantasies become the only dominant thing.\r\nTHE LOFT is a world where imagination meets real life. It is the perfect harmony between fanciness and practicality, to effectively achieve the desired picture for your place. THE LOFT is what we call a dream enabler. THE LOFT boasts an enigmatic location in The New Capital which is 25 Kilometers away from Fifth Settlement. THE LOFT overlooks the amenities area of the New Capital and lies between Expo and diplomatic areas.\r\nTHE LOFT is 10 minutes away from the massive green river. There is no need to worry about Cairo\'s traffic congestion while you are there, because the New Capital has a monorail that connects it with Nasr City and New Cairo and hence it combats the traffic ordeal in Egypt There is also High Speed Train that will connect the New Capital with 6th of October City also with Ain-EI-Sokhna.', 'LIVING YARDS DEVELOPMENTS is entering the Egyptian market with a new inspiring vision. Introducing a unique concept\r\nto the real estate market. \'Practical Luxury\' the mix of value for money with lavishness and diversity with luxury. A new\r\ntrend setter in the market where compromises don\'t exist.\r\nLIVING YARDS is a grand addition to the world of real estate that subscribes to the mantra of thinking the unthinkable,\r\nwith the sole purpose of satisfying the unmet needs of our customers, through applying a novel methodology in\r\ndelivering all of its projects.', 'LIVING YARDS DEVELOPMENTS is entering the Egyptian market with a new inspiring vision. Introducing a unique concept\r\nto the real estate market. \'Practical Luxury\' the mix of value for money with lavishness and diversity with luxury. A new\r\ntrend setter in the market where compromises don\'t exist.\r\nLIVING YARDS is a grand addition to the world of real estate that subscribes to the mantra of thinking the unthinkable,\r\nwith the sole purpose of satisfying the unmet needs of our customers, through applying a novel methodology in\r\ndelivering all of its projects.', '', NULL, NULL, '2018-10-22 12:45:16', '2018-10-22 12:47:08', '31.740025699999933', '29.9921489', 1, 1, '', '', 1, 16, NULL, NULL, NULL, NULL, NULL, NULL, 0),
(74, 'EL PATIO 6', 'EL PATIO 6', '6th Of October', 'El patio 6 is an intelligently designed living space in 6th of October city. Lush landscaping, swimming pools, and privacy give residents the peace of mind of a high quality lifestyle. With 24-hour security, and maintenance services, El patio 6 centrally located minutes from the ring road, minutes from the 26th of July Mehwar, as well as the Fayoum Road, Haram street, and Cairo-Alexandria desert road.', 'El patio 6 is an intelligently designed living space in 6th of October city. Lush landscaping, swimming pools, and privacy give residents the peace of mind of a high quality lifestyle. With 24-hour security, and maintenance services, El patio 6 centrally located minutes from the ring road, minutes from the 26th of July Mehwar, as well as the Fayoum Road, Haram street, and Cairo-Alexandria desert road.', 'تأسست الشركة عام 1991،وتضم فريق خبراء من المهندسين المعماريين ومصممي المناظر الطبيعية، والتى تعمل على بناء مجتمعات جديدة، تشمل جميع العمليات من الرؤية إلى التصميم والبناء والتشطيب والصيانة، ولتوفر لك مفهومًا جديدًا في المنتجع والحياة السكنية.', 'Established in 1991, LA VISTA Developments prides itself on having created a new standard in resort and residential living through its outstanding record of accomplishments. With an in-house design office that includes an expert team of architects and landscape designers, LA VISTA Developments’ holistic approach to building new communities encompasses all the processes; from vision to design,construction, finishing and maintenance.We have amassed a large client base whose belief in our expertise and in the strong investments made with a property purchase from LAVISTA Developments continues to fuel our drive to grow even further.We have successfully delivered on schedule several LA VISTA resort communities in Ain Sokhna, and the North Coast, with more projects currently being developed.', '', NULL, 55, '2018-10-22 13:42:36', '2019-04-02 15:55:36', '31.07546209999998', '29.98