(80, 'EL PATIO PRIME', 'EL PATIO PRIME', 'El Shorouk City', 'In very close proximity to entrance # 1 of Cairo-Ismailia Road, EL PATIO PRIME occupies a special area within Morabaa El Wozara, a premier neighborhood in El Shorouk known for its exclusivity.\r\n\r\nResidents can access the East Ring Road via a bridge near Carrefour, and head to New Cairo in 5 minutes, also the famous International Medical Centre (Al Markaz Al Teby) Hospital is less than 5 minutes away.\r\n\r\nEL PATIO PRIME is surrounded by a thriving community within close range to amenities, services, commercial outlets, entertainment venues, universities, schools, hospitals, and more.\r\n\r\nEL PATIO PRIME boasts units comprised of stand-alone villas, twin homes, quadro units, and townhouses. Units range in area from 200 m2 to 400 m2, with a variety of layouts and floor plans to suit every family’s lifestyle needs.\r\n\r\nWith a built-up area of 20%, units are designed in the signature EL PATIO classic architecture.\r\n\r\nWater features and sparkling blue fountains running through EL PATIO PRIME, while rich greenery flourishes in the artfully designed landscaping. Along with the naturally shaped swimming pools, EL PATIO PRIME has a calming resort feel and a tranquil environment.\r\n\r\nWith 24-hour security and maintenance services, as well as proximity to near-by commercial and entertainment venues. EL PATIO PRIME adheres to the same philosophy of luxury, exclusivity, and comfort that are the signature of EL PATIO brand.', 'In very close proximity to entrance # 1 of Cairo-Ismailia Road, EL PATIO PRIME occupies a special area within Morabaa El Wozara, a premier neighborhood in El Shorouk known for its exclusivity.\r\n\r\nResidents can access the East Ring Road via a bridge near Carrefour, and head to New Cairo in 5 minutes, also the famous International Medical Centre (Al Markaz Al Teby) Hospital is less than 5 minutes away.\r\n\r\nEL PATIO PRIME is surrounded by a thriving community within close ran