ng developed.', '', NULL, 55, '2018-10-22 14:59:22', '2019-04-02 15:52:29', '31.60289089999992', '30.1722023', 1, 1, '', '', 0, 16, 65, NULL, NULL, NULL, NULL, NULL, 0),
