(85, 'EL PATIO 4', 'EL PATIO 4', 'El Shorouk City', 'Only 25 minutes from Heliopolis and 15 minutes from the Cairo Airport is EL PATIO 4 in El Shorouk City, along the Cairo-Suez road. The newest branch of the prestigious Heliopolis Sporting Club is just 500 m away. The British University in Cairo, only 1.5 Km from EL PATIO 4, and other top quality educational institutions including El Shorouk Academy, make El Shorouk City a comprehensive community East of Cairo. \r\n\r\nEL PATIO 4 is comprised of stand-alone villas, twin homes, quadro units, and townhouses. Vast landscaping, swimming pools, waterfalls, and spacious unit designs all come together to give residents the quality of life they deserve, in addition to 24-hour security services, in addition to maintenance services.', 'Only 25 minutes from Heliopolis and 15 minutes from the Cairo Airport is EL PATIO 4 in El Shorouk City, along the Cairo-Suez road. The newest branch of the prestigious Heliopolis Sporting Club is just 500 m away. The British University in Cairo, only 1.5 Km from EL PATIO 4, and other top quality educational institutions including El Shorouk Academy, make El Shorouk City a comprehensive community East of Cairo. \r\n\r\nEL PATIO 4 is comprised of stand-alone villas, twin homes, quadro units, and townhouses. Vast landscaping, swimming pools, waterfalls, and spacious unit designs all come together to give residents the quality of life they deserve, in addition to 24-hour security services, in addition to maintenance services.', 'تأسست الشركة عام 1991،وتضم فريق خبراء من المهندسين المعماريين ومصممي المناظر الطبيعية، والتى تعمل على بناء مجتمعات جديدة، تشمل جميع العمليات من الرؤية إلى التصميم والبناء والتشطيب والصيانة، ولتوفر لك مفهومًا جديدًا في المنتجع والحياة السكنية.', 'Established in 1991, LA VISTA Developments prides itself on having created a new standard in resort and residential living through its outstanding record of accomplishments. With an in-house design office that includes an expert team of architects and landscape designers, LA VISTA Developments’ holistic approach to building new communities encompasses all the processes; from vision to design,construction, finishing and maintenance.We have amassed a large client base whose belief in our expertise and in the strong investments made with a property purchase from LAVISTA Developments continues to fuel our drive to grow even further.We have successfully delivered on schedule several LA VISTA resort communities in Ain Sokhna, and the North Coast, with more projects currently being developed.', '', NULL, 55, '2018-10-22 15:47:32', '2019-04-02 15:49:21', '31.611052299999983', '30.1401289', 1, 1, '', '', 1, 16, 65, NULL, NULL, NULL, NULL, NULL, 0),
(86, 'لافيستا راى العين السخنة‎‏', 'LA VISTA RAY - Ain Sokhna', 'Ain Sokhna', 'تقع لافيستا راى العين السخنة Lavista Ray Ain Sokhna بعد بورتو بـ25 كيلو، وعلى بعد 15 كيلو من طريق الجلالة، وأيضا بعد قرية كورنادو، وهى من أميز وأرقى المناطق بالعين السخنة على البحر مباشرة، ويعد Lavista Ray Ain Sokhna ‎‏ هو إمتداد لسلسة أعمال ضخمة لشركة Lavista developments للاستثمار والتطوير العقاري\r\nصممت قرية لافيستا راى العين السخنة‎‏  على مساحة 45 فدان بعمق 700 متر، وعرض للشاطىء 300 متر، مقسمة إلى مساحات متنوعة ما بين (شاليهات – توين هاوس – تاون هاوس) على البحر مباشرة ، كما يضم المشروع العديد من الأنشطة والخدمات الترفيهية المتكاملة التى تخدم جميع أفراد الأسرة وتوفر لك جو من الراحة والهدوء ،تتضمن، مساحات خضراء، مول تجارى ، حمامات سباحة، أكوا بارك، مطاعم وكافيهات على أعلى مستوى ، ملاعب رياضية، نادى صحى، جيم وسبا ، منطقة ترفيهية للأطفال، فندق، أمن وحراسة 24 ساعة، وغيرها من الخدمات التى تلبى جميع إحتياجاتك.\r\nخدمات لافيستا راى العين السخنة : \r\nمساحات خضراء\r\nفندق\r\nحمامات سباحة\r\nمطاعم وكافيهات\r\nملاعب رياضية\r\nنادى صحى\r\nجيم وسبا\r\nمنطقة ترفيهية للأطفال\r\nأمن وحراسة 24 ساعة\r\nمساحات لافيستا راى العين السخنة :\r\nتبدأ من 110 متر إلى 210 متر', 'LA VISTA RAY is the first Ain Sokhna addition to be designed in striking and elegant modern contemporary architecture. LA VISTA RAY will bring the Far East to you with an Asian retreat feel by introducing the Thai Boardwalk, where you will experience the true serenity of the islands of the Far East right here in Ain Sokhna.\r\n\r\nLA VISTA RAY offers units of diverse sizes and designs to suit different needs. Unit types vary from chalets and villas, ranging in size from 110m2 to 210m2.\r\n\r\nThe majority of LA VISTA RAY is covered in lush and abundant landscaping, intelligently designed to convey a Far East feel, with a large number of water features and pools, residents will always be only a few steps away from a pool anywhere they are in LA VISTA RAY.\r\n\r\nAn 18% built-up area means that LA VISTA RAY enjoys vast landscaping boasting rich Far Eastern inspired greenery and flora, and fresh spaces to invigorate and inspire. Offering year-round sunshine, continuous cool breezes and pristine azure beaches.', 'تأسست الشركة عام 1991،وتضم فريق خبراء من المهندسين المعماريين ومصممي المناظر الطبيعية، والتى تعمل على بناء مجتمعات جديدة، تشمل جميع العمليات من الرؤية إلى التصميم والبناء والتشطيب والصيانة، ولتوفر لك مفهومًا جديدًا في المنتجع والحياة السكنية.', 'Established in 1991, LA VISTA Developments prides itself on having created a new standard in resort and residential living through its outstanding record of accomplishments. With an in-house design office that includes an expert team of architects and landscape designers, LA VISTA Developments’ holistic approach to building new communities encompasses all the processes; from vision to design,construction, finishing and maintenance.We have amassed a large client base whose belief in our expertise and in the strong investments made with a property purchase from LAVISTA Developments continues to fuel our drive to grow even further.We have successfully delivered on schedule several LA VISTA resort communities in Ain Sokhna, and the North Coast, with more projects currently being developed.', '', NULL, 55, '2018-10-22 15:59:56', '2019-04-02 15:48:50', '32.632614200000035', '29.1853853', 1, 1, '', '', 1, 37, 253, NULL, NULL, NULL, NULL, NULL, 0),
(87, 'لافيستا توباز - العين السخنة', 'LA VISTA TOPAZ - Ain Sokhna', 'Ain Sokhna', 'LA VISTA Topaz is 140 km from Cairo and offers villas and chalets. Like its’ sister communities, LA VISTA Topaz boasts lush green landscaping, vast open spaces, year-round security and maintenance, as well as commercial and entertainment venues, swimming pools, medical services, and more.', 'LA VISTA Topaz is 140 km from Cairo and offers villas and chalets. Like its’ sister communities, LA VISTA Topaz boasts lush green landscaping, vast open spaces, year-round security and maintenance, as well as commercial and entertainment venues, swimming pools, medical services, and more.', 'تأسست الشركة عام 1991،وتضم فريق خبراء من المهندسين المعماريين ومصممي المناظر الطبيعية، والتى تعمل على بناء مجتمعات جديدة، تشمل جميع العمليات من الرؤية إلى التصميم والبناء والتشطيب والصيانة، ولتوفر لك مفهومًا جديدًا في المنتجع والحياة السكنية.', 'Established in 1991, LA VISTA Developments prides itself on having created a new standard in resort and residential living through its outstanding record of accomplishments. With an in-house design office that includes an expert team of architects and landscape designers, LA VISTA Developments’ holistic approach to building new communities encompasses all the processes; from vision to design,construction, finishing and maintenance.We have amassed a large client base whose belief in our expertise and in the strong investments made with a property purchase from LAVISTA Developments continues to fuel our drive to grow even further.We have successfully delivered on schedule several LA VISTA resort communities in Ain Sokhna, and the North Coast, with more projects currently being developed.', '', NULL, 55, '2018-10-22 16:09:43', '2019-04-02 15:48:25', '32.562258799999995', '29.3839139', 1, 1, '', '', 1, 37, 253, NULL, NULL, NULL, NULL, NULL, 0);
