(88, 'VINCI', 'VINCI', 'New Capital', 'Compound Vinci New Capital City By Misr Italia is Located in the new capital, Vinci New Capital is a boutique living state in an upscale community that features exceptional designs to comfort different needs by offering a range of housing types. From high-end villas, to remarkable.\r\n\r\n\r\n\r\n\r\n\r\nVinci Misr Italia New Capital also reﬂects the resident’s self-image and self-concept; envision you in Vinci. The way you see yourself and believe others see you in Vinci New Capital Cairo boutique lifestyle. It is composite of motivations, needs, and wants that are inﬂuenced by design factors.', 'Compound Vinci New Capital City By Misr Italia is Located in the new capital, Vinci New Capital is a boutique living state in an upscale community that features exceptional designs to comfort different needs by offering a range of housing types. From high-end villas, to remarkable.\r\n\r\n\r\n\r\n\r\n\r\nVinci Misr Italia New Capital also reﬂects the resident’s self-image and self-concept; envision you in Vinci. The way you see yourself and believe others see you in Vinci New Capital Cairo boutique lifestyle. It is composite of motivations, needs, and wants that are inﬂuenced by design factors.', 'Misr Italia Properties is a leading real estate developer in Egypt expanding with a range of top-notch projects throughout the country. We aim to change the concept of the ever-growing real estate market by listening to our customers who inspire us to stay ahead with innovative real estate solutions & designs. Built on a philosophy of creativity and innovation, we offer our clients trend-setting projects with unique concepts and designs that are unmatched in the market. Misr Italia Properties is the developer of residential projects such as La Nuova Vista villas and townhouses in New Cairo, administrative compounds such as Cairo Business Park which is set to become New Cairo’s business hub and second homes projects such as Kai Sokhna, Kai Sahel and  the newest addition to our portfolio to will soon be, IL BOSCO new Capital.', 'Misr Italia Properties is a leading real estate developer in Egypt expanding with a range of top-notch projects throughout the country. We aim to change the concept of the ever-growing real estate market by listening to our customers who inspire us to stay ahead with innovative real estate solutions & designs. Built on a philosophy of creativity and innovation, we offer our clients trend-setting projects with unique concepts and designs that are unmatched in the market. Misr Italia Properties is the developer of residential projects such as La Nuova Vista villas and townhouses in New Cairo, administrative compounds such as Cairo Business Park which is set to become New Cairo’s business hub and second homes projects such as Kai Sokhna, Kai Sahel and  the newest addition to our portfolio to will soon be, IL BOSCO new Capital.', '', 'uploads/projects/OL3cNn9fHupMk8pHinyG4Mj1I64Y7YzQlMFkSJNJ.mp4', 59, '2018-10-22 16:39:18', '2019-04-02 15:40:42', '31.337225999999987', '30.06297499999999', 1, 1, '', '', 1, 16, 23, NULL, NULL, NULL, NULL, NULL, 0),
(89, 'لافيستا راس الحكمة', 'LA VISTA RAS EL HIKMA', 'North Coast', 'لافيستا راس الحكمة ‏‎Lavista Ras El Hikma‎‏ تقع فى الكيلو 205 طريق مطروح ، بمنطقة راس الحكمة على البحر مباشرة، وهى من أميز وأرقى المناطق بالساحل الشمالى والتى تتميز بـالرمال البيضاء والمياه الفيروزية، بجوار قرية سيزر سوديك، وبالقرب من مخرج الفوكا الجديد، ويعد ‏‎Lavista Ras El Hikma ‎‏ هو إمتداد لسلسة أعمال ضخمة لشركة Lavista developments للاستثمار والتطوير العقاري\r\nصممت قرية لافيستا راس الحكمة‎‏ على البحر مباشرة لتوفر لك جميع إحتياجاتك في أجواء فاخرة ومريحة، بمساحات مختلفه من 150 متر إلى 220 متر مابين (شاليهات – توين هاوس) ، كما يضم المشروع العديد من الأنشطة والخدمات الترفيهية المتكاملة التى تخدم جميع أفراد الأسرة،مساحات خضراء، مول تجارى ، حمامات سباحة وبحيرات صناعية أمام جميع الوحدات، أكوا بارك، مطاعم وكافيهات على أعلى مستوى ، ملاعب رياضية، نادى صحى، جيم وسبا ، منطقة ترفيهية للأطفال، جراند أوتيل، أمن وحراسة 24 ساعة، وغيرها من الخدمات التى تلبى جميع إحتياجاتك.\r\nمساحات لافيستا راس الحكمة :\r\nتبدأ من 150 متر إلى 220 متر', 'Set in the aquamarine paradise of Ras El Hikma, LA VISTA RAS EL HIKMA features a modern architectural design and carries on the tradition of LA VISTA resort communities amid the breathtaking natural sea wonder of Ras El Hikma. LA VISTA RAS EL HIKMA claims for itself a piece of radiant 1100 m2 white sandy beachfront and unparalleled crystal clear sea.\r\nLA VISTA RAS EL HIKMA is the first of the LA VISTA resort communities to be characterized by villas with full privacy as well as waterfront cabins. With perfectly still turquoise waters and soft white sand, an exotic seashore setting unlike any other along the North Coast.\r\nA VISTA RAS EL HIKMA will also house The Grand Hotel. A five-star luxury hotel along the North Coast offering several restaurants, sports facilities, and the ultimate relaxing spa and beauty center. The Grand Hotel offers LA VISTA RAS EL HIKMA residents a chance to invite family and friends to enjoy the summer together on the North Coast.\r\nResidents can enjoy several pools, cascading waterfalls, beach pools, beach activities, as well as many shops, cafes, and restaurants in the large commercial area provided, as well as the clubhouse. Residents will also have access to entertainment outlets, sports facilities, medical services, and a lot more. Year-long maintenance and security ensure the continued upkeep of all units, and of the entire resort community.\r\nUnits are laid out in a format so that each unit has a water view, whether it is the pristine blue Mediterranean or one of the many pools designed to look like a natural part of the surrounding environment.', 'تأسست الشركة عام 1991،وتضم فريق خبراء من المهندسين المعماريين ومصممي المناظر الطبيعية، والتى تعمل على بناء مجتمعات جديدة، تشمل جميع العمليات من الرؤية إلى التصميم والبناء والتشطيب والصيانة، ولتوفر لك مفهومًا جديدًا في المنتجع والحياة السكنية.', 'Established in 1991, LA VISTA Developments prides itself on having created a new standard in resort and residential living through its outstanding record of accomplishments. With an in-house design office that includes an expert team of architects and landscape designers, LA VISTA Developments’ holistic approach to building new communities encompasses all the processes; from vision to design,construction, finishing and maintenance.We have amassed a large client base whose belief in our expertise and in the strong investments made with a property purchase from LAVISTA Developments continues to fuel our drive to grow even further.We have successfully delivered on schedule several LA VISTA resort communities in Ain Sokhna, and the North Coast, with more projects currently being developed.', '', NULL, 55, '2018-10-22 16:57:58', '2019-04-02 15:47:52', '27.995411800000056', '31.08312349999999', 1, 1, '', '', 1, 25, 401, NULL, NULL, NULL, NULL, NULL, 0),
(90, 'لافيستا باي ايست‎‏', 'LA VISTA BAY EAST', 'North Coast', 'Reaching LA VISTA Bay East has become comfortable and convenient with the opening of the new Fouka Road. Directly adjacent to LA VISTA BAY, the extension, LA VISTA BAY EAST is comprised 6 rows of chalets and stand-alone villas. Units are arranged in a semi-circular step-formation, guaranteeing that every single unit has a sea view. With several pools to choose from, cascading waterfalls, and beach pools, a refreshing dip is always a few steps away from your home. Not to mention the long beachfront that joins that of LA VISTA BAY.  \r\n\r\nResidents can enjoy several pools to choose from, cascading waterfalls, beach pools, as well as a beachfront that joins that of LA VISTA Bay, and pedestrian pier.  LA VISTA Bay East also provides commercial and entertainment outlets, sports facilities, beach activities, medical services, and year-long maintenance and security.', 'Reaching LA VISTA Bay East has become comfortable and convenient with the opening of the new Fouka Road. Directly adjacent to LA VISTA BAY, the extension, LA VISTA BAY EAST is comprised 6 rows of chalets and stand-alone villas. Units are arranged in a semi-circular step-formation, guaranteeing that every single unit has a sea view. With several pools to choose from, cascading waterfalls, and beach pools, a refreshing dip is always a few steps away from your home. Not to mention the long beachfront that joins that of LA VISTA BAY.  \r\n\r\nResidents can enjoy several pools to choose from, cascading waterfalls, beach pools, as well as a beachfront that joins that of LA VISTA Bay, and pedestrian pier.  LA VISTA Bay East also provides commercial and entertainment outlets, sports facilities, beach activities, medical services, and year-long maintenance and security.', 'تأسست الشركة عام 1991،وتضم فريق خبراء من المهندسين المعماريين ومصممي المناظر الطبيعية، والتى تعمل على بناء مجتمعات جديدة، تشمل جميع العمليات من الرؤية إلى التصميم والبناء والتشطيب والصيانة، ولتوفر لك مفهومًا جديدًا في المنتجع والحياة السكنية.', 'Established in 1991, LA VISTA Developments prides itself on having created a new standard in resort and residential living through its outstanding record of accomplishments. With an in-house design office that includes an expert team of architects and landscape designers, LA VISTA Developments’ holistic approach to building new communities encompasses all the processes; from vision to design,construction, finishing and maintenance.We have amassed a large client base whose belief in our expertise and in the strong investments made with a property purchase from LAVISTA Developments continues to fuel our drive to grow even further.We have successfully delivered on schedule several LA VISTA resort communities in Ain Sokhna, and the North Coast, with more projects currently being developed.', '', NULL, 55, '2018-10-22 17:05:08', '2019-04-02 15:41:48', '28.366975499999967', '31.0728268', 1, 1, '', '', 1, 25, 401, NULL, NULL, NULL, NULL, NULL, 0),
(91, 'لافيستا جاردينز', 'LA VISTA GARDENS', 'Ain Sokhna', 'تقع لافيستا جاردنز العين السخنة Lavista Gardens Ain Sokhna بجوار قرية لاجونا باى ، كما تبعد عن القاهرة بـ 146 كيلو فقط، وهى من أميز وأرقى المناطق بالعين السخنة على البحر مباشرة، ويعد Lavista Gardens Ain Sokhna هو إمتداد لسلسة أعمال ضخمة لشركة Lavista developments للاستثمار والتطوير العقاري\r\nخدمات لافيستا جاردنز العين السخنة : \r\nمساحات خضراء\r\nفندق\r\nحمامات سباحة\r\nمطاعم وكافيهات\r\nملاعب رياضية\r\nنادى صحى\r\nجيم وسبا\r\nمنطقة ترفيهية للأطفال\r\nأمن وحراسة 24 ساعة\r\nمساحات لافيستا جاردنز العين السخنة :\r\nتبدأ من 100 متر إلى 180 متر', 'Only 146 km from Cairo is LA VISTA Gardens. With villas and chalets that sit along 6 rows descending towards the sea, each resident enjoys a sea view of the rich Red Sea. With year-round security and maintenance, LA VISTA Gardens also offers commercial and entertainment venues like restaurants and cafés, as well as sports facilities, medical services, and more.', 'تأسست الشركة عام 1991،وتضم فريق خبراء من المهندسين المعماريين ومصممي المناظر الطبيعية، والتى تعمل على بناء مجتمعات جديدة، تشمل جميع العمليات من الرؤية إلى التصميم والبناء والتشطيب والصيانة، ولتوفر لك مفهومًا جديدًا في المنتجع والحياة السكنية.', 'Established in 1991, LA VISTA Developments prides itself on having created a new standard in resort and residential living through its outstanding record of accomplishments. With an in-house design office that includes an expert team of architects and landscape designers, LA VISTA Developments’ holistic approach to building new communities encompasses all the processes; from vision to design,construction, finishing and maintenance.We have amassed a large client base whose belief in our expertise and in the strong investments made with a property purchase from LAVISTA Developments continues to fuel our drive to grow even further.We have successfully delivered on schedule several LA VISTA resort communities in Ain Sokhna, and the North Coast, with more projects currently being developed.', '', NULL, 55, '2018-10-22 17:14:06', '2019-04-02 15:41:16', '32.589782300000024', '29.34556', 1, 1, '', '', 1, 37, 253, NULL, NULL, NULL, NULL, NULL, 0),
(92, 'بوكا - العاصمة الادارية', 'PUKKA - New Capital', 'New Cairo', 'یتمیز مشروع بوكا بموقع إستراتیجي في قلب العاصمة الإداریة الجدیدة ضمن منطقة الطرح الأول الممیز ، بالقرب من فندق الماسة والنھر\r\nالأخضر ومدینة المعارض الدولیة وأكبر كنیسة في الشرق الأوسط، وأیضا یبعد 20 دقیقة فقط من القاھرة الجدیدة و ۱۰ دقائق من مطار\r\nً العاصمة الجدید، وتحیط بھ العدید من المناطق التجاریة بحیث تكون دائم المحافظات عن طریق شریان العاصمة ً ا متصلا بالقاھرة وباقي\r\nالجدیدة (الطریق الدائري الاقلیمي) والذي یربط ۱٦محافظة ببعض.\r\nأھم ممیزات كومبوند PUKKA\r\n• PUKKA ھو أحدث مشروعاتنا في العاصمة الإداریة الجدیدة, تم بناء الكومبوند على مساحة 40 فدان, یتكون من 43 مبني و 4\r\nتصمیمات مختلفة للعمارات, تتمیز بتنوع المساحات لتناسب كافة الإحتیاجات.\r\n• تم استخدام نظام الـ Design Strap حیث یتمیز تصمیم الكومبوند بإطلالات ممیزة لجمیع الوحدات.\r\n• منطقة البولیفارد بمساحة 7000 متر وتعتبر من أھم ممیزات الكومباوند.\r\n• یتوسط الكومبوند شوارع رئیسیة كبرى في العاصمة الإداریة الجدیدة بعرض 96 متر و76 متر.\r\n• الكومبوند بالكامل مزود بكامیرات مراقبة 24 ساعة, في PUKKA , الخصوصیة والأمان أولویة قصوى.\r\n• ما یجعل كومبوند PUKKA فرید من نوعھ ھو الموقع المتمیز والتصمیم العصري الذكي, حیث أن نسبة المباني لا تتعدي الـ 22 %من\r\nإجمالي مساحة المشروع والباقي مساحات خضراء وخدمات متنوعة للملاك مثل حمامات السباحة والنادي صحي وقاعات الإحتفالات\r\nومول تجالاي ومطاعم وكافیھات ومركز طبي وھایبر ماركت ومبنى إداري وغیرھا من الخدمات الأساسیة والترفیھیھ.\r\n• المنطقة التجاریة (Area Commercial (مساحتھا 20 ألف متر وتضم أكبر وأشھر البراندات العالمیة.\r\nنصف تشطیب وأسعار تنافسیة من 9500 جنیھ إلى 12500 جنیھ 2 إلى 227 م 2 • یتمیز الكومبوند بمساحات متنوعة تبدأ من 147 م\r\nللمتر.\r\n• یتمیز الكومبوند بطرق سداد متنوعة:\r\n-مقدم 0 %وأقساط ربع سنویة على 5 سنوات بدون فوائد.\r\n-مقدم 5 %وبعد 6 شھور 5 %والباقي أقساط ربع سنویة على 6 سنوات بدون فوائد.\r\n-مقدم 10 %وبعد سنة 5 %والباقي أقساط ربع سنویة على 7 سنوات بدون فوائد.\r\n-مقدم 15 %وبعد 6 شھور 5 %وبعد سنة 5 %والباقي أقساط ربع سنویة على 8 سنوات بدون فوائد.', 'Pukka is our newest project in the new capital. The project is built\r\non 40 acres. It consists of 43 buildings and 4 different types of\r\nunits. Our ultra-modern architectural design will not only influence the way people live in our community, but the way Egyptians live in our country. What makes Pukka unique is the prime location, green areas, event lounge, swimming pools, clubhouse, solar system panels, pet care service, premium mall, health club, spa and a food court. Our strategic location is in the new capital, near Al Masa Hotel only 20 mins away from New Cairo, surrounded by many commercial areas so you will always be connected to the heart of Cairo.', 'MBG, Master Builders Group consists of a group of the largest and\r\nbest real estate developers in the Delta area.\r\nMBG’s projects vary between medical, residential, educational,\r\narchitectural design, construction and communities.\r\nMBG maintains a full time staff of well-trained real estate\r\nprofessionals who continually strive to provide top quality for their clients. Our current projects are Sunset compound in Ras el Bar, El Ola City Mansoura, Mansoura International Medical Center, El Safa Mall, Nile Academy,El Tahrir Tower and much more.', 'MBG, Master Builders Group consists of a group of the largest and\r\nbest real estate developers in the Delta area.\r\nMBG’s projects vary between medical, residential, educational,\r\narchitectural design, construction and communities.\r\nMBG maintains a full time staff of well-trained real estate\r\nprofessionals who continually strive to provide top quality for their clients. Our current projects are Sunset compound in Ras el Bar, El Ola City Mansoura, Mansoura International Medical Center, El Safa Mall, Nile Academy,El Tahrir Tower and much more.', '', NULL, 60, '2018-10-22 18:40:26', '2019-04-02 15:40:04', '31.730901399999993', '30.0091448', 1, 1, '', '', 1, 16, 23, NULL, NULL, NULL, NULL, NULL, 0),
(93, 'بو ايلاند', 'Bo Island', 'North Coast', 'بو ايلاند الساحل الشمالي bo island north coast\r\nالذي يعطي الطابع البوهيمي المختلف و الخارج عن الاطار المألوف مع جمال القرية و الوانها الجريئه و من هنا قد اتخذت الإسم وهو (Bo) شعار و رمزاً واختصاراً للبوهيميه و الذى قد اتخذته ماكسيم جروب فى مشروعاتها.\r\nحيث يكون المشروع مبني على مساحه 300 فدان وتتميز المشروع بانها القريه الاجمل في \r\nالساحل الشمالي حيث انها على عمق 1200 متر بالاضافه الي عرض البحر 800 متر وهذه من اهم المميزات التي تتميز بيها ان جميع الشاليهات يتطل جميعها على البحر مباشر حيث يتمكن العميل الاستمتاع و الاسترخاء بكل ما هو جميل ورائع بالاضافه الى ان القريه متمده بشواطئ كريستال لاجون  crystal lagoon\r\nتقع القرية  في الكيلو 120 بعد مارينا ب 15 كيلو حيث انها تعد قريبه من مارينا وهاسيندا باي الساحل الشمالي و يحتل المشروع بو سيدي عبدالرحمن كاملاً  مساحه 1700 فدان ويعتبر من اضخم و افضل و ارقى مشاريع الساحل الشمالي والتي قد صُنفت من اكبر و اضخم المشاريع الاستثماريه العملاقه.', 'Bo islands is sited on a bay and features an 800 meter long beach of white sands next to a crystal clear sea - the perfect place to swim, relax and unwind. You could also socialize under the blue skies and the warm sunshine. The beach will have a supply of cabanas, beds, loungers and umbrellas, and for the\r\nmore active there will be fun options like jet skiing and kayaking.\r\nBo islands is located at KM 120 on the Alexandria/Matrouh north\r\ncoast road and spreads over a 1,300,000 m2 land area and with a\r\n12% footprint.', 'For almost four decades, Maxim Investment Group has focused on different dynamic business ventures responding to market needs, along the establishment and development of luxury residential, commercial entertainment and leisure projects. In all these endeavors and across all fronts, we have taken pride in our continuous ability to introduce prosperous projects, products and services. \r\nAs pioneer developers and investors in numerous and comprehensive business ventures, we have committed ourselves to uphold the best practices as we carry on our ambitious growth and diversification plans. We are always adamant to provide the highest quality, ensuring that each of our projects, products and services are presented with the best interests of both our clients and investors at heart. Maxim Investment Group takes it upon itself to constantly transform the way people experience life', 'For almost four decades, Maxim Investment Group has focused on different dynamic business ventures responding to market needs, along the establishment and development of luxury residential, commercial entertainment and leisure projects. In all these endeavors and across all fronts, we have taken pride in our continuous ability to introduce prosperous projects, products and services. \r\nAs pioneer developers and investors in numerous and comprehensive business ventures, we have committed ourselves to uphold the best practices as we carry on our ambitious growth and diversification plans. We are always adamant to provide the highest quality, ensuring that each of our projects, products and services are presented with the best interests of both our clients and investors at heart. Maxim Investment Group takes it upon itself to constantly transform the way people experience life', '', NULL, 61, '2018-10-22 19:12:16', '2019-04-02 15:39:25', '28.824684400000024', '30.9418739', 1, 1, '', '', 0, 25, 401, NULL, NULL, NULL, NULL, NULL, 0),
(94, 'لا كابيتال - العاصمة الجديدة', 'La Capitale - New Capital', 'New Capital', 'يقع مشروع لا كابيتال العاصمة الإدارية الجديدة  على بعد دقائق من مدينة المعارض وبالقرب من ومنطقة السفارات، يقام مشروع لاكابيتال العاصمة الإدارية الجديدة على مساحة 13 فدان حيث لاتتعدى نسبة الإنشاءات 20 % من المساحة الإجمالية للمشروع والباقى مساحات خضراء ومنطقة خدمات و أنشطة ترفيهية متنوعة لا كابيتال العاصمة الإدارية الجديدة صمم الكمبوند بأحدث التصميمات الإنشائية الحديثة على الطراز الفرنسى …\r\n\r\nتحاط بمشروع لا كابيتال العاصمة الإدارية الجديدة أكبر قدر من المساحات الخضراء التى تشغل الأغلبية العظمى من مساحة المشروع حيث تتخلل الوحدات السكنية مجموع من الأشجار المبدعة المنظر …\r\n\r\nينقسم مشروع لا كابيتال العاصمة الإدارية الجديدة إلى وحدات سكني  متنوعة من الشقق والدوبلكس والبنت هاوس وسيتم تسليم جميع الوحدات السكنية متشطبة بالكامل وبالتكييفات على أعلى مستوى من التصميم.', 'La Capitale compound is the newest project of Pyramids real estate Company in the distinctive area of the new administrative capital, on an area of 13 acres.\r\nLa Capitale is the newest French style residential compound in Egypt, with the highest modern technology infrastructure. The compound located in the distinctive area of the new administrative capital, beside Almasa Hotel, next to the diplomatic area, close to the Green Nile and the governmental buildings, which overlooks the green area.\r\nThe compound includes all the healthy and entertainment services. Enjoy privacy and tranquility. \r\nWith La Capitale Paris East, life is different. \r\nBook your unit now at La Capitale and enjoy the most powerful \r\nfeatures and offers.', 'PYRAMiDS is one of the leading real estate development companies which was corporated in France at 2000 and started its business in Egypt at 2013 with a main office located at 6 October City. Following that Pyramids opened a new branch at the beginning of 2018 located at Makram Abeed, Nasr city, in order to met the Egyptian market needs. Pyramids is a pioneering developer of integrated master-planned Communities. Pyramids has transformed the real-estate sector in France and brings to the market award-winning large- scale development, meeting Egypt\'s ever growing need for high quality housing commercial and retail spaces. we pride ourselves on our passion for excellence and commitment to lustering long term. relation shifts with our clients, shareholders business partners and employees, has helped us grow and to be the corporation we are today. Pyramids offer both commercial and residential properties for sale and rent along with other high investment opportunities in Egypt', 'PYRAMiDS is one of the leading real estate development companies which was corporated in France at 2000 and started its business in Egypt at 2013 with a main office located at 6 October City. Following that Pyramids opened a new branch at the beginning of 2018 located at Makram Abeed, Nasr city, in order to met the Egyptian market needs. Pyramids is a pioneering developer of integrated master-planned Communities. Pyramids has transformed the real-estate sector in France and brings to the market award-winning large- scale development, meeting Egypt\'s ever growing need for high quality housing commercial and retail spaces. we pride ourselves on our passion for excellence and commitment to lustering long term. relation shifts with our clients, shareholders business partners and employees, has helped us grow and to be the corporation we are today. Pyramids offer both commercial and residential properties for sale and rent along with other high investment opportunities in Egypt', '', 'uploads/projects/hxbKuiLaH85EtGWvlAa7srfEiaUoP6JN7qy0vUVE.mp4', 115, '2018-11-13 15:37:58', '2019-04-02 15:38:47', '31.740025699999933', '29.9921489', 1, 1, '', '', 1, 16, 23, NULL, NULL, NULL, NULL, NULL, 0),
(95, 'IVORY PLAZA', 'IVORY PLAZA', 'New Capital', 'Ivory Plaza is a mixed use fully finished building, Built over 20,000 m2 to provide a wide range of facilities to serve a surrounding population of 200,000 person,The building contains commercial shops , cafes , restaurants, administrative offices , medical clinics as well as Serviced Apartments ,All under an impressive roof top view with a sky lounge , spa & gym. The building also offers a conference hall space and a variety of meeting rooms for business needs.', 'Ivory Plaza is a mixed use fully finished building, Built over 20,000 m2 to provide a wide range of facilities to serve a surrounding population of 200,000 person,The building contains commercial shops , cafes , restaurants, administrative offices , medical clinics as well as Serviced Apartments ,All under an impressive roof top view with a sky lounge , spa & gym. The building also offers a conference hall space and a variety of meeting rooms for business needs.', 'Driven by dedication & market knowledge Tamayoz succeeded to be a very fast growing\r\ncompany in Real Estate development and construction in both Residential and Commercial\r\nsectors.\r\n- Founded in 2008 Tamayoz developed & finalized more than 30 projects in Egypt & Saudi\r\nArabia with value of more than EGP 1.5 Billion.\r\n- In Every New Project Tamayoz aims to deliver a higher quality , hiring very qualified\r\nengineers and using the best existing technologies inside and outside Egypt.\r\n- Tamayoz mission does not end upon completion of the project , it delivers a complete\r\nservice and experience to the client.\r\n- As our main objective is to meet our clients requirements using best quality solutions at the\r\nmost effective cost.\r\nTamayouz developed & still developing more than 30 residential buildings in Andalus ,\r\nLoutus , Beit El watan & more , Also it built commercial projects in Saudi Arabia like\r\nAl-Battarjee college of health & science & buildings in king Khaled University at southern', 'Driven by dedication & market knowledge Tamayoz succeeded to be a very fast growing\r\ncompany in Real Estate development and construction in both Residential and Commercial\r\nsectors.\r\n- Founded in 2008 Tamayoz developed & finalized more than 30 projects in Egypt & Saudi\r\nArabia with value of more than EGP 1.5 Billion.\r\n- In Every New Project Tamayoz aims to deliver a higher quality , hiring very qualified\r\nengineers and using the best existing technologies inside and outside Egypt.\r\n- Tamayoz mission does not end upon completion of the project , it delivers a complete\r\nservice and experience to the client.\r\n- As our main objective is to meet our clients requirements using best quality solutions at the\r\nmost effective cost.\r\nTamayouz developed & still developing more than 30 residential buildings in Andalus ,\r\nLoutus , Beit El watan & more , Also it built commercial projects in Saudi Arabia like\r\nAl-Battarjee college of health & science & buildings in king Khaled University at southern', '', NULL, 246, '2019-02-05 18:01:17', '2019-04-02 15:38:20', '31.68345249999993', '30.0290996', 1, 1, '', '', 0, 16, 23, NULL, NULL, NULL, NULL, NULL, 0),
(96, 'GREEN AVENUE - New Capital', 'GREEN AVENUE - New Capital', 'New Capital', 'The ultimate urban elegance\r\nIn a location with amazing views, we have tailored the project with passion to\r\nprovide all residents with utmost smooth living.\r\nAll units have direct views over the treed avenues, the wide landscaped\r\npromenades that surround the project, or the green buffered wide roads.\r\nLiving in Green Avenue symbolizes all the aspects of quality living, from\r\nunderground parking to double height entrances, stone cladded walls, and\r\nspacious lobbies.\r\nThe architecture is inspired by art deco elegance with a modern approach.\r\nUnits are not only richly varied in size and program but also flexibly reconfigurable\r\nto suit different need, tastes and lifestyles.', 'The ultimate urban elegance\r\nIn a location with amazing views, we have tailored the project with passion to\r\nprovide all residents with utmost smooth living.\r\nAll units have direct views over the treed avenues, the wide landscaped\r\npromenades that surround the project, or the green buffered wide roads.\r\nLiving in Green Avenue symbolizes all the aspects of quality living, from\r\nunderground parking to double height entrances, stone cladded walls, and\r\nspacious lobbies.\r\nThe architecture is inspired by art deco elegance with a modern approach.\r\nUnits are not only richly varied in size and program but also flexibly reconfigurable\r\nto suit different need, tastes and lifestyles.', 'For over 10 years, New Jersey Developments has been providing quality living\r\nin Egypt and in the USA with the highest standards.\r\nTransferring its expertise to the region in 2018, the company has joined in the\r\nfast growing market in Egypt to provide consumers with a different view of the\r\nreal estate world. Our aim is to understand our consumers’ needs and provide\r\nhigh quality living with competitive prices.\r\nOur projects range from commercial and medical center to residential households\r\nwhere we have over 2000 units delivered, and 650 under construction. In the\r\ncommercial sector we’ve developed 3 malls and 1 medical center, all of which\r\nare located in the upcoming and coming neighborhoods of Sherouk City and\r\nNew Cairo.\r\nThe newest additions to the New Jersey Developments portfolio comes in\r\nEgypt’s ‘New Administrative Capital, launching several projects all located in\r\nprime locations. The first of which ‘Green Avenue’, will be an Art Deco inspired\r\nescape.', 'For over 10 years, New Jersey Developments has been providing quality living\r\nin Egypt and in the USA with the highest standards.\r\nTransferring its expertise to the region in 2018, the company has joined in the\r\nfast growing market in Egypt to provide consumers with a different view of the\r\nreal estate world. Our aim is to understand our consumers’ needs and provide\r\nhigh quality living with competitive prices.\r\nOur projects range from commercial and medical center to residential households\r\nwhere we have over 2000 units delivered, and 650 under construction. In the\r\ncommercial sector we’ve developed 3 malls and 1 medical center, all of which\r\nare located in the upcoming and coming neighborhoods of Sherouk City and\r\nNew Cairo.\r\nThe newest additions to the New Jersey Developments portfolio comes in\r\nEgypt’s ‘New Administrative Capital, launching several projects all located in\r\nprime locations. The first of which ‘Green Avenue’, will be an Art Deco inspired\r\nescape.', '', NULL, 311, '2019-03-04 19:27:14', '2019-04-02 15:36:54', '31.504291400000056', '30.031105', 1, 1, '', '', 0, 16, 23, NULL, NULL, NULL, NULL, NULL, 0),
(97, 'SUN CAPITAL', 'SUN CAPITAL', '6th Of October', 'Sun Capital, a new city located at in the sight of the great Pyramids one of the greatest wonders of the ancient world. Stretched over 575 acres in the heart of the world’s greatest civilizations, “Sun Capital” is the world\'s latest addition of a complete metropolitan city named the New Touristic Capital of Egypt, where life, business and entertainment are combined. This project will be the crown jewel of  “Arabia Holding” in partnership with the Ministry of Housing, placing the project on a national scale as one of the new urban developments created for the greater glory of future planned Egypt.', 'Sun Capital, a new city located at in the sight of the great Pyramids one of the greatest wonders of the ancient world. Stretched over 575 acres in the heart of the world’s greatest civilizations, “Sun Capital” is the world\'s latest addition of a complete metropolitan city named the New Touristic Capital of Egypt, where life, business and entertainment are combined. This project will be the crown jewel of  “Arabia Holding” in partnership with the Ministry of Housing, placing the project on a national scale as one of the new urban developments created for the greater glory of future planned Egypt.', 'We identify opportunistic real estate investments, develop creative strategies for adding value and effectively executing those strategies to generate exceptional returns while providing consistent, stable cash-flow. In executing our investment strategy we employ a dual strategy in building portfolios - one strategy focuses on acquiring existing stabilized cash flowing assets to support stable, consistent, dividend distributions to our investors. The second strategy focuses on acquiring opportunistic assets which we can reposition, redevelop or remarket to create value enhancement and capital appreciation.', 'We identify opportunistic real estate investments, develop creative strategies for adding value and effectively executing those strategies to generate exceptional returns while providing consistent, stable cash-flow. In executing our investment strategy we employ a dual strategy in building portfolios - one strategy focuses on acquiring existing stabilized cash flowing assets to support stable, consistent, dividend distributions to our investors. The second strategy focuses on acquiring opportunistic assets which we can reposition, redevelop or remarket to create value enhancement and capital appreciation.', '', NULL, 312, '2019-03-04 20:06:21', '2019-04-02 15:19:01', '31.091085600000042', '29.9305981', 1, 1, '', '', 0, 21, 74, NULL, NULL, NULL, NULL, NULL, 0),
(98, 'AZAD - New Cairo', 'AZAD - New Cairo', 'New Cairo', 'AZAD is a vision; an engagement of all the senses. Light streams in through wide windows, overlooking gardens,\r\nfootpaths, bike paths. The sound of water structures trickles on in the background. Birds and children’s laughter. With\r\nsolar energy landscape lighting and the earthy tones of the buildings, the view is soothing and the structures\r\nsustainable. Simple. Timeless. Elegant.\r\n“Second, efficiency and functionality. Apartments designed around the needs of their inhabitants, the use of every\r\nspace optimized for free, uncluttered living.”\r\nThe units are accessible and easily furnished, with ample storage space and natural light. The design is intuitive, the\r\nwalls and doors built around people’s lives, not the other way around.', 'AZAD is a vision; an engagement of all the senses. Light streams in through wide windows, overlooking gardens,\r\nfootpaths, bike paths. The sound of water structures trickles on in the background. Birds and children’s laughter. With\r\nsolar energy landscape lighting and the earthy tones of the buildings, the view is soothing and the structures\r\nsustainable. Simple. Timeless. Elegant.\r\n“Second, efficiency and functionality. Apartments designed around the needs of their inhabitants, the use of every\r\nspace optimized for free, uncluttered living.”\r\nThe units are accessible and easily furnished, with ample storage space and natural light. The design is intuitive, the\r\nwalls and doors built around people’s lives, not the other way around.', 'تاسست الشركة بموجب المرسوم الجمهورى الصادر فى 20/5/1954 وطبقا للقانون رقم 601 لسنه 1953 باسم/ شركة التعمير والمساكن الشعبية- شركة تابعه مصرية وغرض الشركة القيام بكافه الاعمال المتعلقة بمشروعات التخطيط والتصميم والبحوث والتنفيذ لمشروعات التخطيط العمرانى والتصميم المعمارى والانشائى والمرافق.', 'TAMEER is a company with a proud and long history. For three generations, we have grown to become one of Egypt’s most comprehensive real estate development companies, with a team of over 150 individuals covering all areas of the industry from business development to community management.', '', NULL, 309, '2019-03-05 14:27:00', '2019-04-02 15:37:39', '31.506623499999932', '30.01398370000001', 1, 1, '', '', 0, 16, 31, NULL, NULL, NULL, NULL, NULL, 0),
(99, 'Galleria - New Cairo', 'Galleria - New Cairo', 'New Cairo', 'PHASE 1&2 DELIVERED WITH TOTAL OF 43 BUILDINGS AND ALMOST 600 APARTMENTS\r\n• CONSTRUCTION UPDATE ALL CONCRETE AND BLOCK WORK BY END OF MARCH.\r\n• PHASE 1&2 EXTERIOR CLADDING FINISHED WITH ALL MARBLE AND STONE FINISHES\r\nAND ALL FACADES INCLUDING ENTRANCES AND ELEVATORS.\r\n• PHASE 4&6 WORKING ON EXTERIOR FINISHED THAT WILL BE DONE IN 4 MONTHS.\r\n• ALL INFRASTRUCTURE WORKS AND PERMANENT CONNECTIONS FOR ALL\r\nDISCIPLINES (ELECTRICITY CONNECTIONS, WATER, TELEPHONE, NATURAL GAS\r\nCONNECTIONS', 'PHASE 1&2 DELIVERED WITH TOTAL OF 43 BUILDINGS AND ALMOST 600 APARTMENTS\r\n• CONSTRUCTION UPDATE ALL CONCRETE AND BLOCK WORK BY END OF MARCH.\r\n• PHASE 1&2 EXTERIOR CLADDING FINISHED WITH ALL MARBLE AND STONE FINISHES\r\nAND ALL FACADES INCLUDING ENTRANCES AND ELEVATORS.\r\n• PHASE 4&6 WORKING ON EXTERIOR FINISHED THAT WILL BE DONE IN 4 MONTHS.\r\n• ALL INFRASTRUCTURE WORKS AND PERMANENT CONNECTIONS FOR ALL\r\nDISCIPLINES (ELECTRICITY CONNECTIONS, WATER, TELEPHONE, NATURAL GAS\r\nCONNECTIONS', 'We identify opportunistic real estate investments, develop creative strategies for adding value and effectively executing those strategies to generate exceptional returns while providing consistent, stable cash-flow. In executing our investment strategy we employ a dual strategy in building portfolios - one strategy focuses on acquiring existing stabilized cash flowing assets to support stable, consistent, dividend distributions to our investors. The second strategy focuses on acquiring opportunistic assets which we can reposition, redevelop or remarket to create value enhancement and capital appreciation.', 'We identify opportunistic real estate investments, develop creative strategies for adding value and effectively executing those strategies to generate exceptional returns while providing consistent, stable cash-flow. In executing our investment strategy we employ a dual strategy in building portfolios - one strategy focuses on acquiring existing stabilized cash flowing assets to support stable, consistent, dividend distributions to our investors. The second strategy focuses on acquiring opportunistic assets which we can reposition, redevelop or remarket to create value enhancement and capital appreciation.', '', NULL, 312, '2019-03-05 14:46:32', '2019-04-02 15:18:14', '31.48913379999999', '30.024962', 1, 1, '', '', 0, 16, 31, NULL, NULL, NULL, NULL, NULL, 0),
(100, 'Amazing high ceiling for rent in south', 'Amazing high ceiling for rent in south', 'zamalik', '<strong></strong><h2>ما هو \"لوريم إيبسوم\" ؟</h2><p>لوريم إيبسوم(Lorem Ipsum) هو ببساطة نص شكلي (بمعنى أن الغاية هي الشكل ولس المحتوى) ويُستخدم في صناعات المطابع ودور النشر. كان لوريم إيبسوم ولايزال المعيار للنص الشكلي منذ القرن الخامس عشر عندما قامت مطبعة مجهولة برص مجموعة من الأحرف بشكل عشوائي أخذتها من نص، لتكوّن كتيّب بمثابة دليل أو مرجع شكلي لهذه الأحرف. خمسة قرون من الزمن لم تقضي على هذا النص، بل انه حتى صار مستخدماً وبشكله الأصلي في الطباعة والتنضيد الإلكتروني. انتشر بشكل كبير في ستينيّات هذا القرن مع إصدار رقائق \"ليتراسيت\" (Letraset) البلاستيكية تحوي مقاطع من هذا النص، وعاد لينتشر مرة أخرى مؤخراَ مع ظهور برامج النشر الإلكتروني مثل \"ألدوس بايج مايكر\" (Aldus PageMaker) والتي حوت أيضاً على نسخ من نص لوريم إيبسوم.</p>', '<h2>ما هو \"لوريم إيبسوم\" ؟</h2><p>لوريم إيبسوم(Lorem Ipsum) هو ببساطة نص شكلي (بمعنى أن الغاية هي الشكل ولس المحتوى) ويُستخدم في صناعات المطابع ودور النشر. كان لوريم إيبسوم ولايزال المعيار للنص الشكلي منذ القرن الخامس عشر عندما قامت مطبعة مجهولة برص مجموعة من الأحرف بشكل عشوائي أخذتها من نص، لتكوّن كتيّب بمثابة دليل أو مرجع شكلي لهذه الأحرف. خمسة قرون من الزمن لم تقضي على هذا النص، بل انه حتى صار مستخدماً وبشكله الأصلي في الطباعة والتنضيد الإلكتروني. انتشر بشكل كبير فdqwdي ستينيّات هذا القرن مع إصدار رقائق \"ليتراسيت\" (Letraset) البلاستيكية تحوي مقاطع من هذا النص، وعاد لينتشر مرة أخرى مؤخراَ مع ظهور برامج النشر الإلكتروني مثل \"ألدوس بايج مايكر\" (Aldus PageMaker) والتي حوت أيضاً على نسخ من نص لوريم إيبسوم.</p>', '<p>لوريم إيبسوم(Lorem Ipsum) هو ببساطة نص شكلي (بمعنى أن الغاية هي الشكل ولس المحتوى) ويُستخدم في صناعات المطابع ودور النشر. كان لوريم إيبسوم ولايزال المعيار للنص الشكلي منذ القرن الخامس عشر عندما قامت مطبعة مجهولة برص مجموعة من الأحرف بشكل عشوائي أخذتها من نص، لتكوّن كتيّب بمثابة دليل أو مرجع شكلي لهذه الأحرف. خمسة قرون من الزمن لم تقضي على هذا النص، بل انه حتى صار مستخدماً وبشكله الأصلي في الطباعة والتنضيد الإلكتروني. انتشر ب